B.a80=new A.C("Fen\xeatres acoustiques en \xe9chocardiographie. Les 3 fen\xeatres principales sont les fen\xeatres parasternales, apicales et sous-costales. Les fen\xeatres sus-sternales et parasternales droites ont un int\xe9r\xeat limit\xe9 en r\xe9animation. Les ombres ovales grises repr\xe9sentent la position de la sonde sur le thorax, les fl\xe8ches la rotation de la sonde pour obtenir les diff\xe9rentes coupes sur une m\xeame fen\xeatre.","assets/images/pathologies/divers/echo/7fenetres.gif",null)
B.a8q=new A.C("Coupes \xe9chocardiographiques principales obtenues chez des patients de r\xe9animation intub\xe9s et ventil\xe9s. Les zones ovales grises montrent la position et l'orientation de la sonde au niveau de chacune des 3 fen\xeatres acoustiques principales. Sur une m\xeame fen\xeatre, une rotation de la sonde de 90o sur son grand axe permet d'obtenir 2 coupes diff\xe9rentes. VG = ventricule gauche, VD = ventricule droit, OG = oreillette gauche, OD = oreillette droite, VCI = veine cave inf\xe9rieure, P = p\xe9ricarde. Ao = aorte. Sur la coupe parasternale grand axe, noter l'aspect hyper\xe9chog\xe8ne du p\xe9ricarde normal.",u.ci,null)
B.a8S=new A.C("Diagnostic positif de c\u0153ur pulmonaire aigu en r\xe9animation. Exemple d'un patient de 43 ans en SDRA apr\xe8s p\xe9ritonite. a1 : Dilatation du VD avec rapport VD/VG > 1 en coupe apicale 4 cavit\xe9s. a2 : coupe PSPA montrant le septum paradoxal. Le septum interventriculaire a une forme lin\xe9aire (fl\xe8che) qui fait perdre la forme arrondie au VG. Noter la dilatation du VD bien visible sur cette coupe. b1 : m\xeame patient 24 heures apr\xe8s prescription de monoxyde d'azote et d\xe9charge vol\xe9mique. Normalisation du rapport VD/VG. b2 : disparition du septum paradoxal avec r\xe9cup\xe9ration de la forme circulaire du VG en coupe PSPA.","assets/images/pathologies/divers/echo/12diagcoeurpulmaigu.gif",null)
B.a90=new A.C("Signification physiologique du flux Doppler mitral. Ce flux correspond au remplissage diastolique du ventricule gauche et est caract\xe9ris\xe9 par une onde E protodiastolique correspondant au remplissage passif et une onde A t\xe9l\xe9diastolique correspondant \xe0 la systole auriculaire. L'enregistrement simultan\xe9 de l'ECG est imp\xe9ratif pour diff\xe9rencier l'onde E de l'onde A. FM = fermeture mitrale ; OA : ouverture aortique ; FA = fermeture aortique. RI = relaxation isovolum\xe9trique ; RR remplissage rapide. TDE = temps de d\xe9c\xe9l\xe9ration de l'onde E ; Ao = courbe de pression aortique ; OG = courbe de pression auriculaire gauche ; VG = courbe de pression ventriculaire gauche.",u.e,null)
B.a9p=new A.C("Diagnostic positif et diff\xe9rentiel d'\xe9panchement p\xe9ricardique. a : \xe9chographie normale, coupe PSGA. Le p\xe9ricarde post\xe9rieur normal est hyper\xe9chog\xe8ne et sa limite post\xe9rieure est situ\xe9e entre l'aorte thoracique descendante (Ao) et la paroi post\xe9rieure du ventricule gauche (PPVG) (fl\xe8che). b : \xe9panchement p\xe9ricardique (fl\xe8che) en coupe PSGA dont la limite post\xe9rieure est situ\xe9e entre l'aorte thoracique descendante (Ao) et la paroi post\xe9rieure du VG. c : \xe9panchement p\xe9ricardique en coupe apicale 4 cavit\xe9s ; l\xe0 encore, l'aorte thoracique descendante est un rep\xe8re fondamental. d : \xe9panchement pleural gauche (fl\xe8ches). L'\xe9panchement est dans ce cas situ\xe9 en arri\xe8re de l'aorte thoracique descendante (Ao).","assets/images/pathologies/divers/echo/11diagepanchementpericardique.gif",null)
B.a9C=new A.C("Principes du Doppler transcr\xe2nien avec rep\xe9rage \xe9chographique 2D coupl\xe9e au Doppler couleur. La sonde de cardiologie est appliqu\xe9e perpendiculairement sur la fosse temporale, au-dessus de l'arcade zygomatique et parall\xe8le \xe0 cette derni\xe8re. L'axe de la sonde suit la ligne imaginaire joignant le conduit auditif externe au cantus externe. L'\xe9chographie 2D permet de visualiser la grande aile du sph\xe9no\xefde, rep\xe8re permettant de v\xe9rifier la bonne p\xe9n\xe9tration endocr\xe2nienne des ultrasons. Le Doppler couleur permet ensuite de mat\xe9rialiser la position et l'angulation des art\xe8res c\xe9r\xe9brales. ACM = art\xe8re c\xe9r\xe9brale moyenne ; ACA = art\xe8re c\xe9r\xe9brale ant\xe9rieure ; ACP = art\xe8re c\xe9r\xe9brale post\xe9rieure ; CI : carotide interne ; AV = art\xe8re vert\xe9brale ; CP = art\xe8re communicante post\xe9rieure ; TB = tronc basilaire.","assets/images/pathologies/divers/echo/25dtc.gif",null)
B.a9S=new A.C("Exemple d'une fuite mitrale significative en Doppler couleur.","assets/images/pathologies/divers/echo/14fuitemitral.gif",null)
B.a9U=new A.C("Variations des ondes E, A et du TDE avec les statuts vol\xe9miques.",u.a,null)
B.aae=new A.C("Doppler transcr\xe2nien en pratique : analyse en trois \xe9tapes \xe0 l'aide de la sonde d'\xe9chographie cardiaque. Sujet sain. a : rep\xe9rage de la grande aile du sph\xe9no\xefde (fl\xe8che 1). Ce rep\xe8re anatomique appara\xeet sous forme d'une image arciforme hyper\xe9chog\xe9ne, sa visualisation atteste de la travers\xe9e effective de la bo\xeete cr\xe2nienne par les ultrasons. b : Doppler couleur de l'art\xe8re c\xe9r\xe9brale moyenne (ACM) (fl\xe8che 2) : flux rouge, venant vers la sonde, align\xe9 avec le faisceau d'ultrasons, permettant une mesure fiable des vitesses. c : Doppler puls\xe9 centr\xe9 sur la portion d'art\xe8re \xe0 analyser, ici portion M1 de l'ACM, l'angle d'insonation est bon car le flux et l'axe de tir Doppler sont parall\xe8les.","assets/images/pathologies/divers/echo/26dtcpratique.gif",null)
B.aaX=new A.C("Technique d'enregistrement du Doppler mitral classique (gauche) et du Doppler tissulaire \xe0 l'anneau mitral lat\xe9ral (droite). Les deux trac\xe9s Doppler sont recueillis l'un apr\xe8s l'autre \xe0 partir d'une coupe apicale 4 cavit\xe9s qui doit rester stable au cours de la mesure. Le Doppler tissulaire montre 2 pics n\xe9gatifs car l'anneau se d\xe9place en sens inverse du flux. Le rapport des 2 pics de v\xe9locit\xe9 E/Ea est un indice statique de pr\xe9charge. Un rapport E/Ea < 7 est en faveur d'une hypovol\xe9mie, un rapport > 11 en faveur de pressions hautes. Un rapport > 15 est \xe9vocateur de pressions gauches tr\xe8s \xe9lev\xe9es. Cet indice offre les avantages d'une bonne reproductibilit\xe9 et de sa validit\xe9 chez les patients en fibrillation auriculaire (dans ce dernier cas, les valeurs de E et de Ea doivent \xeatre moyenn\xe9es sur plusieurs cycles).",u.i,null)
