B.bm2=new A.a("I. Objet\n\nCette d\xe9marche vise \xe0 comprendre et savoir utiliser le syst\xe8me de monitorage PICCO\xae.\n\nII. Domaine d\u2019Application\n\nLa proc\xe9dure est destin\xe9e aux m\xe9decins r\xe9animateurs, aux internes et aux infirmiers du service de R\xe9animation polyvalente du Centre Hospitalier de Meaux. \n\nIII. Abr\xe9viations ou d\xe9finitions\n\nDC: D\xe9bit cardiaque \nDCC: D\xe9bit cardiaque index\xe9\nDPmax: Variation de pression durant la systole \nEPEV /IEPEV : Eau pulmonaire extravasculaire / index\xe9e \nFC: Fr\xe9quence cardiaque \nFEG: Fraction d\u2019\xe9jection globale \nSDRA: Syndrome de d\xe9tresse respiratoire aigu \nIC: Index cardiaque \nICC: Index cardiaque continu\nIFC: Index de la fonction cardiaque \nIPVP: Indice de perm\xe9abilit\xe9 vasculaire pulmonaire \nOD: Oreillette droite\nPAM: Pression art\xe9rielle moyenne\nPCI: Puissance cardiaque index\xe9e\t\nPICCO: Pulse Impulsion Continous Cardiac Output \nNAD: Noradr\xe9naline\nRVSI: R\xe9sistances vasculaires syst\xe9miques index\xe9es\nVCS: Veine cave sup\xe9rieure\nVEI: Volume d\u2019\xe9jection Index\xe9\nVES: Volume d\u2019\xe9jection Systolique \nVTDI: Volume t\xe9l\xe9 diastolique Index\xe9 \nVSTI: Volume sanguin thoracique index\xe9\nVPP: Variation de la pression puls\xe9e\nVVE /VVS: Variation du volume d\u2019\xe9jection\n\nIV. Proc\xe9dure\n\nA-Les indications :\n\n-Association d\u2019un SDRA et d\u2019un \xe9tat de choc\n-Autres indications possibles :\noTous types de chocs r\xe9fractaires au remplissage et n\xe9cessitant des doses de NAD > 1 mg/h.\noSyndrome de D\xe9tresse Respiratoire Aigu (SDRA)\no\u0152d\xe8me pulmonaire \n\nB-Les objectifs :\n\nL'optimisation h\xe9modynamique passe par l'optimisation de la d\xe9livrance de l'oxyg\xe8ne aux cellules de l'organisme. Ceci peut \xeatre possible en optimisant tous les param\xe8tres concern\xe9s.\n    TaO2 = CaO2 x DC\n\nTaO2: Transport en oxyg\xe8ne\nCaO2: Contenue art\xe9rielle en oxyg\xe8ne\nDC: D\xe9bit cardiaque.\n\nLe CaO2 d\xe9pend surtout du taux d'h\xe9moglobine dans le sang et de sa saturation en oxyg\xe8ne. (CaO2= 1,34xHbxSaO2+0,006xPaO2)\nLe DC qui est le d\xe9terminant majeur de cette \xe9quation d\xe9pend de la FC et du VES. La plupart des th\xe9rapeutiques visant l'optimisation du d\xe9bit cardiaque sont concentr\xe9es sur l'optimisation du VES. (DC=VESxFc)\n\nLe VES d\xe9pend de trois param\xe8tres : \n\n\u2022La pr\xe9charge  \n\u2022La contractilit\xe9 cardiaque\n\u2022La postcharge  \n\nOn peut alors conclure que l'optimisation de ces trois param\xe8tres est la cl\xe9 d'une r\xe9animation h\xe9modynamique efficace.   \n\nLe PICCO\xae permet une surveillance h\xe9modynamique avanc\xe9e en continue. Il permet une mesure fiable du d\xe9bit cardiaque en utilisant deux m\xe9thodes : \nLa thermo-dilution transpulmonaire (valid\xe9e par plusieurs \xe9tudes cliniques) [1-2], ainsi que la mesure du d\xe9bit cardiaque battement \xe0 battement en utilisant la technique du contour de l'onde de pouls [3]. Cette derni\xe8re calcule le VES de mani\xe8re fiable \xe0 partir de la surface sous la partie systolique de la courbe de pression art\xe9rielle [4]. \nVolume d'\xe9jection = Surface sous la courbe x facteur de calibration \nLe facteur de calibration d\xe9pend des propri\xe9t\xe9s m\xe9caniques du lit art\xe9riel. Il varie d'un patient \xe0 l'autre, et chez un m\xeame patient, d'un moment \xe0 l'autre en cas de modification importante de la vol\xe9mie ou des doses en drogues vasoactives. Cette technique requiert donc une calibration par un moyen ind\xe9pendant de mesure du volume d'\xe9jection. Dans le cas du PICCO la calibration se fait par thermo-dilution transpulmonaire.  \n\nLe syst\xe8me PICCO permet aussi bien le calcul du VES mais aussi son optimisation. Cette optimisation est possible gr\xe2ce \xe0 : \n\u2022La mesure des param\xe8tres de pr\xe9charge statiques comme peuvent \xeatre les volumes sanguins intra cardiaques et thoraciques (VTDI, VSIT) et la mesure des param\xe8tres dynamiques dits de pr\xe9charge-d\xe9pendance issues des interactions c\u0153ur-poumon au cours de la ventilation m\xe9canique (VPP, VES) [5,6]. \n\u2022L'estimation de la contractilit\xe9 cardiaque par le calcul de param\xe8tres de contractilit\xe9s comme : FEG, dPmax, IFC et PCI [7,8]. Ils poussent \xe0 r\xe9aliser une \xe9chographie cardiaque s\u2019ils sont alt\xe9r\xe9s.\n\u2022L'estimation de la postcharge par la mesure des r\xe9sistances vasculaires syst\xe9miques (RVSI).   \n\nLe PICCO, par le biais de la thermo-dilution transpulmonaire, est capable de d\xe9tecter une situation de surcharge hydrique pulmonaire en mesurant la quantit\xe9 d'eau extra-pulmonaire ou interstitielle (EPEI). L'incorporation de ce param\xe8tre dans un protocole de prise en charge h\xe9modynamique a permit de diminuer la dur\xe9e de ventilation m\xe9canique et la dur\xe9e de s\xe9jour en r\xe9animation [9]. Le PICCO permet aussi de calculer l'index de perm\xe9abilit\xe9 vasculaire pulmonaire (IPVP) qui permet la d\xe9tection de situation \xe0 risque d'\u0153d\xe8me pulmonaire comme serai la pr\xe9sence d'un \u0153d\xe8me l\xe9sionnel. \n\n\nC-Les normes :\n\n\nA savoir : La VVE et la VPP ne sont valables que chez les patients compl\xe9tement adapt\xe9s \xe0 une ventilation contr\xf4l\xe9e (sans effort de respiration spontan\xe9e) et en rythme sinusal. Aussi, le volume courant choisit doit \xeatre sup\xe9rieur \xe0 8ml/kg du poids id\xe9al. Ils repr\xe9sentent uniquement 20% des patients de r\xe9animation.\n\n",null,null,null,null,null,null,null,null,null)
B.a9Q=new A.C("Normes du Picco","assets/images/pathologies/hemodynamique/picco/2normespicco.png",null)
B.bl7=new A.a("D-Le montage :\n\nL\u2019utilisation du PICCO\xae n\xe9cessite un abord veineux central dans le territoire cave sup\xe9rieur (cath\xe9ter 3 voies, id\xe9alement \xe0 droite) o\xf9 seront inject\xe9s les bolus froids. Puis, un cath\xe9ter art\xe9riel de type PulsioCath\xae, en f\xe9morale.\nLes cath\xe9ters seront pos\xe9s par les m\xe9decins ou internes du service \xe0 l\u2019aide de l\u2019\xe9chographe. L\u2019assistance des IDE sera n\xe9cessaire pour la pr\xe9paration du patient, du mat\xe9riel et pour le montage des diff\xe9rentes lignes. \nL\u2019abord veineux doit \xeatre contr\xf4l\xe9 par radiographie avant d\u2019\xeatre utilis\xe9 en s'assurant que l'extr\xe9mit\xe9 distale du cath\xe9ter est bien log\xe9e dans la confluence VCS/OD. Une fois v\xe9rifi\xe9, la thermistance au niveau du KTC (pi\xe8ce en \xab T \xbb fournie avec la tubulure PICCO\xae) doit \xeatre mise entre deux robinets 3 voies (avec valves anti-reflux). Le branchement doit se faire sur la voie distale du cath\xe9ter et au plus pr\xe8s du patient afin de r\xe9duire l\u2019espace mort.\nIl est important d\u2019avoir un robinet en amont et en aval de la thermistance afin d\u2019y \xe9viter le passage des traitements et donc des d\xe9p\xf4ts de particules. Hors calibrage, le robinet au plus pr\xe8s du patient devra \xeatre ouvert pour la perfusion de base et ferm\xe9 c\xf4t\xe9 thermistance. \n",null,null,null,null,null,null,null,null,null)
B.aa5=new A.C("Montage du Picco","assets/images/pathologies/hemodynamique/picco/3montagepicco.png",null)
B.b3n=new A.a("\nE-Le calibrage :\n\nPour un calcul plus pr\xe9cis et index\xe9, il sera important d\u2019enregistrer sur le scope l\u2019\xe2ge du patient, son poids, sa taille.\nLa valeur de la PVC est n\xe9cessaire au calcul des RVSI mais peu utilis\xe9 dans l\u2019arbre d\xe9cisionnel.\n\nLe premier calibrage est effectu\xe9 apr\xe8s montage du syst\xe8me pour initier le monitorage et doit \xeatre r\xe9p\xe9ter chaque fois qu'une modification importante de th\xe9rapeutique h\xe9modynamique est effectu\xe9e. A d\xe9faut de cela, il est recommand\xe9 de faire au moins deux calibrages par jour.\n\nLe calibrage routinier fait au moins 2 fois par jour doit \xeatre fait en collaboration entre l'IDE et l'Interne en charge du patient. En cas d'aggravation brutale et d'une mesure urgente l'interne et/ou senior calibreront le PICCO.\n\nAvant tout, refaire le Z\xc9RO, puis pr\xe9parer le mat\xe9riel n\xe9cessaire : trocart, seringue de 20ml, pochon de 100ml de s\xe9rum sal\xe9 \xe0 9% froid.\nS\u2019assurer qu\u2019il n\u2019y a rien d\u2019autres que les bolus inject\xe9s qui passeront dans la voie utilis\xe9e. \nSur le scope, faire d\xe9filer              la barre des t\xe2ches pour pouvoir appuyer sur \xab D\xe9bit Cardiaque \xbb. \n\n\nAppuyer sur \xab D\xe9buter DC \xbb. \n\nLa fen\xeatre de la courbe de thermo-dilution s\u2019affiche et donne les conduites \xe0 tenir. Attendre les donn\xe9es suivantes : \xab Ligne stable \xbb, \xab Injecter maintenant \xbb \n\t\n\nL\u2019injection des 20ml doit se faire rapidement et en une seule fois sur la voie distale. \nPour un calibrage fiable, il est n\xe9cessaire de faire entre 3 et 4 injections.\n\nIl est primordial que durant les injections, tout \xe9l\xe9ment pouvant avoir des r\xe9percussions h\xe9modynamiques (changement de position, du mode ventilatoire ou param\xe8tres de ventilation, toux, agitation ponctuelle, changement des doses de cat\xe9cholamines en cours) doit \xeatre \xe9viter.  \nSur le scope, les valeurs pourront \xeatre rejet\xe9es si celles-ci sont < ou > de 15 \xe0 20% des autres mesures effectu\xe9es. Pour cela, la mesure devra \xeatre s\xe9lectionn\xe9e et il faudra appuyer sur \xab Accepter/Rejeter \xbb               (une croix rouge appara\xeetra pour confirmer l\u2019annulation de cette mesure). \nTrois \xe0 quatre mesures devront \xeatre valid\xe9es pour une calibration fiable. Ensuite, appuyer sur \xab Svgd DC & Cal DCC \xbb , \xab Calculs h\xe9mo. \xbb, \xab Faire Calculs \xbb. \n\nDans la fen\xeatre grise affich\xe9e au scope, les r\xe9sultats des calculs effectu\xe9s apparaitront.\nPour finir, appuyer sur \xab Impr /Enreg \xbb. \n\n\tA chaque calibration, les r\xe9sultats devront \xeatres vus et interpr\xe9t\xe9s par le m\xe9decin puis ins\xe9rer dans le dossier du patient.\n\nF-Les param\xe8tres \xe0 afficher sur le moniteur :\nLes param\xe8tres \xe0 afficher sur le moniteur Philips sont :\n-ICC (D\xe9bit cardiaque continu)\n-VTDI (Pr\xe9charge)\n-IFC (Contractilit\xe9)\n-EPEI (Eau pulmonaire)\n-T\xb0\n-Optionnel:\n        oIPVP (Perm\xe9abilit\xe9 pulmonaire) si pr\xe9sence d\u2019Eau Pulmonaire  \n\nLes valeurs de couleur saumon: sont des param\xe8tres continus\nLes valeurs de couleur violet: sont des valeurs statiques et n\xe9cessite une nouvelle calibration pour les interpr\xe9ter\n\n\nG-Les surveillances et l\u2019entretien du Cath\xe9ter :\nComme pour tous les KT, le reflux sanguin et le point de ponction devront \xeatre surveill\xe9s. Le moindre signe d\u2019infection devra \xeatre signal\xe9 et aboutira sur l\u2019ablation du cath\xe9ter.  \nPour le cath\xe9ter central, le changement de rampe sera fait tous les 4 jours et la r\xe9fection du pansement (tegaderm chlorexidine) tous les 8 jours, sauf si souillures ou d\xe9collement du pansement.\nPour le PICCO\xae, les consignes seront identiques \xe0 celles prises pour le cath\xe9ter central (changement de rampe tous les 4 jours avec changement de la thermistance au niveau du cath\xe9ter central, et r\xe9fection du pansement maximum J8 s\u2019il n\u2019a pas \xe9t\xe9 souill\xe9. \nIl est recommand\xe9 de ne pas laisser le PICCO\xae en place plus de 10 jours. Il sera pr\xe9f\xe9rable de le remplacer par un cath\xe9ter art\xe9riel simple ou de le retirer si le monitorage n\u2019est plus n\xe9cessaire. \nL\u2019ablation des cath\xe9ters se fait par un IDE, et la mise en culture du KT sera faite en syst\xe9matique. \n\n\n",null,null,null,null,null,null,null,null,null)
