B.bdn=new A.a("A4C Onde S'(septum) en doppler tissulaire excursion valve mitrale (anneau mitrale) N>10cm/s\nA4C/A2C Reference Simpson Biplan: Surface FE=VES/Vtd=(Vtd-Vts)/Vtd N>60%+/-5 NB: Variation inter observateur 10-15% et il faut inclure les pilliers/muscles pappilaires\nQc=VESxFc\nVES= Surf Ao x ITV sous Ao ou Simpson VES=Vtd-Vts\nPSGA zoom\xe9 Diametre de Anneau Ao Proto ou Meso diastolique de bord de fuite a bord d'attaque S=0.78xD\xb2=19-21\nA5C Puls\xe9 :ITV sous Aortique 5mm au dessus ligne Ao N=20+/-3 Vmax 1-1.7m/s\nFlux monophasique negatif + Aspect doigt de gant + Clic B2. Si B2 non visible: trop dans la chambre de chasse (sous estimation). Si B1 et B2 visible: trop pr\xe8s de Anneau : sur estimation\nIC 2.5-3.5l/min/m\xb2 Bas debit quand <2.2\n",null,null,B.Z,null,null,null,null,null,null)
