B.boo=new A.a("R\xe9glage du ventilateur (court):\n  - P-High\n    Commencez \xe0 25-35 cm, le plus souvent ~28-30 cmH2O.\n    Des pressions plus \xe9lev\xe9es sont utiles pour les patients pr\xe9sentant une hypox\xe9mie plus profonde et les patients souffrant d'ob\xe9sit\xe9 morbide.  Par exemple :\n      - Poids normal et FiO2 \xe0 100% en APRV : r\xe9glez la P-haute \xe0 30 cm.\n      - Ob\xe9sit\xe9 morbide et FiO2 \xe0 100 % en APRV : r\xe9glez la P-high \xe0 35 cm.\n  - P-Low\n    Toujours r\xe9gl\xe9 sur z\xe9ro.\n  - T-High\n    R\xe9gl\xe9 \xe0 5[4-6] secondes. R\xe9duite \xe9quivalent de majorer la FR (\xe9pure CO2 et diminue effort que patient doit fournir) (parfois 1-3s dans le COVID)\n  - T-Low\n    R\xe9gl\xe9e initialement sur 0,5 [0,2-0,8] seconde (ou 0,8[0,8-1,5] seconde chez les patients atteints de BPCO). NB: APRV se base sur autopep pour prevenir le d\xe9recrutement (plus c'est bas mieux est l'oxyg\xe9nation): QSP Release Breath 4-8ml/kg Augmentation de Tlow l'augmente\n  - FiO2\n    Commencez \xe0 100 %, puis r\xe9duisez-la de mani\xe8re agressive aussi vite que possible.\n  - S\xe9dation pour que Effort patient\n    10-30% au d\xe9but\n    30-60% si patient en am\xe9lioration ( Si fatigue Majorer P High et DIminuer T high)\n\n  La respiration spontan\xe9e doit \xeatre soutenue\n  Ventilateurs Drager ou Puritan Bennett : v\xe9rifiez que la compensation automatique des tubes (ATC) est activ\xe9e.  Cela devrait fournir une quantit\xe9 de pression adapt\xe9e con\xe7ue pour surmonter la r\xe9sistance du tube endotrach\xe9al.\n  Ventilateurs sans compensation automatique du tube : ajoutez une pression de soutien (Aide Inspiratoire) de 5 cmH2O.\n\n\n",null,null,null,null,null,null,null,null,null)
B.beF=new A.a("R\xe9glages (Long):\n\nP-High\n  Plage typique de 15 \xe0 35 cm (une valeur sup\xe9rieure \xe0 35 peut rarement \xeatre requise en cas d'ob\xe9sit\xe9 profonde).\n  Au d\xe9part, on vise un niveau \xe9lev\xe9 (~30 cm), puis on le r\xe9duit progressivement au fur et \xe0 mesure que l'oxyg\xe9nation s'am\xe9liore.\n  Probl\xe8mes li\xe9s \xe0 une P-Haute excessive :\n    Surdistension pulmonaire.\n    Peut alt\xe9rer l'h\xe9modynamique en provoquant un cor pulmonaire.\n  Probl\xe8mes en cas de P-High inad\xe9quate :\n    Le d\xe9-recrutement entra\xeene une hypox\xe9mie.\n    L'ouverture et la fermeture r\xe9p\xe9t\xe9es des alv\xe9oles provoquent un at\xe9lectotraumatisme.\n    La P-high est ce qui fournit la pression motrice pour la respiration dites de \"lib\xe9ration\", qui est le m\xe9canisme par lequel l'APRV fournit un soutien m\xe9canique au travail respiratoire. Une P-haute inad\xe9quate peut entra\xeener un soutien insuffisant du ventilateur, ce qui augmente le travail respiratoire.\nP-Low\n  Toujours r\xe9gler cette valeur sur z\xe9ro.\nT-High\n  T-High est le facteur d\xe9terminant de la fr\xe9quence de lib\xe9ration (c'est-\xe0-dire la fr\xe9quence des \"respirations m\xe9caniques\" ou des \"respirations de d\xe9charge\").\n  Fr\xe9quence de d\xe9clenchement = 60/(T-High + T-Low).  Puisque T-basse est petit, cela \xe9quivaut simplement \xe0 60/T-haut.\n  Au d\xe9part, le T-hi est g\xe9n\xe9ralement r\xe9gl\xe9 sur ~5 secondes, pour obtenir ~12 expirations par minute.\n  Au fur et \xe0 mesure que les patients se sevrent de l'assistance respiratoire, T-High sera augment\xe9 (\"\xe9tir\xe9\") et la fr\xe9quence de d\xe9clenchement diminuera.\n  Probl\xe8mes si T-high est trop court :\n    Un trop grand nombre de rel\xe2chements peut entra\xeener un d\xe9-recrutement (en abaissant la pression moyenne des voies a\xe9riennes).\n    La ventilation assist\xe9e par ordinateur cesse de prot\xe9ger les poumons et commence \xe0 ressembler \xe0 une ventilation g\xe9n\xe9rique \xe0 pression contr\xf4l\xe9e.\n    Probl\xe8mes si le T-high est trop long :\n  Trop peu d'insufflations peuvent provoquer une hypercapnie.\n    Les respirations de lib\xe9ration sont ce qui fournit un soutien m\xe9canique pour aider le travail de respiration du patient.  Ainsi, si le T-High est trop long, l'\xe9vent ne fait pas grand-chose pour soutenir le travail respiratoire du patient (et cela commence \xe0 ressembler \xe0 la CPAP).\nT-Low\n  En g\xe9n\xe9ral, 0,5 seconde est un point de d\xe9part raisonnable et ne sera pas trop \xe9loign\xe9 pour les patients COVID.\n  Pour les patients souffrant de BPCO sous-jacente, un T-low plus long peut \xeatre n\xe9cessaire (par exemple, 0,8-1,5 seconde).\n  Il y a deux fa\xe7ons possibles de d\xe9finir le T-low\n    M\xe9thode traditionnelle :   (Chez les patients qui expirent passivement, le T-Low peut \xeatre mesur\xe9 en comparant le d\xe9bit expiratoire final au d\xe9bit expiratoire maximal.   L'objectif habituel est un d\xe9bit expiratoire final > 75 % du d\xe9bit expiratoire de pointe.  Cependant, si la respiration de vidange est constamment >8 cc/kg, il peut \xeatre conseill\xe9 de r\xe9duire davantage le T-low.\n    M\xe9thode de raccourci :  (Cette m\xe9thode est plus facile \xe0 mettre en \u0153uvre et n\xe9cessite moins d'entra\xeenement.) Ajustez le T-low pour cibler un volume d'expiration de ~6-8 cc/kg.  Pour les patients qui respirent activement sous ventilateur, cette m\xe9thode peut \xeatre la seule possible (car les courbes de d\xe9bit peuvent varier entre les diff\xe9rentes respirations en raison de l'effort du patient, ce qui entrave la m\xe9thode traditionnelle).\n  Probl\xe8mes si le T-low est trop court :\n    Le souffle de lib\xe9ration est trop faible, ce qui entra\xeene une ventilation inefficace.  Le ventilateur ne fait pas grand-chose pour soutenir le travail de respiration.\n    Ce n'est g\xe9n\xe9ralement pas un probl\xe8me majeur, donc en cas de doute, il est g\xe9n\xe9ralement pr\xe9f\xe9rable de ne pas r\xe9gler le T-low trop court.\n  Probl\xe8mes si le bas T est trop long :\n    Le souffle de lib\xe9ration est trop important, ce qui provoque un d\xe9-recrutement (entra\xeenant une hypox\xe9mie et aussi une hypercapnie).\n    La fermeture/ouverture r\xe9p\xe9titive des alv\xe9oles pendant le souffle de rel\xe2chement provoque un traumatisme des poumons (at\xe9lectotraumatisme).\n    C'est potentiellement un \xe9norme probl\xe8me - et franchement, c'est le talon d'Achille de l'APRV.  Heureusement, il est possible de l'\xe9viter avec une surveillance ad\xe9quate et en maintenant le T-low du c\xf4t\xe9 court.\nFiO2\n  Diminuer agressivement la FiO2 pour viser une saturation de ~88-94%.\n  Un titrage constant et agressif de la FiO2 \xe0 sa valeur la plus basse possible permet \xe0 la FiO2 d'\xeatre un \"compteur de d\xe9-recrutement\".\n  Si le besoin en FiO2 augmente, cela sugg\xe8re un d\xe9-recrutement ou une autre d\xe9t\xe9rioration pulmonaire (par exemple, un pneumothorax).\n\n\n\n\n",null,null,null,null,null,null,null,null,null)
B.bo0=new A.a("Regler les probl\xe8mes:\n\nHypox\xe9mie\n    G\xe9n\xe9ralement, cela refl\xe8te un d\xe9-recrutement (bien que d'autres possibilit\xe9s puissent inclure un pneumothorax, un shunt gauche-droit d\xfb \xe0 un cor pulmonaire et une pneumonie associ\xe9e au ventilateur).\n    S'il est grave, il faut envisager une \xe9chographie pulmonaire pour exclure un pneumothorax.\n    Titrage des r\xe9glages du VPA :\n    L'augmentation de la P-haute de 1-2cmH2O est le principal moyen d'augmenter la pression moyenne des voies a\xe9riennes et de favoriser le recrutement.\n    L'augmentation de la T-haute de 0,5-1sec aura \xe9galement tendance \xe0 augmenter la pression moyenne des voies a\xe9riennes (mais cela peut r\xe9duire le nombre de respirations de d\xe9charge et donc diminuer l'assistance m\xe9canique du ventilateur).\n    Diminution T-basse par 0,05-0,1s\n    En dernier recours Majorer P-Basse de 1-2cmH2O\n\nAcid\xe9mie/ Hypercapnie\n    Tol\xe9rer l'hypercapnie permissive jusqu'\xe0 un pH de ~7,15 (ou m\xeame plus bas si l'h\xe9modynamique le permet).  Avant d'essayer de r\xe9duire la PaCO2, r\xe9fl\xe9chissez bien pour savoir si vous devez vraiment le faire.\n    Si le patient tol\xe8re une PaCO2 \xe9lev\xe9e et se porte bien cliniquement, la meilleure chose \xe0 faire est souvent de ne pas intervenir.  Les interventions \xe9num\xe9r\xe9es ci-dessous tendront \xe0 r\xe9duire la PaCO2, mais peuvent y parvenir au prix d'une moindre protection des poumons.\n    La meilleure fa\xe7on d'am\xe9liorer le pH est souvent de manipuler l'\xe9tat acide/base m\xe9tabolique (par exemple, bicarbonate IV pour une acidose m\xe9tabolique sans \xe9cart anionique).  Pousser le bicarbonate \xe0 ~28-32 mEq/dL facilitera \xe9norm\xe9ment l'obtention d'un pH ad\xe9quat si cela pose un probl\xe8me.\n    Si vous d\xe9cidez d'essayer de r\xe9duire la pCO2 :\n    Si le patient ne respire pas spontan\xe9ment, diminuez la s\xe9dation pour encourager une plus grande respiration spontan\xe9e (voir \"effort du patient\" ci-dessus).\n    Si les respirations de lib\xe9ration sont faibles (par exemple <6 cc/kg), envisagez d'augmenter la T-basse de 0,05-0,1sec.\n    La r\xe9duction de la T-haute augmentera la fr\xe9quence des rel\xe2chements, augmentant ainsi la ventilation minute.  Cependant, cela peut menacer de r\xe9duire la pression moyenne des voies a\xe9riennes.  Ainsi, une augmentation simultan\xe9e de la P-High de 1-2 cm peut \xeatre envisag\xe9e en m\xeame temps qu'une r\xe9duction de la T-High, afin de maintenir une pression moyenne des voies a\xe9riennes stable.\n\nHypocapnie\n    Diminuer P-Haute si possible sur le plan de oxyg\xe9nation\n    Augmenter T haute\n    Diminuer T basse\n\n\n",null,null,null,null,null,null,null,null,null)
