B.b0K=new A.a("Le diagnostic de dilatation des voies excr\xe9trices hautes demande une plus grande exp\xe9rience mais reste relativement simple. Des cavit\xe9s excr\xe9trices non dilat\xe9es ne sont pas visibles en \xe9chographie. Sur un rein normal, ces derni\xe8res apparaissent comme une image hyper\xe9chog\xe8ne au centre du parenchyme r\xe9nal (figure 23, image de droite). Lorsque les cavit\xe9s excr\xe9trices hautes sont dilat\xe9es, elles deviennent visibles en \xe9chographie sous formes d'images arrondies hypo\xe9chog\xe8nes.\n",null,null,B.Z,null,null,null,null,null,null)
