B.b0S=new A.a("*\tLes troubles de la conscience isol\xe9s ne sont pas une contre-indication \xe0 la ponction lombaire (PL)\n*\tLes indications de l\u2019imagerie c\xe9r\xe9brale avant la PL sont rares\n*\tL\u2019impossibilit\xe9 de pratiquer une PL dans les plus brefs d\xe9lais impose la mise en route imm\xe9diate de la dexam\xe9thasone et de l\u2019antibioth\xe9rapie apr\xe8s r\xe9alisation d\u2019une paire d\u2019h\xe9mocultures\n*\tEn cas d\u2019oubli, la dexam\xe9thasone peut \xeatre administr\xe9e jusqu\u2019\xe0 12h apr\xe8s la premi\xe8re dose d\u2019antibiotique\n*\tLe c\xe9fotaxime ou la ceftriaxone sont les deux antibiotiques de premi\xe8re intention\n*\tLe suivi pendant 12 mois est recommand\xe9 pour d\xe9tecter les complications tardives \n",null,null,null,null,null,null,null,null,null)
B.biI=new A.a("Prise en charge imm\xe9diate",null,B.M,null,null,null,null,null,null,null)
B.bbX=new A.a("\u2022\tLa ponction lombaire (PL) doit \xeatre r\xe9alis\xe9e dans l'heure qui suit l'admission du patient aux urgences\n\u2022\tLa PL n\u2019est pas contre-indiqu\xe9e:\n    \u2022\ten cas de troubles de la conscience isol\xe9s \n    \u2022\ten cas de prise d\u2019antiagr\xe9gants plaquettaires \n\u2022\tLa PL est contre indiqu\xe9e en cas:\n    \u2022\td\u2019infection cutan\xe9e \xe9tendue du site de ponction\n    \u2022\td\u2019instabilit\xe9 h\xe9modynamique ou respiratoire\n    \u2022\tde troubles de l\u2019h\xe9mostase connus (coagulopathie dont h\xe9mophilie, plaquettes inf\xe9rieures \xe0 50 000/mm3)\n    \u2022\tde traitement anticoagulant \xe0 dose efficace (h\xe9parine, AVK ou anticoagulants oraux directs)\n    \u2022\tde saignements spontan\xe9s \xe9voquant une CIVD\nLa PL sera r\xe9alis\xe9e d\xe8s que possible apr\xe8s lev\xe9e de la contre indication\n\nConcertation syst\xe9matique avec l\u2019\xe9quipe de r\xe9animation\n",null,null,null,null,null,null,null,null,null)
B.blA=new A.a("Indications \xe0 une imagerie c\xe9r\xe9brale avant la PL",null,B.M,null,null,null,null,null,null,null)
B.b7a=new A.a("\u2022\tLes indications de l\u2019imagerie c\xe9r\xe9brale avant la PL doivent \xeatre limit\xe9es :\n    \u2022\tSignes \xe9voquant un processus expansif intracr\xe2nien (signes de localisation, crises d\u2019\xe9pilepsies focales et r\xe9centes)\n    \u2022\tSignes d\u2019engagement c\xe9r\xe9bral :\n        \u2022\tTroubles de la vigilance et anomalies pupillaires, dysautonomie, crises toniques post\xe9rieures, ar\xe9activit\xe9, r\xe9action de d\xe9cortication ou de d\xe9c\xe9r\xe9bration\n    \u2022\tCrises convulsives persistantes\n\n",null,null,null,null,null,null,null,null,null)
B.bp9=new A.a("Examens biologiques syst\xe9matiques",null,B.M,null,null,null,null,null,null,null)
B.b36=new A.a("\u2022\tAnalyse biochimique, cytologique et microbiologique du LCS : tous les tubes doivent \xeatre envoy\xe9s au laboratoire\n    *\tRecueil de 4 tubes dont 1 congel\xe9 \xe0 -20\xb0C pour biologie mol\xe9culaire (minimum 10 gouttes par tube)\n    *\tCommunication des r\xe9sultats \xe0 l\u2019\xe9quipe en charge du patient dans l\u2019heure qui suit la PL \n    *\tSi examen direct positif :\n        *\tAntibiogramme fait directement sur LCS \n        *\tSi S. pneumoniae suspect\xe9: E-tests pour c\xe9fotaxime et ceftriaxone sur LCS\n    *\tLactates (si < 3,2 mmol/l, m\xe9ningite bact\xe9rienne tr\xe8s peu probable)\n\u2022\tPr\xe9lever au moins une paire d\u2019h\xe9mocultures en parall\xe8le\n\nSi examen direct n\xe9gatif et suspicion de m\xe9ningite bact\xe9rienne\n    *\tD\xe9tection d\u2019antig\xe8nes du pneumocoque par Immunochromatographie sur LCS \n    *\tPCR sur LCS : m\xe9ningocoque, pneumocoque ou universelle si forte suspicion de m\xe9ningite bact\xe9rienne ; ent\xe9rovirus si faible suspicion bact\xe9rienne\n    *\tPCR m\xe9ningocoque sur sang (si forte suspicion)\n    *\tBiopsie cutan\xe9e si purpura : PCR m\xe9ningocoque, ED, culture\n    *\tProcalcitonine s\xe9rique (si < 0,25 ng/ml, m\xe9ningite bact\xe9rienne tr\xe8s peu probable)\nLe score de Hoen peut \xeatre une aide pour diff\xe9rencier une origine bact\xe9rienne ou virale\n",null,null,null,null,null,null,null,null,null)
B.brf=new A.a("Antibioth\xe9rapie imm\xe9diate",null,B.M,null,null,null,null,null,null,null)
B.bqI=new A.a("\u2022\tMise en route antibioth\xe9rapie = Urgence absolue\n    \u2022\tDans l\u2019heure qui suit l\u2019arriv\xe9e \xe0 l\u2019h\xf4pital\n    \u2022\tAu plus tard dans les 3 heures\n    \u2022\tL\u2019antibioth\xe9rapie doit \xeatre instaur\xe9e avant la PL dans les situations suivantes :\n        \u2022\tPurpura fulminans \n        \u2022\tSi forte suspicion de m\xe9ningite bact\xe9rienne et h\xf4pital distant de plus de 90 minutes et impossibilit\xe9 de faire la PL ou Contre-indication \xe0 la r\xe9alisation de la PL \n",null,null,null,null,null,null,null,null,null)
B.brh=new A.a("Indications de la corticoth\xe9rapie",null,B.M,null,null,null,null,null,null,null)
B.bkG=new A.a("\u2022\tLa dexam\xe9thasone doit \xeatre inject\xe9e de fa\xe7on concomitante \xe0 la 1\xe8re injection d\u2019antibiotique si :\n    \u2022\tExamen direct positif \xe9voquant un : \n        \u2022\tpneumocoque quel que soit l'\xe2ge\n        \u2022\tm\xe9ningocoque chez l\u2019adulte\n        \u2022\tHaemophilus influenzae  chez l\u2019enfant et le nourrisson\n    \u2022\tExamen direct n\xe9gatif mais aspect trouble du LCS ou autres donn\xe9es permettant de retenir le diagnostic de m\xe9ningite bact\xe9rienne chez l\u2019adulte et chez le nourrisson de 3 \xe0 12 mois\n    \u2022\tContre-indication \xe0 la PL\n\u2022\tLa dose initiale chez l\u2019adulte est de 10 mg (chez l\u2019enfant de 0,15 mg/kg) et cette dose est r\xe9p\xe9t\xe9e toutes les 6 h pendant 4 j\n\u2022\tEn cas d\u2019oubli, la dexam\xe9thasone peut \xeatre administr\xe9e jusqu\u2019\xe0 12 h apr\xe8s la premi\xe8re dose d\u2019antibiotique\n\u2022\tLa dexam\xe9thasone n\u2019est pas recommand\xe9e chez l\u2019immunod\xe9prim\xe9 et en cas de list\xe9riose\n",null,null,null,null,null,null,null,null,null)
