B.bay=new A.a("*\tPL de contr\xf4le non indiqu\xe9e si \xe9volution favorable\n*\tPL \xe0 48-72h \n    *\tSi pneumocoque avec CMI C3G > 0,5 mg/l \n    *\tSi \xe9volution clinique non favorable \n        *\tFaire au pr\xe9alable imagerie c\xe9r\xe9brale \xe0 la recherche d\u2019un empy\xe8me ou de complications intra-c\xe9r\xe9brales qui pourraient justifier un geste chirurgical\n        *\tPr\xe9lever un tube pour mesurer la concentration de la C3G utilis\xe9e\n    *\tSi m\xe9ningites autres que pneumocoque, m\xe9ningocoque, Haemophilus et Listeria\n",null,null,null,null,null,null,null,null,null)
