B.b_N=new A.a("*\tL\u2019imagerie c\xe9r\xe9brale ne doit pas \xeatre syst\xe9matique.\n*\tL\u2019imagerie c\xe9r\xe9brale doit \xeatre r\xe9alis\xe9e en cas de :\n    *\tM\xe9ningite \xe0 bact\xe9rie autre que pneumocoque ou m\xe9ningocoque - (recherche de sinus dermique chez l\u2019enfant si \xe0 staphylocoques, ent\xe9robact\xe9ries, ou polymicrobienne)\n    *\tM\xe9ningite bact\xe9rienne chez un individu aux ant\xe9c\xe9dents de traumatisme cr\xe2nien\n    *\tM\xe9ningite \xe0 pneumocoque (chez enfant et adulte) ou \xe0 Haemophilus (adulte) et suspicion de br\xe8che ost\xe9o-durale \n    *\tM\xe9ningite \xe0 pneumocoque et otite, sinusite ou masto\xefdite\n    *\tM\xe9ningite \xe0 pneumocoque sans porte d\u2019entr\xe9e retrouv\xe9e  \n    *\tM\xe9ningite \xe0 pneumocoque chez l\u2019enfant en particulier apr\xe8s 2 ans,\n        *\tEn l\u2019absence de toute infection bact\xe9rienne ORL \n        *\tOu si le s\xe9rotype incrimin\xe9 \xe9tait inclus dans le vaccin re\xe7u \n*\tL\u2019imagerie c\xe9r\xe9brale doit aussi \xeatre r\xe9alis\xe9e en cas de :\n    *\tSurvenue de signes neurologiques nouveaux : \n        *\tCrises convulsives\n        *\tParalysie (h\xe9mipar\xe9sie, t\xe9trapar\xe9sie, paralysie des nerfs cr\xe2niens en dehors d\u2019un VI isol\xe9)\n        *\tAccentuation des c\xe9phal\xe9es \n        *\tModification de la vision\n        *\tTroubles de la conscience \n    *\tMauvaise \xe9volution au-del\xe0 de 72h apr\xe8s le d\xe9but du traitement : \n    *\tChez l\u2019enfant de moins de 2 ans, si augmentation rapide du p\xe9rim\xe8tre cr\xe2nien\n",null,null,null,null,null,null,null,null,null)
B.ble=new A.a("Quel suivi pour quels patients ?",null,B.M,null,null,null,null,null,null,null)
B.bhj=new A.a("*\tAvant la sortie de l\u2019h\xf4pital ou au plus tard dans les 15 jours apr\xe8s la fin du traitement \n    *\tChez les enfants et les adultes : examen clinique neurologique et test auditif adapt\xe9 \xe0 l\u2019\xe2ge. Si hypoacousie profonde, craindre une ossification cochl\xe9aire d\xe9butante \uf0de consultation ORL\n    *\tChez l\u2019enfant et l\u2019adulte jeune : avis sp\xe9cialis\xe9 pour discuter les explorations immunologiques si\n        *\tant\xe9c\xe9dent d\u2019infections bact\xe9riennes s\xe9v\xe8res chez le patient ou dans sa fratrie\n        *\tm\xe9ningites r\xe9cidivantes\n        *\tm\xe9ningite \xe0 s\xe9rotype vaccinal chez un enfant vaccin\xe9 (vaccin pneumocoque conjugu\xe9, Haemophilus ou m\xe9ningocoque)\n        *\tinfection \xe0 germe inhabituel dont m\xe9ningocoque de s\xe9rogroupe rare (Y, W135, X et Z).\n    *\tChez l\u2019adulte : recherche de pathologies pr\xe9disposantes telles que diab\xe8te, \xe9thylisme chronique, cancer, cirrhose, h\xe9mopathie, infection par le VIH en cas de facteur de risque.  \n*\tUn mois apr\xe8s la sortie de l\u2019h\xf4pital : \n    *\tExamen neurologique et recherche d\u2019une hypoacousie\n    *\tSi un traitement anti-\xe9pileptique a \xe9t\xe9 prescrit durant la phase aigu\xeb et qu\u2019aucune nouvelle crise n\u2019est survenue : EEG  \n        *\tarr\xeat du traitement anti\xe9pileptique apr\xe8s avis neurologique ou neuro-p\xe9diatrique\n    *\tChez le petit enfant  : surveiller le p\xe9rim\xe8tre cr\xe2nien. \n*\tLe suivi pendant 12 mois est recommand\xe9 pour d\xe9tecter les complications tardives \n    *\tChez l\u2019enfant, tous les 3 mois : surveillance clinique de l\u2019audition et v\xe9rification de l\u2019adaptation scolaire.\n    *\tChez l\u2019adulte : \xe9valuer cliniquement l\u2019audition, les s\xe9quelles cognitives et rechercher une d\xe9pression. Am\xe9liorer le d\xe9pistage et la prise en charge des s\xe9quelles tardives\n",null,null,null,null,null,null,null,null,null)
