B.b8c=new A.a("Les infections ost\xe9o-articulaires (IOA) sont des infections complexes \xe0 diagnostiquer et \xe0 traiter. Toutes suspicion d\u2019IOA doit motiver l\u2019avis d\u2019un sp\xe9cialiste (infectiologues, bact\xe9riologistes, rhumatologues, orthop\xe9distes).\nDans tous les cas et avant toutes antibioth\xe9rapies, des pr\xe9l\xe8vements microbiologiques syst\xe9matiques doivent \xeatre r\xe9alis\xe9s.\nId\xe9alement, apr\xe8s fen\xeatre th\xe9rapeutique de 15 jours en cas d\u2019antibioth\xe9rapie pr\xe9alable.\n\u27a2 Au minimum 3 paires d\u2019h\xe9mocultures soit 60 mL\n\u27a2 Ponction articulaire (\xe0 ensemencer sur tube citrat\xe9 et dans des flacons d\u2019h\xe9moculture) avec nouvelle paire d\u2019h\xe9moculture au d\xe9cours \ndu geste.\n\u27a2 Biopsies osseuses ou pr\xe9l\xe8vements per op\xe9ratoires (minimum 3, id\xe9alement 5)\n\nL\u2019imagerie est \xe9galement obligatoire (Radiographies, scanner, IRM pour la spondylodiscite)\nUne antibioth\xe9rapie probabiliste ne doit \xeatre prescrite qu\u2019en cas de sepsis franc. G\xe9n\xe9ralement, il n\u2019est pas n\xe9cessaire de commencer une \nantibioth\xe9rapie probabiliste dans un contexte d\u2019infection chronique ou de spondylodiscite.\n\nL\u2019antibioth\xe9rapie document\xe9e doit \xeatre syst\xe9matiquement discut\xe9e avec les sp\xe9cialistes d\xe8s r\xe9ception des r\xe9sultats, et le dossier doit \xeatre \npr\xe9sent\xe9 en RCP d\u2019infections ost\xe9o-articulaires, le mercredi \xe0 10h sur le site de Meaux ou via Teams. Envoyer la demande par mail \xe0 \nrcpioameaux@ghef.fr\n\nIl existe des pr\xe9-prescriptions dans crossway avec des posologies standardis\xe9es : taper antibioth\xe9rapie ortho\n\nAntibioth\xe9rapie probabiliste\nCommunautaire : couvrir le Staphylococcus aureus et le Streptococcus\n\u27a2 Cloxacilline ou c\xe9fazoline\nNosocomiale : tazocilline + daptomycine\n",null,null,null,null,null,null,null,null,null)
