B.b8P=new A.a("POINTS ESSENTIELS:\n\n\xb7 L'\xe9chographie constitue un moyen simple et non invasif d'am\xe9liorer la pertinence de l'examen clinique en r\xe9animation, particuli\xe8rement pour la pathologie cardiovasculaire.\n\n\xb7 Toute unit\xe9 de r\xe9animation devrait disposer d'un appareil moderne d'\xe9chographie afin de garantir une qualit\xe9 d'image optimale en raison d'une \xe9chog\xe9nicit\xe9 plus faible des patients critiques.\n\n\xb7 La configuration minimale d'un appareil d'\xe9chographie de r\xe9animation comporte une sonde thoracique (permettant l'exploration cardiaque, pleuropulmonaire, voire abdominale), une sonde permettant l'exploration vasculaire et une sonde trans\u0153sophagienne multiplan.\n\n\xb7 Il est souhaitable que la majorit\xe9 des praticiens d'une \xe9quipe soient form\xe9s \xe0 l'\xe9chocardiographie et aux bases de l'\xe9chographie g\xe9n\xe9rale, avec autant que possible un praticien r\xe9f\xe9rent par unit\xe9.\n\n\xb7 Les donn\xe9es de la litt\xe9rature montrent qu'un certain nombre d'explorations \xe9chographiques cardiaques, pleuropulmonaires, vasculaires et abdominales peuvent \xeatre r\xe9alis\xe9es par le r\xe9animateur avec une bonne performance diagnostique.\n\n\xb7 Les niveaux de comp\xe9tence requis sont bien d\xe9finis pour l'\xe9chocardiographie, relativement bien codifi\xe9s pour l'\xe9chographie pleuropulmonaire mais restent \xe0 d\xe9finir pour les autres organes.\n\n\xb7 L'\xe9chographie-Doppler cardiaque est un outil pr\xe9cieux pour le diagnostic des causes d'\xe9tats de choc ainsi que pour l'analyse h\xe9modynamique. Sa performance est \xe9quivalente voire sup\xe9rieure aux autres outils d'exploration h\xe9modynamique.\n\n\xb7 L'\xe9chographie vasculaire en temps r\xe9el diminue les \xe9checs et les complications de la pose des cath\xe9ters veineux centraux.\n\n\xb7 L'\xe9chographie pleuropulmonaire permet un diagnostic simple, rapide et quantitatif des \xe9panchements pleuraux liquidiens avec une performance sup\xe9rieure \xe0 la radiographie conventionnelle. Elle permet un diagnostic diff\xe9rentiel rapide entre \xe9panchement pleural liquidien et at\xe9lectasie. Le diagnostic d'exclusion de pneumothorax est simple, son diagnostic positif plus difficile. L'\xe9chographie pleuropulmonaire donne des signes indirects tr\xe8s sp\xe9cifiques de surcharge liquidienne parenchymateuse.\n\n\xb7 Le Doppler transcr\xe2nien fournit une appr\xe9ciation rapide et non invasive de l'h\xe9modynamique c\xe9r\xe9brale chez le patient neuro-agress\xe9, particuli\xe8rement en traumatologie.\n\n\xb7 L'\xe9chographie abdominale permet au r\xe9animateur de diagnostiquer un \xe9panchement p\xe9riton\xe9al liquidien et d'\xe9liminer rapidement une cause obstructive d'insuffisance r\xe9nale.\n\n\xb7 Si l'impact pronostique des examens \xe9chographiques r\xe9alis\xe9s par le r\xe9animateur reste \xe0 d\xe9montrer, la simplicit\xe9, l'innocuit\xe9 et les donn\xe9es de la litt\xe9rature plaident pour un d\xe9veloppement rapide et g\xe9n\xe9ralis\xe9 de l'enseignement de l'\xe9chographie en r\xe9animation.\n\n",null,null,B.Z,null,null,null,null,null,null)
B.bhV=new A.a("INTRODUCTION:\n\nL'examen clinique, coupl\xe9 \xe0 un bon interrogatoire, constitue la base d'une prise en charge diagnostique et th\xe9rapeutique optimale. Les limites de l'examen physique restent cependant importantes et la variabilit\xe9 de la pertinence de l'examen clinique mal connue. Chez le patient critique, les conditions de l'examen clinique sont la plupart du temps perturb\xe9es par le stress, la douleur, la dyspn\xe9e, les troubles de conscience et la s\xe9dation. De nombreuses \xe9tudes sugg\xe8rent que l'\xe9valuation clinique de la vol\xe9mie [1] [2] [3] [4] [5], de l'\xe9tiologie d'une dyspn\xe9e [6] [7], d'une incomp\xe9tence myocardique [8] [10], de la s\xe9v\xe9rit\xe9 d'un \xe9panchement pleural [11] [12] [13] [14] peut se r\xe9v\xe9ler insuffisante et am\xe9lior\xe9e par un examen \xe9chographique. Du fait des progr\xe8s li\xe9s \xe0 la qualit\xe9 d'image et \xe0 la miniaturisation des machines, l'\xe9chographie repr\xe9sente en r\xe9animation un moyen simple d'am\xe9liorer la performance de l'examen clinique, sans n\xe9cessit\xe9 de d\xe9placer un patient potentiellement instable. Non invasive, non irradiante, l'\xe9chographie-Doppler devient le prolongement direct de l'examen clinique et l'appareil d'\xe9chographie un v\xe9ritable \xab st\xe9thoscope ultrasonique \xbb [6] [12] [15] [16]. L'explosion du nombre de publications relatives \xe0 l'\xe9chographie cardiaque et pulmonaire en soins intensifs t\xe9moigne de l'engouement des cliniciens pour la technique [12] [17]. Le champ d'action th\xe9orique de l'\xe9chographie est tr\xe8s vaste, posant \xe0 la fois la question des comp\xe9tences des r\xe9animateurs et des structures anatomiques ou fonctionnelles pouvant \xeatre explor\xe9es avec un r\xe9el gain diagnostique et th\xe9rapeutique. Le but de ce texte est de discuter la faisabilit\xe9 d'examens ultrasoniques par des m\xe9decins \xab non sp\xe9cialistes \xbb, de d\xe9finir la configuration minimale d'une machine d\xe9di\xe9e aux secteurs de r\xe9animation, soins intensifs, accueil des urgences et de fournir les bases de l'examen ultrasonographique relatif aux pathologies fr\xe9quemment rencontr\xe9es en r\xe9animation (cardiovasculaires, pleuropulmonaires, abdominales, sinusiennes et enc\xe9phaliques). Compte tenu de l'\xe9tendue du sujet, cet expos\xe9 est centr\xe9 sur les notions les plus simples.\n\n",null,null,B.Z,null,null,null,null,null,null)
B.b4Z=new A.a("\xc9CHOGRAPHIES PAR DES M\xc9DECINS \xab NON SP\xc9CIALISTES \xbb ?\n\nLa r\xe9alisation d'\xe9chographies par le r\xe9animateur est un imp\xe9ratif inh\xe9rent aux conditions m\xeame de l'exercice en r\xe9animation. Chez les patients instables, la n\xe9cessit\xe9 d'obtenir des r\xe9ponses cliniques rapides et r\xe9p\xe9t\xe9es rend difficile voire impossible l'intervention syst\xe9matique d'un radiologue ou d'un cardiologue. La pratique de l'\xe9chographie cardiaque est la plus ancienne et la plus \xe9tudi\xe9e. Plus de 250 \xe9tudes (dont la moiti\xe9 publi\xe9es entre 2000 et 2006) montrent la faisabilit\xe9 et l'int\xe9r\xeat que l'\xe9chocardiographie suscite en r\xe9animation, technique consid\xe9r\xe9e comme une v\xe9ritable \xab r\xe9volution \xbb en h\xe9modynamique [17]. Malgr\xe9 l'absence de preuve de l'impact sur la mortalit\xe9, il semble que l'analyse h\xe9modynamique par \xe9chocardiographie devienne incontournable pour les r\xe9animateurs [18]. En France, le niveau de comp\xe9tence le plus complet en \xe9chocardiographie passe par l'obtention du dipl\xf4me interuniversitaire (DIU) d'\xe9chocardiographie, dont l'orientation g\xe9n\xe9rale, historiquement cardiologique, s'est largement \xe9tendue ces derni\xe8res ann\xe9es vers la r\xe9animation. Ce DIU, d'une dur\xe9e de deux ans, comporte un enseignement th\xe9orique et pratique correspondant \xe0 la r\xe9alisation de 240 \xe9chographies transthoraciques (ETT) et 50 \xe9chographies trans\u0153sophagiennes (ETO). En 2004, les r\xe9flexions d'un groupe d'experts de la Soci\xe9t\xe9 fran\xe7aise de cardiologie (SFC), de la Soci\xe9t\xe9 de r\xe9animation de langue fran\xe7aise (SRLF) et de la Soci\xe9t\xe9 fran\xe7aise d'anesth\xe9sie et de r\xe9animation (Sfar) ont montr\xe9 la n\xe9cessit\xe9 d'un enseignement sp\xe9cifique \xe0 l'anesth\xe9sie et \xe0 la r\xe9animation. Ceci a motiv\xe9 des modifications sp\xe9cifiques du programme de seconde ann\xe9e avec instauration de 4 heures de cours sur l'\xe9chocardiographie en anesth\xe9sie r\xe9animation communes aux cardiologues et aux non cardiologues. Au cours de cette seconde ann\xe9e, il existe un module d'enseignement de 2 jours, sp\xe9cifique aux anesth\xe9sistes et r\xe9animateurs. Parall\xe8lement \xe0 cette r\xe9forme du DIU d'\xe9chocardiographie, un syst\xe8me de validation de comp\xe9tences en trois niveaux en \xe9chocardiographie pour les r\xe9animateurs est \xe0 l'\xe9tude [19] (figure 1). Ce syst\xe8me pourrait permettre la formation de l'ensemble des anesth\xe9sistes et/ou r\xe9animateurs aux bases de l'\xe9chocardiographie en un temps plus court (6 \xe0 12 mois) que les deux ann\xe9es d'enseignement du DIU. Id\xe9alement, il serait souhaitable qu'il y ait dans chaque unit\xe9 un r\xe9f\xe9rent d\xe9tenteur du DIU et que les autres praticiens aient suivi un enseignement plus succinct (figure 1). La d\xe9finition d'objectifs diagnostiques clairs au cours d'un examen \xe9chocardiographique est probablement fondamentale pour am\xe9liorer la performance diagnostique de la technique. Il en est de m\xeame pour les objectifs p\xe9dagogiques. Pour le r\xe9animateur l'\xe9chographie est r\xe9alis\xe9e pour r\xe9pondre \xe0 une question simple et les crit\xe8res de r\xe9ponse \xe0 la question doivent \xeatre simples et pr\xe9cis : par exemple : existe-t-il un \xe9panchement p\xe9ricardique ? Est-il compressif ? La fonction systolique ventriculaire gauche est-t-elle alt\xe9r\xe9e ? Ceci est fondamental afin de ne pas semer la confusion sur les comp\xe9tences respectives des cardiologues et des r\xe9animateurs. L'efficacit\xe9 du ciblage des objectifs est d\xe9montr\xe9e. Des travaux cliniques montrent qu'il est possible de former des r\xe9animateurs non cardiologues aux bases de l'\xe9chographie cardiaque transthoracique [20] [21] et trans\u0153sophagienne [22] sur des p\xe9riodes de l'ordre d'un an, en se fixant des objectifs diagnostiques simples et standardis\xe9s. Le principe de l'apprentissage simple et standardis\xe9 de l'\xe9chocardiographie d\xe9passe le champ strict de la r\xe9animation. Il est d\xe9montr\xe9 qu'une formation courte (4 h, \xe9tude de 20 cas cliniques) de r\xe9sidents de m\xe9decine interne centr\xe9e sur l'analyse \xe9chographique de la veine cave permet d'am\xe9liorer significativement le diagnostic clinique de surcharge vasculaire [23]. La m\xeame \xe9quipe a d\xe9montr\xe9 dans un travail similaire qu'il est possible de mieux appr\xe9cier le statut vol\xe9mique interdialytique de patients en insuffisance r\xe9nale chronique \xe0 l'aide d'\xe9chographies de la veine cave r\xe9alis\xe9es par des n\xe9phrologues sans exp\xe9rience \xe9chographique [24]. Deux autres travaux ont d\xe9montr\xe9 la possibilit\xe9 de former en quatre semaines des internes en secteur de m\xe9decine interne au diagnostic de dysfonction ventriculaire gauche systolique, de cardiomyopathie hypertrophique et de dysfonction valvulaire majeure avec 93 % de diagnostics corrects [25] [26]. L'\xe9chographie r\xe9alis\xe9e au lit du malade par des m\xe9decins non sp\xe9cialistes s'inscrit donc parfaitement dans le sens de l'\xe9volution naturelle des pratiques m\xe9dicales.\n\n",null,null,B.Z,null,null,null,null,null,null)
B.a9g=new A.C("Pyramides des comp\xe9tences d'\xe9chocardiographie en r\xe9animation. Au sommet : op\xe9rateur qualifi\xe9 (dipl\xf4me interuniversitaire = DIU), capable de r\xe9aliser un examen \xe9chocardiographique complet. Cet op\xe9rateur est en charge de la formation des praticiens non form\xe9s de l'unit\xe9, en veillant notamment \xe0 ce que soient acquis les items cit\xe9s \xe0 la base de la pyramide. Le niveau interm\xe9diaire repr\xe9sente des praticiens en cours de formation, ayant int\xe9gr\xe9 la base de la pyramide et capables d'une analyse plus fine. D'apr\xe8s Cholley et al. [19]. PAPs = pression de l'art\xe8re pulmonaire systolique. FEVG = fraction d'\xe9jection du ventricule gauche.","assets/images/pathologies/divers/echo/2pyramide.gif",null)
B.blF=new A.a("La pr\xe9sence croissante d'appareils d'\xe9chocardiographie dans les unit\xe9s de r\xe9animation a naturellement ouvert la voie \xe0 l'exploration par les r\xe9animateurs de structures extracardiaques, notamment pulmonaires [6] [11] [12] [14] [15] [27] [28] [29] [30] [31], sinusiennes [32] [33] [34], vasculaires [35] [36] et abdominales [37] [38] [39]. Le niveau de comp\xe9tence dans ces explorations est moins bien d\xe9fini que pour l'\xe9chocardiographie. Il est toutefois d\xe9montr\xe9 depuis plus de 10 ans que la r\xe9alisation d'\xe9chographies abdominales de d\xe9brouillage dans le cadre de l'urgence traumatique par des m\xe9decins non radiologues est efficace pour le diagnostic d'h\xe9mop\xe9ritoine et aide \xe0 la bonne orientation des patients [38] [39].\n\nTout examen \xe9chographique, en particulier \xe9chocardiographique, doit faire l'objet d'un compte rendu figurant dans le dossier, identifiant le nom de l'op\xe9rateur et les conclusions de l'examen. Outre la valeur m\xe9dico-l\xe9gale de ce compte rendu, cette r\xe9daction a une valeur d'apprentissage, for\xe7ant l'examinateur \xe0 faire la synth\xe8se de ces observations et des mesures r\xe9alis\xe9es. Si la r\xe9alisation d'\xe9chographies par le r\xe9animateur est devenue (ou deviendra) un geste de routine, tout doute sur un diagnostic complexe doit faire intervenir un sp\xe9cialiste, tant pour la cardiologie (suspicion d'endocardite, quantification d'une fuite valvulaire, identification une image tumorale intracardiaque, constriction p\xe9ricardique...) que pour l'\xe9chographie g\xe9n\xe9rale (doute sur une thrombose veineuse, art\xe9rielle, recherche de thrombose vasculaire intra-abdominale, suspicion de processus expansif r\xe9nal, spl\xe9nique ou h\xe9patique...).\n",null,null,B.Z,null,null,null,null,null,null)
B.a9O=new A.C("Configuration g\xe9n\xe9rale d'un appareil d'\xe9chographie en r\xe9animation","assets/images/pathologies/divers/echo/3sondes.gif",null)
B.bgZ=new A.a("L'examen \xe9chographique transpari\xe9tal est difficile chez le patient de r\xe9animation, en raison d'une \xe9chog\xe9nicit\xe9 moindre, secondaire \xe0 la dyspn\xe9e, \xe0 la ventilation m\xe9canique, aux pansements et \xe0 la difficult\xe9 de mobiliser les patients. Ces \xe9l\xe9ments plaident en faveur de l'acquisition de machines r\xe9centes et de bon niveau afin de garantir une qualit\xe9 d'image optimale. Les choix pragmatiques visant \xe0 fournir aux unit\xe9s de r\xe9animation des machines r\xe9form\xe9es par les services de radiologie ou de cardiologie ne peuvent donc repr\xe9senter que des solutions transitoires avant l'acquisition d'un mat\xe9riel neuf.\n\nLa configuration id\xe9ale comporte :\n\n- une sonde \xab thoracique \xbb, \xe9troite (passage intercostal) g\xe9n\xe9rant des ultrasons (US) de basse fr\xe9quence (1 \xe0 3 MHz ou 2 \xe0 5 MHz), plane, \xe0 balayage sectoriel. Les basses fr\xe9quences permettent d'analyser les structures profondes (> 6 cm) telles que le c\u0153ur, la pl\xe8vre, le poumon et les vaisseaux intrac\xe9r\xe9braux ;\n- une sonde \xab abdominale \xbb, large, courbe, de basse fr\xe9quence (1 \xe0 3 MHz), \xe0 balayage sectoriel, permettant d'analyser les structures profondes (> 6 cm) intra-abdominales ;\n- une sonde \xab barrette \xbb, \xe0 balayage lin\xe9aire, de haute fr\xe9quence (7 \xe0 10 MHz) permettant une analyse des structures superficielles (< 6 cm) telles que la peau, les tissus mous et surtout les vaisseaux tant cervicaux que des membres. Cette sonde peut permettre une analyse plus fine de la pl\xe8vre que la sonde thoracique ;\n- une sonde d'\xe9chographie cardiaque trans\u0153sophagienne (ETO) multiplan ;\n- une configuration informatique permettant l'analyse des diff\xe9rentes structures: cardiaque, abdominale, vasculaire (superficielle, abdominale et transcr\xe2nienne) ;\n- les modes Doppler suivants : continu, puls\xe9, couleur, tissulaire ;\n- une imagerie bidimensionnelle de type harmonique, am\xe9liorant consid\xe9rablement la qualit\xe9 de l'image ;\n- un syst\xe8me d'enregistrement simultan\xe9 de l'ECG, indispensable en \xe9chographie cardiaque ;\n- un syst\xe8me d'enregistrement simultan\xe9 des pressions de ventilation chez les patients plac\xe9s sous ventilation m\xe9canique. Cet enregistrement permet d'\xe9tudier les variations respiratoires des vitesses des flux intracardiaques, des gros vaisseaux et du diam\xe8tre des veines caves, t\xe9moins de pr\xe9charge-d\xe9pendance [40] [41] [42] [43].\n",null,null,B.Z,null,null,null,null,null,null)
B.aXz=new A.a("TERMINOLOGIE SIMPLIFI\xc9E D'\xc9CHOGRAPHIE-DOPPLER\n\nModes d'\xe9chographie (figure 3)\n\nL'\xe9chographie permet des images bidimensionnelles (mode 2D) ou en temps-mouvement (mode TM ou mode M en anglais). Les images 2D montrent les structures anatomiques et constituent les images \xe9chographiques au sens commun du terme. Le mode TM ou M permet la visualisation de structures anatomiques en mouvements en fonction du temps. Le mode M permet la mesure des diam\xe8tres de cavit\xe9s sur un cycle de temps, par exemple la mesure des diam\xe8tres t\xe9l\xe9systoliques et t\xe9l\xe9diastoliques permettant la mesure de la fraction de raccourcissement ventriculaire gauche (figure 3). Les variations respiratoires des veines caves (inf\xe9rieure en ETT, sup\xe9rieure en ETO) qui constituent un bon indice de pr\xe9charge d\xe9pendance, sont \xe9tudi\xe9es \xe0 l'aide de ce mode [42] [43]. Le mode M permet \xe9galement la mesure des \xe9paisseurs de paroi cardiaque afin de juger du caract\xe8re hypertrophique d'une cardiomyopathie.\n\n",null,null,B.Z,null,null,null,null,null,null)
B.a8X=new A.C("Modes d'imagerie en \xe9chographie. a : imagerie bidimensionnelle (coupe apicale 4 cavit\xe9s cardiaque). b : \xe9chographie TM du ventricule gauche permettant la mesure des \xe9paisseurs de paroi, des diam\xe8tres ventriculaires en systole et en diastole puis le calcul de la fraction de raccourcissement.","assets/images/pathologies/divers/echo/4modes2dtm.gif",null)
B.b3x=new A.a("Modes Doppler\nQuatre modes Doppler sont utilis\xe9s en routine : continu, puls\xe9, couleur et tissulaire. Physiologiquement, les vitesses intracardiaques sont inf\xe9rieures \xe0 1,5 m \xb7 s-1. Toute vitesse sup\xe9rieure est pathologique et correspond en g\xe9n\xe9ral \xe0 une st\xe9nose (valvulaire, vasculaire, intraventriculaire) ou \xe0 une fuite valvulaire massive.\n\nDoppler continu\nDans ce mode Doppler, l'\xe9mission et la r\xe9ception des US se font de fa\xe7on continue par 2 cristaux diff\xe9rents. L'image (spectre) Doppler obtenue correspond \xe0 la somme de toutes les vitesses enregistr\xe9es sur la totalit\xe9 de la longueur du trajet des US repr\xe9sent\xe9 sur l'image par la ligne de tir. Un flux venant vers la sonde est dit positif et est cod\xe9 au-dessus de la ligne de base. Un flux venant, fuyant la sonde, est dit n\xe9gatif et est cod\xe9 au-dessous de la ligne de base. Ce mode permet l'analyse des hautes vitesses (> 1,5 m \xb7 s-1) mais ne permet pas de localiser l'endroit de l'acc\xe9l\xe9ration du flux (figure 4). En d'autres termes, le Doppler continu autorise une bonne r\xe9solution des vitesses mais entra\xeene un ph\xe9nom\xe8ne d'ambigu\xeft\xe9 spatiale. Par exemple, une acc\xe9l\xe9ration du flux sur la chambre d'\xe9jection ventriculaire gauche peut correspondre \xe0 un gradient intraventriculaire (cardiomyopathie obstructive) ou \xe0 une st\xe9nose aortique. Seule l'analyse de la g\xe9om\xe9trie ventriculaire, de l'anatomie des valves et du spectre Doppler couleur permettra de localiser la zone malade. En pratique, ce mode permet de quantifier les st\xe9noses et les fuites.\n\nDoppler puls\xe9\nDans ce mode, les US sont \xe9mis par paquets discontinus. \xc0 l'inverse du Doppler continu, le Doppler puls\xe9 permet d'analyser une zone pr\xe9cise, punctiforme mais ne permet pas l'analyse de vitesses sup\xe9rieures \xe0 1,5 m \xb7 s-1. Il existe donc une bonne r\xe9solution spatiale mais une ambigu\xeft\xe9 des vitesses. Un flux venant vers la sonde est dit positif et est cod\xe9 au-dessus de la ligne de base. Un flux venant, fuyant la sonde, est dit n\xe9gatif et est cod\xe9 au-dessous de la ligne de base. L'incapacit\xe9 de ce mode \xe0 analyser les vitesses \xe9lev\xe9es se traduit par le ph\xe9nom\xe8ne d'aliasing ou repliement spectral ou le spectre Doppler est d\xe9capit\xe9 sur les hautes vitesses qui apparaissent en miroir dans le sens invers\xe9. En pratique, le mode puls\xe9 permet d'analyser les pressions de remplissage sur le flux mitral et le calcul du d\xe9bit cardiaque par le flux sous-aortique.\n\nDoppler couleur\nLe Doppler couleur est un Doppler puls\xe9. Il comporte donc les limites de ce dernier : bonne r\xe9solution spatiale mais ambigu\xeft\xe9 des vitesses. Le mode couleur consiste en une cartographie des vitesses au sein d'un volume d'\xe9chantillonnage mat\xe9rialis\xe9 sur l'image par un secteur trap\xe9zo\xefdal. En d'autres termes, au sein du volume d'\xe9chantillonnage, chaque globule rouge en mouvement re\xe7oit un code couleur qui est fonction du sens de son d\xe9placement. Un flux vers la sonde est dit positif et est cod\xe9 en rouge. Un flux fuyant la sonde est dit n\xe9gatif et est cod\xe9 en bleu. Le ph\xe9nom\xe8ne d'aliasing est tr\xe8s informatif en Doppler couleur car il se traduit par un codage jaune. Ainsi, la visualisation d'un flux jaune t\xe9moigne d'une acc\xe9l\xe9ration r\xe9gionale du flux et permet de localiser la zone responsable d'une st\xe9nose. En cela, le Doppler couleur compl\xe8te les donn\xe9es du Doppler continu qui a montr\xe9 une acc\xe9l\xe9ration sans permettre de localiser son site. \xc0 titre d'exemple, si un flux acc\xe9l\xe9r\xe9 est observ\xe9 en Doppler continu sur la voie d'\xe9jection ventriculaire gauche, on ne peut diff\xe9rencier une st\xe9nose aortique d'une obstruction intraventriculaire. La visualisation d'un aliasing couleur (flux jaune) intraventriculaire plaide pour la seconde hypoth\xe8se, un alisasing transvalvulaire plaide en faveur d'un r\xe9tr\xe9cissement aortique (figure 4). De plus, la forme du spectre Doppler continu (lame de sabre ou non) constitue un autre \xe9l\xe9ment de diagnostic diff\xe9rentiel (figure 4 et figure 5).\n",null,null,B.Z,null,null,null,null,null,null)
B.aak=new A.C("Doppler d'\xe9jection ventriculaire gauche. \xc0 gauche (a1 et a2) : Doppler normal. En couleur, le flux est bleu homog\xe8ne, affirmant l'absence d'acc\xe9l\xe9ration pathologique (a1). On peut donc enregistrer en Doppler puls\xe9 le flux sous-aortique en coupe 5 cavit\xe9s, qui permet le calcul de l'int\xe9grale temps vitesse (ITV) et repr\xe9sente indirectement le volume d'\xe9jection systolique (a2). Ici, la vitesse maximale du flux sous-aortique est de 1,2 m \xb7 s-1. \xc0 droite (b1 et b2) : cardiomyopathie obstructive. b1 : aliasing intraventriculaire (fl\xe8che) au contact d'une hypertrophie septale permettant de diff\xe9rencier cette image d'une st\xe9nose aortique. b2 : acc\xe9l\xe9ration du flux authentifi\xe9 par le Doppler continu. Noter ici que la vitesse maximale du flux est \xe0 3 m \xb7 s-1 avec un aspect typique en lame de sabre (fl\xe8che).","assets/images/pathologies/divers/echo/5doppler.gif",null)
B.aaT=new A.C("St\xe9nose aortique : flux d'\xe9jection acc\xe9l\xe9r\xe9 sans aspect en lame de sabre.","assets/images/pathologies/divers/echo/6stenoseaortique.gif",null)
B.ba9=new A.a("R\xc8GLES D'HYGI\xc8NE VISANT \xc0 \xc9VITER\nLA TRANSMISSION DE BACT\xc9RIES MULTIR\xc9SISTANTES\nLa machine et les sondes d'\xe9chographie sont un vecteur potentiel de transmission crois\xe9e d'infections nosocomiales. Il est donc fondamental de mettre en place des protocoles de d\xe9contamination connue de tous avec mise \xe0 disposition dans chaque chambre de pulv\xe9risateurs de produits d\xe9contaminants adapt\xe9s aux mat\xe9riaux des machines d'\xe9chographies. Les mesures g\xe9n\xe9rales sont r\xe9sum\xe9es dans le tableau VI [12].\n\nMesures visant \xe0 limiter le transfert des agents infectieux :\n\n     \xb7 \xc9viter au maximum les contacts entre la machine et l'environnement du patient\n\n     \xb7 Privil\xe9gier les sachets de gel \xe0 usage unique\n\n     \xb7 Limiter le contact des lignes de la sonde avec le patient\n\n     \xb7 \xc0 la fin de l'examen, laisser la sonde sur le lit avant la d\xe9contamination\n\nMesures de d\xe9contamination :\n\n     \xb7 Lavage des mains de l'examinateur, solutions hydro alcooliques\n\n     \xb7 Nettoyage scrupuleux du gel sur les sondes\n\n     \xb7 D\xe9contamination des supports de sonde et de la sonde par application de solutions d\xe9contaminantes\n\n     \xb7 D\xe9contamination du clavier\n\n     \xb7 S\xe9chage \xe0 l'air\n\n",null,null,B.Z,null,null,null,null,null,null)
B.b07=new A.a("CONCLUSION\nUne \xe9tude australienne r\xe9cente montre que, malgr\xe9 une utilisation encore importante du cath\xe9ter art\xe9riel pulmonaire, une majorit\xe9 de praticiens pense que l'\xe9chocardiographie va remplacer le cath\xe9ter art\xe9riel pulmonaire dans les ann\xe9es \xe0 venir [123]. Il est d\xe9montr\xe9 que l'\xe9chographie en temps r\xe9el diminue les complications lors de la pose des cath\xe9ters veineux centraux. De tr\xe8s nombreuses publications sugg\xe8rent enfin que l'\xe9chographie am\xe9liore la performance diagnostique pulmonaire, c\xe9r\xe9brale, abdominale et sinusienne. La simplicit\xe9 et l'innocuit\xe9 de la technique expliquent la popularit\xe9 sans pr\xe9c\xe9dent de l'\xe9chographie en r\xe9animation. Les voies de recherche des prochaines ann\xe9es devront porter sur l'incidence de la technique en termes de pronostic et sur des syst\xe8mes de validation des comp\xe9tences des r\xe9animateurs en \xe9chographie.\n",null,null,B.Z,null,null,null,null,null,null)
