B.b_G=new A.a("JUSTIFICATION\nLe blocage neuromusculaire peut \xeatre un outil utile pour soigner les patients atteints de SDRA s\xe9v\xe8re et peut r\xe9duire la mortalit\xe9  (ou non )\nIl existe plusieurs m\xe9canismes par lesquels les curares peuvent \xeatre b\xe9n\xe9fiques aux patients atteints de SDRA s\xe9v\xe8re :\n  - Am\xe9lioration de la synchronisation aux ventilateurs / pr\xe9vention des l\xe9sions pulmonaires induites par le patient \n  - Baisse de la consommation d'oxyg\xe8ne (muscles respiratoires utilisent <2% de VO2 au repos mais  10-20% \xe0 l\u2019effort)\nCependant, les curares peuvent \xe9galement \xeatre d\xe9l\xe9t\xe8res : \n  - La curarisation prolong\xe9e/excessive est associ\xe9e \xe0 une faiblesse neuromusculaire/perte musculaire (Neuromyopathie de r\xe9animation)\n  - Une s\xe9dation prolong\xe9e ou plus profonde est associ\xe9e \xe0 un risque accru de d\xe9lire et de troubles neurocognitifs \n  - La curarisation est associ\xe9e \xe0 un risque accru d\u2019escarres, d'abrasions corn\xe9ennes et de TVP.\nAinsi, la curarisation ne doit \xeatre administr\xe9e que chez les patients susceptibles d'en b\xe9n\xe9ficier et seulement pour la dur\xe9e la \nplus courte possible.\n\n",null,null,null,null,null,null,null,null,null)
B.b9z=new A.a("CHOIX DU CURARE:\n- Tous les curares sont non d\xe9polarisants et administr\xe9s par perfusion continue. \n- Cisatracurium (Nimbex) \u2013 M\xe9tabolis\xe9 par les est\xe9rases/spontan\xe9ment dans le plasma (\xe9limination de Hoffman) ; pas d'\xe9limination r\xe9nale ou h\xe9patique. Plus cher.\n- Rocuronium  (Esmeron) \u2013 M\xe9tabolisme essentiellement h\xe9patique, avec toutefois une excr\xe9tion r\xe9nale/biliaire des m\xe9tabolites. \xc0 \xe9viter en cas d'insuffisance r\xe9nale.\n- Vecuronium \u2013 M\xe9tabo: 40% r\xe9nale, 60% biliaire. A \xe9viter en cas d'insuffisance \n- Appelez-les curares, \"paralytiques\" fait peur aux patients/familles. \n\n",null,null,null,null,null,null,null,null,null)
