B.bd6=new A.a("Crit\xe8res diagnostiques de l\u2019endocardite (Duke University modifi\xe9s par European Society of Cardiology 2015)",null,B.M,null,null,null,null,null,null,null)
B.biO=new A.a("Crit\xe8res majeurs:",null,B.z,null,null,null,null,null,null,null)
B.bcT=new A.a("1) H\xe9mocultures (HC)\n  -2 HC+ s\xe9par\xe9es \xe0 bact\xe9rie \xe9vocatrice d\u2019EI = Streptocoques \u03b1 h\xe9molytiques ou non h\xe9molytiques, groupe HACCEK, Staphylocoque, Enterocoque en l\u2019absence de foyer identifi\xe9, une seule hemoc+ pour Coxiella burnetii\n  -Plusieurs HC \uf0c5 \xe0 germe non habituel avec un intervalle de 12h entre 2 HC ou 3 h\xe9mocultures sur 4 pr\xe9lev\xe9es \xe0 1 heure d\u2019intervalle.\n\n2) Crit\xe8res d\u2019imagerie\n  -Echocardiographie : v\xe9g\xe9tation ou abc\xe8s ou d\xe9sinsertion de valve ou apparition d\u2019une fuite valvulaire ou perforation/an\xe9vrisme valvulaire.\n    . L\xe9sion p\xe9ri-valvulaire au scanner cardiaque\n    . En cas de proth\xe8se valvulaire pos\xe9e depuis plus de 3 mois, activit\xe9 autour du site d\u2019implantation de la proth\xe8se au PET-scan\n",null,null,null,null,null,null,null,null,null)
B.bm6=new A.a("Crit\xe8res mineurs:",null,B.z,null,null,null,null,null,null,null)
B.beR=new A.a("1) Terrain (cardiopathie sous-jacente, toxicomanie IV)\n2) Fi\xe8vre > 38\xb0 C\n3) Manifestations vasculaires : embolie spl\xe9nique, pulmonaire ou c\xe9r\xe9brale. H\xe9morragie intra-cr\xe2nienne, an\xe9vrisme mycotique, h\xe9morragie conjonctivale, \xe9ryth\xe8me de Janeway.\n4) Signes immunologiques : glom\xe9rulon\xe9phrite, faux panaris d\u2019Osler, taches de Roth, facteur rhumato\xefde positif.\n5) Donn\xe9es microbiologiques (h\xe9moculture) ne satisfaisant pas les crit\xe8res majeurs ou s\xe9rologie positive \xe0 un germe compatible\n",null,null,null,null,null,null,null,null,null)
B.bfD=new A.a("Diagnostic:",null,B.z,null,null,null,null,null,null,null)
B.b4x=new A.a("Certain\t\n    2 crit\xe8res majeurs OU\n    1 crit\xe8re majeur + 3 crit\xe8res mineurs OU\n    5 crit\xe8res mineurs\nRejet\xe9\t\n    Existence d\u2019un diagnostic alternatif OU\n    R\xe9solution des manifestations apr\xe8s antibioth\xe9rapie < 4 j\nPossible\t\n    le diagnostic ne peut \xeatre ni affirm\xe9 ni rejet\xe9\n",null,null,null,null,null,null,null,null,null)
B.bez=new A.a("Bilan initial de l\u2019endocardite :",null,B.z,null,null,null,null,null,null,null)
B.b2u=new A.a("Biologie, ECG\nBilan d\u2019entr\xe9e avec CRP\nProt\xe9inurie/cr\xe9atininurie sur \xe9chantillon\nFacteur rhumato\xefde\n2 paires d\u2019h\xe9mocultures \xe0 l\u2019admission (H0) sur une ponction, 1 paire \xe0 H1 et 1 paire \xe0 H2 \u2013 pr\xe9venir le laboratoire (incubation prolong\xe9e pour germe \xe0 croissance lente ou patient sous antibioth\xe9rapie pr\xe9alable).\nEchographie cardiaque : ETO (en plus de l\u2019ETT) doit \xeatre la norme sauf si contre-indication ou mauvaise tol\xe9rance s\xe9v\xe8re du patient. \n",null,null,null,null,null,null,null,null,null)
B.blT=new A.a("Bilan d\u2019extension :",null,B.z,null,null,null,null,null,null,null)
B.bbc=new A.a("IRM c\xe9r\xe9brale ou scanner c\xe9r\xe9bral avec injection\n\nA discuter :\nScanner thoraco-abdomino-pelvien avec injection (\xe0 ne faire que si sympt\xf4me retrouv\xe9 apr\xe8s un examen clinique approfondi. Le risque de d\xe9gradation de la fonction r\xe9nale est non n\xe9gligeable en particulier chez les personnes \xe2g\xe9es, et peut \xeatre potentialis\xe9 par l\u2019antibioth\xe9rapie \xe0 fortes doses) ;\nAngioscanner thoracique si endocardite droite\nScanner cardiaque \xe0 discuter avec cardiologues en fonction des r\xe9sultats de l\u2019ETO\nPET scanner si proth\xe8se intra-cardiaque > 3 mois ou pour bilan d\u2019extension (Pet scanner corps entier)\n",null,null,null,null,null,null,null,null,null)
B.b8T=new A.a("Bilan porte d\u2019entr\xe9e :",null,B.z,null,null,null,null,null,null,null)
B.bix=new A.a("Panoramique dentaire avec consultation stomatologique en syst\xe9matique\nEndoscopies digestives, urologiques\u2026 en fonction du type de germe\n",null,null,null,null,null,null,null,null,null)
B.b_7=new A.a("Bilan de suivi :",null,B.z,null,null,null,null,null,null,null)
B.bk6=new A.a("- h\xe9mocultures : une paire d\u2019h\xe9moculture toutes les 48h (jusqu\u2019\xe0 l\u2019obtention de 2 s\xe9ries st\xe9riles)\n- Les antibiotiques doivent \xeatre dos\xe9s 48h apr\xe8s leur initiation (sauf la rifampicine pour laquelle il faut attendre 5 jours), puis une fois par semaine pour les \u03b2-lactamines et la vancomycine. Pas de dosage possible pour la daptomycine\n",null,null,null,null,null,null,null,null,null)
