B.biJ=new A.a("Ce cadre doit \xeatre restreint et couvrir un nombre de situations tr\xe8s limit\xe9 : \nDans la plupart des cas, il n\u2019est pas n\xe9cessaire de d\xe9buter une antibioth\xe9rapie probabiliste en urgence\nAvant tout traitement, pr\xe9levez au moins 3 paires d\u2019h\xe9mocultures et d\u2019\xe9ventuels sites secondaires (arthrite, etc.)\nLa complexit\xe9 des situations incite \xe0 prendre en compte de nombreux param\xe8tres (contage, terrain, \xe9volutivit\xe9, porte d\u2019entr\xe9e), id\xe9alement dans une d\xe9cision multidisciplinaire.\nL\u2019antibioth\xe9rapie sera adapt\xe9e secondairement aux r\xe9sultats microbiologiques.\n",null,null,null,null,null,null,null,null,null)
