B.b29=new A.a("-\tEndocardite sur proth\xe8se : 6 semaines\n-\tEndocardite sur valve native : 2-6 semaines, selon la bact\xe9rie et son niveau de sensibilit\xe9\n-\tEn l\u2019absence de chirurgie, le J0 de l\u2019antibioth\xe9rapie est le 1er jour d\u2019obtention d\u2019h\xe9mocultures n\xe9gatives\n-\tSi chirurgie cardiaque en cours de traitement, 2 situations : \n    o\tculture valve positive : J0 de l\u2019antibioth\xe9rapie = jour de chirurgie; \n    o\tculture valve n\xe9gative : J0 de l\u2019antibioth\xe9rapie = date 1\xe8re h\xe9moculture n\xe9gative, avec dur\xe9e minimale de traitement postop\xe9ratoire de 14 jours.\n",null,null,null,null,null,null,null,null,null)
