B.bqe=new A.a("\xb7 Le choc survient lorsque le d\xe9bit cardiaque (DC) et l'apport en oxyg\xe8ne (DO2) sont insuffisants pour r\xe9pondre aux besoins. Les manifestations peuvent \xeatre diverses et ne pas inclure initialement d'hypotension (choc compens\xe9). L'identification de l'\xe9tiologie de  l\u2019\xe9tat de choc est essentielle pour en d\xe9terminer le traitement.\n\n\xb7 Le choc peut \xeatre divis\xe9 en quatre cat\xe9gories : cardiog\xe9nique, obstructif, distributif , hypovol\xe9mique\n\n\xb7 Des causes multiples peuvent \xeatre pr\xe9sentes (par exemple, une septic\xe9mie chez un patient souffrant d'insuffisance cardiaque d\xe9compens\xe9e) et certaines \xe9tiologies peuvent provoquer un choc mixte:\n   \xb7 Endocrinien  (insuf. surr\xe9nale, myxoed\xe8me, thyrotoxicose)\n   \xb7 M\xe9tabolique (hypothermie, acidose grave)\n",null,null,null,null,null,null,null,null,null)
