B.bpz=new A.a("Site concern\xe9 : GHEF site Meaux\nServices concern\xe9es: R\xe9animation Polyvalente, Unit\xe9 de Soins Continus  adulte \nPersonnes concern\xe9es: Cadres, IDE, M\xe9decins \nResponsables d\u2019application : Cadre de proximit\xe9, IDE r\xe9f\xe9rente, cadre de p\xf4le, chef de service et chef de p\xf4le\n",null,null,null,null,null,null,null,null,null)
B.em=new A.a("2.\tContexte et Objectifs",null,B.M,null,null,null,null,null,null,null)
B.boc=new A.a("Lors de la VDRI (visite de risques infectieux) effectu\xe9e par l\u2019EOH (Equipe Op\xe9rationnelle d\u2019Hygi\xe8ne) de Meaux en septembre 2020, plusieurs \xe9carts de bonnes pratiques concernant la gestion des DIVLD (Dispositif invasif de longue dur\xe9e)  ont \xe9t\xe9 relev\xe9s. S\xe9curiser le montage et l\u2019utilisation des lignes de perfusion a \xe9t\xe9 identifi\xe9 comme objectif prioritaire. Deux actions essentielles ont pu \xeatre mises en place. Le choix d\u2019un montage de lignes respectant les recommandations de bonnes pratiques a \xe9t\xe9 r\xe9alis\xe9 et l'ensemble des IDE (infirmiers) form\xe9s \xe0 leur mise en place, entretien et utilisation.  \nCette proc\xe9dure a pour objet de d\xe9crire la technique de montage, manipulation et gestion des lignes sur CVC (cath\xe9ter veineux central) en r\xe9animation adulte. Le but \xe9tant de standardiser les pratiques et pr\xe9venir les complications infectieuses.\n                          ",null,null,null,null,null,null,null,null,null)
B.fu=new A.a("3.\tD\xe9finitions, Abr\xe9viations ",null,B.M,null,null,null,null,null,null,null)
B.b_K=new A.a("SHA : Solution Hydro-Alcoolique\t\nVDRI : Visite De Risques Infectieux\nPSE : Pousse Seringue Electrique\t\nEOH : Equipe Op\xe9rationnelle d\u2019Hygi\xe8ne\nSAP : Seringue Auto Puls\xe9e\t\nDIVLD : Dispositif Invasif de Longue Dur\xe9e\nCVC : Cath\xe9ter Veineux Central\t\nNaCl : Chlorure de sodium\nIDE : Infirmier(e) Dipl\xf4m\xe9(e)d\u2019Etat\t\nAES : Accident d\u2019Exposition au Sang et liquide Biologique\nIVD : Injection intraVeineuse Directe \t\n\n>\tLe cath\xe9t\xe9risme veineux  central ( CVC ) : consiste en l\u2019introduction dans le syst\xe8me veineux d\u2019un cath\xe9ter long donnant acc\xe8s \xe0 la jonction syst\xe8me cave/oreillette  droite. Le CVC  est implant\xe9 par voie percutan\xe9e. C\u2019est un fin tuyau en mat\xe9riel biocompatible (le plus souvent en polyur\xe9thane). Il est fix\xe9 \xe0 la peau par un fil non r\xe9sorbable. Le choix de l\u2019abord est laiss\xe9 \xe0 l\u2019appr\xe9ciation de l\u2019op\xe9rateur. Plusieurs abords sont possibles : \n    -\tvoie jugulaire interne droite et gauche.\n    -\tvoie f\xe9morale droite et gauche.\n    - voie sous clavi\xe8re droite et gauche en derni\xe8re intention car risque de thrombose veineuse.\n>\tOctopus : prolongateur multi-lumi\xe8res avec clamps.\n>\tValve bidirectionnelle : dispositif m\xe9dical permettant un acc\xe8s direct \xe0 la voie veineuse sans aiguille. La valve autorise l\u2019injection comme l\u2019aspiration, d\u2019o\xf9 l\u2019appellation  \xab bidirectionnelle \xbb. Elle permet donc les injections et perfusions mais aussi les pr\xe9l\xe8vements de sang. Elle se trouve directement pr\xe9-mont\xe9e (sur rampes, robinets) ou conditionn\xe9e seule. La valve est ouverte par la connexion d\u2019un embout Luer m\xe2le (seringue, prolongateur, perfuseur) puis se referme lors du retrait de l\u2019embout Luer m\xe2le. Elles ont \xe9t\xe9 con\xe7ues pour assurer un syst\xe8me clos, limiter les risques d\u2019AES pour le personnel soignant, \xe9viter les embolies gazeuses et limiter les riques d\u2019infection.\n>\tValve anti-retour : valve unidirectionnelle qui emp\xeache toute remont\xe9e du liquide, mais la pression d\u2019ouverture est relativement faible (sur ligne de perfusion par gravit\xe9).\n                       ",null,null,null,null,null,null,null,null,null)
