B.baz=new A.a(">\tPansement 3M Tegaderm\u2122 CHG :  pansement transparent semi perm\xe9able avec un tampon d\u2019hydrogel impr\xe9gn\xe9 de gluconate de chlorhexidine.\n>\tRin\xe7age puls\xe9 : le rin\xe7age puls\xe9 ou en saccades en 5 \xe0 10 pouss\xe9es successives avec une seringue de 10 ml de NaCl \xe0 0,9% est l\u2019acte de r\xe9f\xe9rence pour \xe9viter toute obstruction ou toute pr\xe9cipitation de produits incompatibles entre eux. \n>\tManipulations proximales : manipulations au niveau de la connexion cath\xe9ter-ligne de perfusion principale.\n>\tManipulations distales : manipulations \xe0 distance de la connexion cath\xe9ter-ligne de perfusion principale.\n                       ",null,null,null,null,null,null,null,null,null)
