B.bd9=new A.a("Recommandations pr\xe9alables : ",null,B.el,null,null,null,null,null,null,null)
B.b4f=new A.a("1)\tPenser \xe0 pr\xe9parer les seringues des m\xe9dicaments en cours avec prolongateur de SAP chang\xe9 et purg\xe9 pour les installer sur la nouvelle rampe.\n2)\tToutes les manipulations des voies ou robinets se font avec des compresses st\xe9riles imbib\xe9es d\u2019antiseptique alcoolique.\n3)\tEn cas d\u2019introduction de cat\xe9cholamines, penser \xe0 purger la voie de l\u2019octopus (qui peut servir pour un changement de dilution ou pour la dobutamine\xae) avec du NaCl \xe0 0,9%, l\u2019autre voie sera purg\xe9e avec le m\xe9dicament \xe0 introduire.",null,null,null,null,null,null,null,null,null)
B.b5V=new A.a("4)\tNE JAMAIS UTILISER DE SERINGUE D\u2019UNE CONTENANCE INFERIEURE A 10 ML POUR LE RIN\xc7AGE DES VOIES DU CVC AINSI QUE TOUTE ADMINISTRATION DE THERAPEUTIQUE (Risque de surpression pouvant entra\xeener une fissure ou rupture de cath\xe9ter).\n                       ",null,B.c2,null,null,null,null,null,null,null)
B.b0H=new A.a("Montage de la rampe :",null,B.el,null,null,null,null,null,null,null)
B.bhN=new A.a(">\tR\xe9aliser une d\xe9sinfection des mains par friction avec une SHA.\n>\tOuvrir l\u2019emballage de la rampe et d\xe9poser l\u2019ensemble de son contenu sur le c\xf4t\xe9 plastifi\xe9.\n>\tConnecter les diff\xe9rents dispositifs en les manipulant avec des compresses st\xe9riles imbib\xe9es d\u2019un antiseptique alcoolique.\n>\tPurger les voies et chaque valve pour chasser l\u2019air \xe0 l\u2019aide d\u2019une seringue de 5 ml sans le piston. Ne pas oublier de fermer tous les robinets.\n",null,null,null,null,null,null,null,null,null)
B.bbl=new A.a("Avant le soin : ",null,B.el,null,null,null,null,null,null,null)
B.bmN=new A.a(">\tR\xe9aliser une d\xe9sinfection des mains par friction avec une SHA.\n>\tArr\xeat temporaire des PSE (sauf cat\xe9cholamines) et de la perfusion de base.\n>\tFermer le clamp de chaque voie.\n>\tD\xe9connecter l\u2019ancienne voie avec des compresses st\xe9riles imbib\xe9es d\u2019un antiseptique alcoolique et la jeter. A faire sur chaque voie sauf sur la proximale si cat\xe9cholamines. Laisser pour le moment les valves bidirectionnelles.\n>\tR\xe9aliser une d\xe9sinfection des mains par friction avec une SHA.\n>\tOuvrir le champ st\xe9rile, le d\xe9poser au niveau du patient afin que les 3 voies du cath\xe9ter reposent dessus.\n",null,null,null,null,null,null,null,null,null)
B.b0I=new A.a("R\xe9fection du pansement : tous les 7 jours sauf si souill\xe9 ou d\xe9coll\xe9.",null,B.el,null,null,null,null,null,null,null)
B.b0e=new A.a(">\tR\xe9aliser une d\xe9sinfection des mains par friction avec une SHA.\n>\tOuvrir le champ st\xe9rile et y d\xe9poser le mat\xe9riel (seringues de purge et du rin\xe7age puls\xe9, pansement)  n\xe9cessaire , ceci sur un plan de travail d\xe9sinfect\xe9 au pr\xe9alable.\n>\tOuvrir le set d\u2019aseptie cutan\xe9 et verser dans les cupules l\u2019antiseptique color\xe9 et le NaCl ainsi que les valves bidirectionnelles.\n>\tR\xe9aliser une d\xe9sinfection des mains par friction avec une SHA.\n>\tEnfiler des gants \xe0 usage unique non st\xe9riles.\n>\tRetirer l\u2019\xe9tiquette et la (les) bande(s) de maintien du haut du pansement.\n>\tLentement et d\xe9licatement, commencer \xe0 retirer le pansement \xe0 partir du site o\xf9 le cath\xe9ter ou la tubulure sort du pansement, vers le site d\u2019insertion du cath\xe9ter.\n>\tLorsque le tampon de gel appara\xeet, attraper un de ses angles ainsi que le film transparent du pansement entre le pouce et l\u2019index.\n>\tContinuer \xe0 tirer lentement et d\xe9licatement le pansement jusqu\u2019\xe0 son retrait en faisant attention aux fils de fixation et \xe0 ne pas tirer sur l\u2019\xe9mergence du cath\xe9ter.\n>\tRetirer les gants et r\xe9aliser une d\xe9sinfection des mains par friction avec une SHA.\n>\tEnfiler les gants st\xe9riles. \n>\tRemplir les seringues de 10 ml de NaCl \xe0 0,9% et purger les 3 valves bidirectionnelles.\n>\tR\xe9aliser la proc\xe9dure de d\xe9sinfection du site d\u2019insertion selon protocole (peau visiblement propre ou souill\xe9e).\n>\tAttendre le s\xe9chage spontan\xe9, ne pas essuyer.\n>\tRecoller le nouveau pansement : \n    \u25ab\tCentrer le tampon de gel sur le site d\u2019insertion, appuyer fermement puis appliquer le pansement du centre vers les bords et bien masser le pourtour afin de favoriser l\u2019adh\xe9rence.\n    \u25ab\tUne fois le pansement mis en place, appliquer les bandelettes adh\xe9sives st\xe9riles pour maintenir les tubulures et stabiliser le cath\xe9ter.\n>\tGarder les gants st\xe9riles pour la suite de la proc\xe9dure.\n",null,null,null,null,null,null,null,null,null)
B.b5_=new A.a("Test et branchement de la nouvelle ligne :",null,B.el,null,null,null,null,null,null,null)
B.bfh=new A.a(">\tClamper chaque voie ( sauf proximale si cat\xe9cholamines en cours ).\n>\tD\xe9visser \xe0 l\u2019aide de compresses st\xe9riles imbib\xe9es d\u2019un antiseptique alcoolique l\u2019ancienne valve bidirectionnelle se trouvant \xe0 l\u2019\xe9mergence de chaque voie et la jeter.\n>\tAdapter une seringue de 10 ml, faire un reflux ( 3 \xe0 4 ml ) et la jeter.\n>\tFaire un \xab rin\xe7age puls\xe9 \xbb de la voie.\n>\tConnecter la nouvelle valve bidirectionnelle pr\xe9alablement purg\xe9e.\n>\tConnecter la nouvelle rampe avec des compresses st\xe9riles imbib\xe9es d\u2019un antiseptique alcoolique , d\xe9clamper la voie une fois toutes manipulations effectu\xe9es.\n>\tBrancher les seringues de m\xe9dicaments pr\xe9alablement en cours et d\xe9marrer la perfusion de base.\n",null,null,null,null,null,null,null,null,null)
B.bpO=new A.a("Penser \xe0 noter la date de r\xe9fection et coller sur le pansement  la bandelette adh\xe9sive pr\xe9vue \xe0 cet effet.",null,B.el,null,null,null,null,null,null,null)
B.b7K=new A.a("Tracer dans ICCA",null,B.el,null,null,null,null,null,null,null)
B.aYu=new A.a("4.4. Surveillance et entretien",null,B.aG,null,null,null,null,null,null,null)
B.bpP=new A.a("Surveillance : (\xe0 chaque tour de constantes)\n\u25ab\tInt\xe9grit\xe9 du point de ponction ( rougeur, inflammation, \xe9coulement\u2026).\n\u25ab\tInt\xe9grit\xe9 de la peau localement (h\xe9matome, gonflement, \xe9ruption cutan\xe9 locale\u2026).\n\u25ab\tHyperthermie et/ou frissons.\n\u25ab\tBonne fixation du cath\xe9ter.\n\u25ab\tEtat du pansement.\n\u25ab\tPerm\xe9abilit\xe9 des voies.\n\nManipulation : \n>\tAvant de connecter aux robinets tout m\xe9dicament, d\xe9sinfecter pr\xe9alablement la valve bidirectionnelle avec une compresse st\xe9rile imbib\xe9e d\u2019un antiseptique alcoolique en frottant pendant 15 secondes puis laisser s\xe9cher 15 sec.\n>\tTous les robinets non utilis\xe9s doivent \xeatre ferm\xe9s afin de pr\xe9venir les risques d\u2019embolie gazeuse.\n\nEntretien des lignes de perfusion et recommandations : \n>\tChangement des lignes tous les 7 jours et au changement de cath\xe9ter.\n>\tA 7 jours : r\xe9\xe9valuer si n\xe9cessaire de garder la voie m\xe9diane. Ne pas oublier de faire un reflux, le rin\xe7age puls\xe9 et fermer en pression positive avec le clamp pour \xe9viter un reflux de sang et la formation d\u2019un thrombus ( qui majore aussi les risques infectieux. Penser \xe0  changer la valve bidirectionnelle ( pr\xe9alablement purg\xe9e ) sur les voies non utilis\xe9es.\n>\tFaire un rin\xe7age puls\xe9 des voies utilis\xe9es une fois par \xe9quipe (sauf si cat\xe9cholamines, s\xe9dations, antihypertenseurs).\n>\tLors d\u2019une transfusion : branchement sur le robinet le plus proche du cath\xe9ter de la voie distale. A la fin de la transfusion, faire un rin\xe7age puls\xe9 de la voie pour \xe9viter l\u2019occlusion et les d\xe9p\xf4ts de sang.\n>\tSi alimentation parent\xe9rale : changer la tubulure fr\xe9s\xe9nius MS10\xae ainsi que le prolongateur de 100cm avec robinet 3 voies  toutes les 24 heures avec la nouvelle poche. Penser \xe0  faire un rin\xe7age puls\xe9 de 20 ml de NaCl \xe0 0,9% avant de connecter la nouvelle tubulure.\n>\tLors de l\u2019administration de Propofol\xae : connecter la seringue avec 1 prolongateur de SAP de 200cm et brancher au robinet  pr\xe9vu \xe0 cet effet au niveau de la voie m\xe9diane. Seringue(s) et prolongateur(s) \xe0 changer toutes les 12 heures.\n>\tA l\u2019arr\xeat des cat\xe9cholamines : pr\xe9parer une seringue de NaCl \xe0 0,9% pour le rin\xe7age de la voie, \xe0 connecter sur la voie relai et d\xe9marrer \xe0 la vitesse des cat\xe9cholamines ant\xe9rieure \xe0 l\u2019arr\xeat. Monter progressivement le d\xe9bit toutes les  30 minutes sur au moins 4 heures afin de s\u2019assurer du rin\xe7age de la voie. A la d\xe9connection, retirer la valve bidirectionnelle,  faire un reflux de 3 \xe0 4 ml, un rin\xe7age puls\xe9 au NaCl \xe0 0,9% et connecter la nouvelle valve pr\xe9alablement purg\xe9e (manipulation avec gants st\xe9riles). \n\n",null,null,null,null,null,null,null,null,null)
B.bgE=new A.a("4.5. Tra\xe7abilit\xe9",null,B.aG,null,null,null,null,null,null,null)
B.aYa=new A.a(">\tNoter la date de r\xe9fection sur le pansement avec l\u2019adh\xe9sif pr\xe9vu \xe0 cet effet.\n>\tNoter sur le dossier de soins informatique ICCA la date de changement de tubulures et de pansement dans la feuille de surveillance \xe0 \xab  abord vasculaire \xbb.\n",null,null,null,null,null,null,null,null,null)
