B.bnQ=new A.a("En vni (On est en VSAI) \nAsynchronie la plus fr\xe9quente: auto declenchement et inssuflation prolong\xe9 (cyclage tardif)\nLe grand probl\xe8me les fuites \nSi fuite lors expiratoire :va croire que le patient demande : cycle \nSi lors inspiration (fuite inspiratoire) chute d\xe9bit inspiratoire entra\xeene cycle long\n=> Limiter effet des fuites\nMode vni ou vni d\xe9di\xe9\nTrigger inspiration 3l par min\nAugmenter trigger expiratoire (auto d\xe9clenchement)\nLimiter temps inssuflation \xe0 1 \xe0 2 sec (cycle long)\n\n\nPatient en VAC va d\xe9former la courbe de pression (demande inspiratoire forte entraine creusement de la courbe de pression) : si n\xe9cessit\xe9 de garder un volume protecteur : augmenter la s\xe9dation voir curariser\nPar contre si on peut tol\xe9rer un VT plus \xe9lev\xe9 car am\xe9lioration clinique => passer VSAI\n\nEn VAC : aspect concave vers le haut (curviligne) mais que tout les cycles sont control\xe9 et pas spontan\xe9e (patient passif) = Stress index>1 sinon augmentation lin\xe9aire ( aspect exponentielle) : delta de pression est plus grand en fin d\u2019inspiration que en d\xe9but (donc plus de pression pour donner le meme delta de volume : donc la compliance du syst\xe8me respiratoire a diminu\xe9 = signe de surdistension mais  epanchement pleural ou augmentation importante de la pression abdominale ( diminution du recrutement au cours de l\u2019inssuflation) : pour r\xe9gler le probleme figer les courbe et regarder a partir de quelle volume sur la courbe de volume la morphologie de la courbe de pression change :\n2 possibilit\xe9s pour regler: diminuer la pep ou diminuer le VT\n\n",null,null,null,null,null,null,null,null,null)
B.b9h=new A.a("Effort ou appel inefficace (effort g\xe2che)\n",null,null,null,null,null,null,null,null,null)
