B.br8=new A.a("3 choses visibles Paw pas n\xe9gatif, cycle court et FR \xe9lev\xe9 anormalement\nAuto d\xe9clenchement cycle plus court que les autres\nou Cycle long : cycle plus long que d'habitude\nParfois: eau dans tubulure \nSolutions: changer de masque est prioritaire (souvent fuite)\nPuis PEP minimale efficace (pour auto d\xe9clenchement) et aide minimale efficace/pep minimale (pour cycle long)\n",null,null,null,null,null,null,null,null,null)
