B.b10=new A.a("En g\xe9n\xe9ral patient fortement s\xe9dat\xe9 : la curarisation peut prevenir ce type d\u2019asynchronie pouvant aller vers double d\xe9clenchement (empilement de cycle)\n\nSe voit avec Poeso en retard par rapport \xe0 la courbe de pressions : la machine d\xe9clenche une contraction diaphragme\n\nT\xeate de dauphin en courbe de d\xe9bit cf photo\nD\xe9calage entre la machine et l'effort patient qui est en retard et il arrive toujours au m\xeame moment\nContrairement au double d\xe9clenchement le patient fait un effort intense alors que reverse souvent patient d\xe9tendu\nReverse triggering m\xeame d\xe9lai de d\xe9clenchement\n\nParfois le plateau disparait \xe0 certain cycle \xe0 cause du reverse triggering\nSerait du \xe0 un \xe9tirement thoracique ?\nPlut\xf4t patient en hypocapnie\nReverse triggering inssuflation d\xe9clenche une inspiration du patient et parfois \xe7a d\xe9clenche une double d\xe9clenchement\n",null,null,null,null,null,null,null,null,null)
