B.boP=new A.a("1.  Introduction",null,B.M,null,null,null,null,null,null,null)
B.bk5=new A.a("Teclistamab est un anticorps bisp\xe9cifique humanis\xe9 qui s\u2019attache simultan\xe9ment aux r\xe9cepteurs sur le plasmocyte (BMCA) et sur le Lymphocyte T(CD3).\nTraitement jusqu\u2019\xe0 progression de la maladie ou apparition d\u2019une toxicit\xe9 inacceptable \nLe traitement par  TECVAYLI ne doit pas \xeatre initi\xe9 chez les patients pr\xe9sentant une infection active.\nHospitalisation pendant 48 heures apr\xe8s l\u2019administration de chaque dose du sch\xe9ma d'escalade de dose de TECVAYLI.\n\nLe Service de R\xe9animation m\xe9dicale doit \xeatre pr\xe9venu la veille  du  jour  de l\u2019administration du TECVAYLI \nAttention au risque d\u2019interaction m\xe9dicamenteuse  entre les substrat du CYP450  et teclistamab  particuli\xe8rement  du J1 a J7 ou lors d\u2019un \xe9pisode de CRS.\n",null,null,null,null,null,null,null,null,null)
