B.b3y=new A.a("La pr\xe9m\xe9dication doit \xeatre administr\xe9e 1 \xe0 3 heures avant chaque dose du sch\xe9ma d'escalade de dose de TECVAYLI afin de r\xe9duire le risque de syndrome de relargage des cytokines.\n\u2022 Dexam\xe9thasone 16mg par voie orale ou intraveineuse\n\u2022 Polaramine 1 ampoule iv ou cetirizine 10 mg per os\n\u2022Parac\xe9tamol  1 000 mg par voie orale ou intraveineuse\n                          ",null,null,null,null,null,null,null,null,null)
