B.bgB=new A.a("1.\tLe Syndrome de relargage des cytokines (SRC) ",null,B.as,null,null,null,null,null,null,null)
B.b1r=new A.a("Le SRC doit \xeatre identifi\xe9 \xe0 partir de manifestations cliniques. Les signes et sympt\xf4mes cliniques du SRC sont non sp\xe9cifiques peuvent inclure, sans s\u2019y limiter, une fi\xe8vre, une hypoxie, des frissons, une hypotension, une tachycardie, une c\xe9phal\xe9e et une \xe9l\xe9vation des enzymes h\xe9patiques. Les   complications du SRC pouvant potentiellement mettre en jeu le pronostic vital peuvent inclure un dysfonctionnement cardiaque, un syndrome de d\xe9tresse respiratoire de l\u2019adulte, une toxicit\xe9 neurologique, une insuffisance r\xe9nale et/ou h\xe9patique et une coagulation intravasculaire diss\xe9min\xe9e (CIVD).\n\nLes patients doivent \xeatre \xe9valu\xe9s et trait\xe9s, en m\xeame temps, pour les autres causes de fi\xe8vre, d\u2019hypoxie et d\u2019hypotension\n\nUn bilan biologique (NFS, Ionogramme, CRP, procalcitonine, bilan h\xe9patique, TP TCA fibrinog\xe8ne, D- Dim\xe8res, schizocytes, troponine, BNP, h\xe9mocultures coupl\xe9es, ECBU) doit \xeatre fait devant toute sympt\xf4mes suspecte de SRC.\n\nL\u2019utilisation du  G-CSF est susceptible d\u2019aggraver les sympt\xf4mes du SRC et doit \xeatre \xe9vit\xe9e pendant le SRC.\n\n",null,null,null,null,null,null,null,null,null)
B.abF=new A.C("Tableau 2 : Prise en charge de SRC","assets/images/pathologies/hematologie/teclistamab/tableau2.png",null)
