B.b7S=new A.a("2.\tSyndrome de neurotoxocit\xe9 associ\xe9 aux cellules effectrices immunitaires (ICANS)",null,B.as,null,null,null,null,null,null,null)
B.b0J=new A.a("D\xe9finition : enc\xe9phalopathie toxique avec des sympt\xf4mes de c\xe9phal\xe9es l\xe9g\xe8res, de confusion et de d\xe9lire; aphasie de Broca; crises d'\xe9pilepsie occasionnelles; et rarement, \u0153d\xe8me c\xe9r\xe9bral; peut se produire en pr\xe9sence ou en l'absence de SRC syst\xe9mique. La symptomatologie clinique est h\xe9t\xe9rog\xe8ne allant de sympt\xf4mes peu graves rapidement r\xe9versibles (troubles de l\u2019attention, de l\u2019\xe9criture\u2026) \xe0 des formes plus graves avec convulsions voire \xe9tat comateux.\n\n    -\tEnvisager des m\xe9dicaments anti\xe9pileptiques non s\xe9datifs (par ex. le l\xe9v\xe9tirac\xe9tam) pour la pr\xe9vention de crises convulsives. \n\n    -\tEnvisager une consultation en neurologie et avec d\u2019autres sp\xe9cialistes pour une \xe9valuation plus approfondie, si n\xe9cessaire. \n\nAfin de d\xe9tecter rapidement toute modification une \xe9valuation avec Echelle d\u2019\xe9valuation neurologique ICE est n\xe9cessaire x2/jour , a d\xe9buter le jour de l\u2019administration du teclistamab, avant pr\xe9m\xe9dication.\n\n",null,null,null,null,null,null,null,null,null)
