B.bhw=new A.a("EP \xe0 Haut Risque d\xe9finie par un \xe9tat de choc ou une hypotension art\xe9rielle syst\xe9mique: OUI\n\nRisque interm\xe9diaire haut: Etude PEITHO => L\u2019utilisation des thrombolytiques n\u2019est donc pas recommand\xe9e de mani\xe8re syst\xe9matique chez les patients avec une EP \xe0 risque interm\xe9diaire \xe9lev\xe9, mais doit \xeatre envisag\xe9e en cas d\u2019apparition de signe de choc [3]. Ou Discuter dose plus faible de fibrinolytique.\n",null,null,null,null,null,null,null,null,null)
