B.b3o=new A.a("\xc9CHOGRAPHIE PLEUROPULMONAIRE\nL'air \xe9tant un obstacle naturel aux ultrasons, l'analyse pleuropulmonaire ne para\xeet pas logique. Toutefois, depuis une vingtaine d'ann\xe9e, de nombreuses publications montrent un int\xe9r\xeat diagnostique certain de l'\xe9chographie pleurale et de fa\xe7on surprenante, parenchymateuse [6] [12] [13] [15] [27] [28] [29] [30] [31] [83] [84] [85] [86] [87] [88] [89] [90] [91] [92] [93] [94] [95] [96] [97]. Il faut souligner que cette abondante litt\xe9rature a \xe9t\xe9 d\xe9velopp\xe9e chez des patients de r\xe9animation, par des r\xe9animateurs, faisant de l'\xe9chographie pleuropulmonaire un examen entrant de fa\xe7on naturelle dans les comp\xe9tences des r\xe9animateurs. Les travaux de Lichtenstein et al. [6] [13] [15] [27] [28] [29] [30] [83] [84] [85] [86] [87] [88] [89] [90] [91] ont particuli\xe8rement contribu\xe9 au d\xe9veloppement de cette technique. L'analyse ultrasonique du poumon est r\xe9alis\xe9e au mieux avec une sonde \xe9troite (passage intercostal), ressemblant \xe0 une sonde cardiologique, mais de fr\xe9quence sup\xe9rieure (5-7 MHz) afin de mieux pr\xe9ciser les structures superficielles, notamment pleurale [12]. En pratique, ce type de sonde n'est en g\xe9n\xe9ral pas disponible sur un appareil g\xe9n\xe9raliste ; la sonde de cardiologie dans ses fr\xe9quences les plus \xe9lev\xe9es (3-5 MHz) peut \xeatre utilis\xe9e, avec une image moins fine mais exploitable [12] [98] (figure 14). La sonde lin\xe9aire superficielle de haute fr\xe9quence (7-10 MHz) peut aussi \xeatre utilis\xe9e. Dans les exemples suivants, nous montrerons des images obtenues aves de sondes cardiologiques de basses fr\xe9quences et des sondes lin\xe9aires de haute fr\xe9quence.\n\n",null,null,B.Z,null,null,null,null,null,null)
B.aaN=new A.C("\xc9chographies pleuropulmonaires normales obtenues avec 2 sondes diff\xe9rentes (1,8 et 8 MHz) : visualisation des lignes A et O, artefacts statiques normaux de r\xe9flexion pleurale. La ligne A est de longueur \xe9gale \xe0 la ligne pleurale et \xe0 une distance double de la limite ant\xe9rieure de l'image.","assets/images/pathologies/divers/echo/15pleuropulm.gif",null)
B.bnd=new A.a("Les grands principes de l'analyse \xe9chographique pleuropulmonaire sont les suivants :\n\n- la technologie est simple, peu co\xfbteuse et n'utilise pas le Doppler ;\n\n- la s\xe9miologie pleuropulmonaire est dynamique, en mode 2D ou TM et doit analyser les diff\xe9rents quadrants thoraciques, comme pour une auscultation : la sonde est pos\xe9e sur les m\xeames zones que le st\xe9thoscope ;\n\n- cette s\xe9miologie part de la pl\xe8vre et se poursuit par l'analyse d'artefacts dont le caract\xe8re \xab parasite \xbb et non anatomique peut d\xe9router, mais qui ont une signification s\xe9miologique forte, \xe0 la fois pleurale et pulmonaire ;\n\n- la plupart des pathologies pulmonaires aigu\xebs observ\xe9es en r\xe9animation ont un contact avec la paroi et g\xe9n\xe8rent des artefacts sp\xe9cifiques analysables en \xe9chographie;\n\n- le poumon normal est invisible, le poumon pathologique est soit visible, soit analysable indirectement par l'analyse d'artefacts sp\xe9cifiques.\n\nS\xe9miologie \xe9chographique pulmonaire normale (figure 15)                          \n",null,null,B.Z,null,null,null,null,null,null)
B.aaO=new A.C("Identification de la ligne pleurale par le signe de la chauve-souris, dont le corps est repr\xe9sent\xe9 par la ligne pleurale et les ailes par les 2 c\xf4tes adjacentes. a : pl\xe8vre normale avec une sonde de 5 MHz. Identification de la ligne pleurale (fl\xe8che = \xab corps de la chauve-souris \xbb) : image hyper\xe9chog\xe8ne situ\xe9e \xe0 0,5 cm en dedans de la ligne costale, mat\xe9rialis\xe9e par le d\xe9but des c\xf4nes d'ombres (R = rib = c\xf4te = \xab ailes de la chauve-souris \xbb) des 2 c\xf4tes adjacentes [12]. L'ast\xe9risque montre une ligne b, artefact en queue de com\xe8te normal parce qu'unique. b : image pleurale normale obtenue avec une sonde de cardiologie (1,7 MHz). Fl\xe8che verticale = ligne pleurale. Fl\xe8che horizontale = c\xf4te. c : image pleurale normale obtenue avec une sonde lin\xe9aire de haute fr\xe9quence (8 MHz). Fl\xe8che verticale = ligne pleurale. Fl\xe8che horizontale = c\xf4t\xe9.","assets/images/pathologies/divers/echo/16lignepleurale.gif",null)
B.b_B=new A.a("\xc0 l'\xe9tat normal, seule la pl\xe8vre est visible en \xe9chographie. C'est \xe0 partir de l'image pleurale, de la pr\xe9sence d'artefacts normaux et de l'absence d'artefacts pathologiques que l'on affirme le caract\xe8re normal d'une \xe9chographie pleuropulmonaire. La sonde est appliqu\xe9e dans un espace intercostal de chaque zone thoracique (ant\xe9rieur, lat\xe9ral, post\xe9rieur) en recherchant en mode bidimensionnel la ligne pleurale, image lin\xe9aire hyper\xe9chog\xe8ne qui constitue l'image fondamentale en \xe9chographie pleuropulmonaire.\n\nL'image pleuropulmonaire normale associe un signe dynamique et un artefact statique (ligne A).\n\n\xb7 La ligne pleurale et le signe du glissement pleural : l'\xe9tape fondamentale d'une \xe9chographie pleuropulmonaire est la visualisation dynamique de la ligne pleurale, image linaire hyper\xe9chog\xe8ne, scintillante, se d\xe9pla\xe7ant parall\xe8lement \xe0 la sonde en suivant les mouvements respiratoires. La ligne pleurale est identifi\xe9e par son aspect lin\xe9aire hyper\xe9chog\xe8ne situ\xe9 au-del\xe0 des ombres costales. Le grand axe de la sonde \xe9tant appliqu\xe9 sur le thorax selon un axe cr\xe2nio-caudal, l'espace intercostal est visualis\xe9 \xe0 l'int\xe9rieur des 2 ombres des c\xf4tes adjacentes. La ligne pleurale appara\xeet alors en dedans (0,5 cm) des 2 ombres costales, et est interrompue par les 2 c\xf4nes d'ombres costaux, r\xe9alisant l'image (ou signe) de la chauve-souris (figure 15). L'image en chauve-souris permet de ne pas confondre la pl\xe8vre avec une autre structure. Un fois la ligne pleurale rep\xe9r\xe9e, il faut rechercher le signe du glissement pleural qui correspond au glissement respiratoire physiologique des 2 feuillets pleuraux. En mode TM, la ligne pleurale est bien visible, scintillante, mobile, sous tendue par un granit\xe9 immobile : on parle de signe du bord de mer (figure 16).\n",null,null,B.Z,null,null,null,null,null,null)
B.a9M=new A.C("Image TM pleuropulmonaire normale. Aspect en \xab bord de mer \xbb. La fl\xe8che indique la ligne pleurale.","assets/images/pathologies/divers/echo/17tmpleuropulm.gif",null)
B.aXs=new A.a("\xb7 La ligne A, artefact statique normal qui est une image de r\xe9p\xe9tition de la ligne pleurale. Il s'agit d'une image lin\xe9aire, parall\xe8le et de longueur \xe9gale \xe0 la ligne pleurale. Lorsque la ligne A est peu visible et plus courte que la ligne pleurale, on parle de ligne O dont la signification est identique (figure 14).\n\n\xb7 Chez le sujet normal, on peut visualiser une ou 2 lignes b : artefact linaire vertical en rayon de lumi\xe8re ou queue de com\xe8te part de la pl\xe8vre et va jusqu'au bas de l'image. Ces lignes b isol\xe9es (1 ou 2), ne sont pas pathologiques et sont visibles dans 30 % des cas, surtout dans les zones d\xe9clives [87]. Il faut les diff\xe9rencier des lignes B pathologiques, plus nombreuses.\n\nDiagnostic de syndrome alv\xe9olo-intersititiel (figure 17)\n",null,null,B.Z,null,null,null,null,null,null)
B.a8z=new A.C("Artefacts en queues de com\xe8tes pathologiques au cours d'un \u0153d\xe8me pulmonaire : lignes B. \xc0 gauche, sonde de 5 MHz. \xc0 droite, sonde de 1,7 MHz.","assets/images/pathologies/divers/echo/18queuescometes.gif",null)
B.b6D=new A.a("Ce syndrome est caract\xe9ris\xe9 par la pr\xe9sence d'artefacts sp\xe9cifiques appel\xe9es lignes B ou queues de com\xe8tes [87]. Les lignes B sont des artefacts hyper\xe9chog\xe8nes lin\xe9aires naissant sur la ligne pleurale et allant jusqu'au bas de l'\xe9cran. \xc0 la diff\xe9rence des lignes b, artefacts en queues de com\xe8tes isol\xe9s qui peuvent \xeatre vues chez le sujet sain, les lignes B sont nombreuses (> 2), et signent une pathologie parenchymateuse diffuse. Les lignes B multiples s\xe9par\xe9es de 7 mm (lignes B7) correspondent \xe0 des \xe9paississements des septa interlobulaires. Les lignes B3 multiples s\xe9par\xe9es de 3 mm correspondent \xe0 un \u0153d\xe8me alv\xe9olaire bien corr\xe9l\xe9 \xe0 l'aspect scanographique en verre d\xe9poli [12]. Ces r\xe9sultats ont une application clinique simple dans le diagnostic \xe9tiologique des dyspn\xe9es. Dans un travail portant sur 66 patients admis aux urgences pour d\xe9tresse respiratoire aigu\xeb, 40/40 patients en \u0153d\xe8me aigu pulmonaire pr\xe9sentaient des lignes B alors que 24 sur 26 patients pr\xe9sentant une d\xe9compensation pure de BPCO ne pr\xe9sentaient pas de lignes B [6]. Dans cette \xe9tude, 80 patients t\xe9moins (absence de symptomatologie pulmonaire clinique ou radiologique) ne pr\xe9sentaient aucune ligne B.\n\nDiagnostic et quantification d'un d'\xe9panchement pleural liquidien (figure 18)",null,null,B.Z,null,null,null,null,null,null)
B.a8V=new A.C("Diagnostic et quantification des \xe9panchements pleuraux liquidiens. a : coupe longitudinale l'axe de la sonde a une orientation cranio-caudale sur la ligne m\xe9dio-axillaire. La fl\xe8che repr\xe9sente la distance interpleurale. Le poumon est bien visible, signant un \xe9panchement compressif. b : coupe transversale, m\xeame patient. L'axe de la sonde est perpendiculaire \xe0 la ligne m\xe9dio-axillaire. La fl\xe8che repr\xe9sente la distance interpleurale, ici 70 mm. Volume drain\xe9 = 1 500 mL. D = diaphragme ; P = poumon.","assets/images/pathologies/divers/echo/19epanchementpleural.gif",null)
B.bjP=new A.a("L'\xe9panchement pleural liquidien appara\xeet comme une image hypo\xe9chog\xe8ne et homog\xe8ne visible en inspiration et en expiration d\xe9limit\xe9 en dehors par la paroi thoracique (ligne costale) et en bas par le diaphragme. La sonde est plac\xe9e sur la ligne m\xe9dio-axillaire, puis plus post\xe9rieure si aucun \xe9panchement n'est vu. La visualisation du cul-de-sac pleural identifi\xe9 par l'image caract\xe9ristique du diaphragme (ligne hyper\xe9chog\xe8ne en arc de cercle) facilite cette exploration (figure 18). Lorsque l'\xe9panchement est suffisamment important pour entra\xeener un collapsus pulmonaire, le poumon est visible et flotte dans l'\xe9panchement : signe du poumon flottant. Le diagnostic d'\xe9panchement pleural est facile [99] et explique l'engouement pour la technique pour le guidage du drainage pleural [13] [31]. L'\xe9chographie permet enfin de quantifier selon un mode semi-quantitatif les \xe9panchements pleuraux liquidiens [11] [40] [100] [101]. La quantification est r\xe9alis\xe9e \xe0 partir de la mesure du d\xe9collement pulmonaire post\xe9rieur appel\xe9e distance interpleurale. Dans le travail princeps d'Eibenberger et al. [100], une distance interpleurale maximale de 20 mm est corr\xe9l\xe9e \xe0 un volume d'\xe9panchement de 380 \xb1 130 mL et une distance interpleurale de 40 mm est corr\xe9l\xe9e \xe0 un volume de 1 000 \xb1 330 mL. Dans cette \xe9tude, l'\xe9chographie est sup\xe9rieure \xe0 la radiographie pour pr\xe9dire le volume d'\xe9panchement, avec une erreur moyenne de 224 mL pour l'\xe9chographie contre 465 mL pour la radiographie (p < 0,02). Deux \xe9tudes plus r\xe9centes se sont int\xe9ress\xe9es \xe0 une approche semi-quantitative. Lorsque le distance interpleurale maximale (d\xe9collement maximal apr\xe8s \xe9tude de tous les \xe9tages pulmonaires) est sup\xe9rieure \xe0 45 mm \xe0 droite et 50 mm \xe0 gauche, le volume de l'\xe9panchement est sup\xe9rieur \xe0 800 mL avec une sensibilit\xe9 de 94 et 100 % et une sp\xe9cificit\xe9 de 76 et 67 %, respectivement [11]. Une distance interpleurale basale de 50 mm permet d'affirmer que le volume de l'\xe9panchement est sup\xe9rieur \xe0 500 mL avec une sensibilit\xe9 et une sp\xe9cificit\xe9 de 83 et 90 % quel que soit le c\xf4t\xe9 [14]. Dans ces deux \xe9tudes, la pr\xe9diction du volume d'\xe9panchement pour des volumes < 500 mL ou > 1 000 mL est m\xe9diocre, et moins bonne \xe0 gauche qu'\xe0 droite en raison du volume cardiaque.\n\nDiagnostic de pneumothorax (figure 19)\n",null,null,B.Z,null,null,null,null,null,null)
B.a95=new A.C("Diagnostic \xe9chographique de pneumothorax. a : aspect normal, signe du bord de mer. b : pneumothorax complet. Disparition du signe du bord de mer, lignes A exclusives. c : pneumothorax partiel. Point poumon : alternance respiratoire du signe du bord de mer et de lignes A exclusives.","assets/images/pathologies/divers/echo/20diagpneumothorax.gif",null)
B.aYw=new A.a("Au contraire de l'\xe9panchement liquidien, le diagnostic \xe9chographique de pneumothorax est difficile et demande une formation plus longue [12]. Il est en revanche assez facile d'\xe9liminer un pneumothorax. L'int\xe9r\xeat de l'\xe9chographie r\xe9side surtout dans sa capacit\xe9 \xe0 diagnostiquer les pneumothorax pass\xe9s inaper\xe7us radiologiquement, particuli\xe8rement en traumatologie [30] [85] [95] [97] [98].\n\n\xc9limination du diagnostic de pneumothorax\nLe diagnostic de pneumothorax peut \xeatre \xe9limin\xe9 lorsque le signe du glissement pleural est pr\xe9sent dans les zones ant\xe9rieures sur un patient en d\xe9cubitus dorsal [30] [91]. De la m\xeame fa\xe7on, la pr\xe9sence de queues de com\xe8tes (ligne b) permet d'\xe9liminer le diagnostic [27] [30].\n\nDiagnostic positif de pneumothorax complet\nLe diagnostic de pneumothorax complet est affirm\xe9 lorsque le signe du glissement pleural est absent dans tous les quadrants pulmonaires, affirmation difficile sans une certaine exp\xe9rience. En mode TM, le signe du bord de mer dispara\xeet et ne sont visibles que les lignes A.\n\nDiagnostic de pneumothorax partiel\nEn cas de pneumothorax partiel, la reconnaissance du \xab point poumon \xbb [30] [86] est d\xe9terminante. Le point poumon correspond, dans un pneumothorax partiel, \xe0 la zone o\xf9 le poumon s'accole en expiration et se d\xe9colle en inspiration. Ce point poumon est donc en g\xe9n\xe9ral en zone ant\xe9rieure ou lat\xe9rale. Le point poumon est visualis\xe9 comme une ligne pleurale qui contient une zone avec un glissement pleural (poumon accol\xe9) et une zone sans glissement (poumon d\xe9coll\xe9) ; la jonction entre ces 2 zones est le point poumon. Cette notion est beaucoup plus facile \xe0 comprendre sur une image vid\xe9o. En mode TM, le point poumon correspond \xe0 l'alternance, avec la respiration, du signe du bord de mer avec des lignes A exclusives (figure 19).\n\nDiagnostic de consolidation pulmonaire (figure 20)\n",null,null,B.Z,null,null,null,null,null,null)
B.a9d=new A.C("Consolidation pulmonaire. Image de gauche : at\xe9lectasie gauche au sein d'un \xe9panchement pleural massif. Image de droite : at\xe9lectasie basale gauche sans \xe9panchement. Noter le bronchogramme a\xe9rique qui appara\xeet comme des images hyper\xe9chog\xe8nes (fl\xe8ches). D = diaphragme. P = poumon. R = rate.","assets/images/pathologies/divers/echo/21consolidationpulm.gif",null)
B.b5d=new A.a("Un \u0153d\xe8me pulmonaire majeur, une pneumopathie franche lobaire aigu\xeb, une contusion pulmonaire ou une at\xe9lectasie entra\xeenent une perte d'a\xe9ration pulmonaire, qui limite l'\xe9cran gazeux ultrasonique et rend le parenchyme pulmonaire visible en \xe9chographie. Celui-ci ressemble alors au parenchyme h\xe9patique (\xab h\xe9patisation pulmonaire \xbb) sous forme d'un aspect hypo\xe9chog\xe8ne, au sein duquel sont visibles des images punctiformes ou lin\xe9aires hyper\xe9chog\xe8nes correspondant \xe0 un bronchogramme a\xe9rique. Ce dernier se renforce (accentuation de l'hyper\xe9chogenicit\xe9) en inspiration.\n",null,null,B.Z,null,null,null,null,null,null)
