B.bat=new A.a("\u2022\tUne canule de trach\xe9otomie fen\xeatr\xe9e \xe0 basse pression\n\u2022\tUn \xe9carteur de Laborde\n\u2022\tUn pansement de trach\xe9otomie (M\xe9talline\xae)\n\u2022\tUn cordon de fixation\n\u2022\tUn champ transparent fen\xeatr\xe9\n\u2022\tUn grand champ vert\n\u2022\tUne casaque st\xe9rile et une paire de gants st\xe9riles pour celui qui r\xe9alise le geste\n\u2022\tUne charlotte, un masque chirurgical et une surblouse pour toute personne pr\xe9sente dans la chambre\n\u2022\tUne seringue de 10 ml\n\u2022\tUn flacon de 500 ml d\u2019eau st\xe9rile\n\u2022\tUn flacon de 250 ml de NaCl \xe0 0,9%\n\u2022\tUn bistouri\n\u2022\tUn fil\n\u2022\tDes compresses st\xe9riles\n\u2022\tUn set d\u2019asepsie cutan\xe9\n\u2022\tUn syst\xe8me clos pour trach\xe9otomie\n\u2022\tUn billot\n\u2022\tLe mat\xe9riel et le chariot de fibroscopie (cf. proc\xe9dure)\n",null,null,null,null,null,null,null,null,null)
B.b4p=new A.a("\t\t2)\tD\xe9roulement du soin",null,B.aG,null,null,null,null,null,null,null)
B.b44=new A.a("a.\tAvant",null,B.as,null,null,null,null,null,null,null)
B.b_k=new A.a("\u2022\tPr\xe9venir le patient et sa famille et leur demander leur accord.\n\u2022\tV\xe9rifier le bilan d\u2019h\xe9mostase du patient.\n\u2022\tS\u2019il y a un traitement anticoagulant, sur prescription m\xe9dicale le modifier ou l\u2019arr\xeater.\n\u2022\tLe patient doit \xeatre \xe0 jeun \xe0 minuit la veille du geste sur prescription m\xe9dicale.\n\u2022\tL\u2019IDE v\xe9rifie la perm\xe9abilit\xe9 des voies veineuses centrales ou p\xe9riph\xe9riques.\n\u2022\tL\u2019IDE s\u2019assure que le mat\xe9riel d\u2019intubation est op\xe9rationnel et que le syst\xe8me d\u2019aspiration est fonctionnel.\n\u2022\tUn soin de bouche doit \xeatre r\xe9alis\xe9 apr\xe8s une friction d\u2019une SHA.\n",null,null,null,null,null,null,null,null,null)
B.b1j=new A.a("b.\tPendant",null,B.as,null,null,null,null,null,null,null)
B.b7O=new A.a("\u2022\tPr\xe9sence de deux m\xe9decins : un pour r\xe9aliser la trach\xe9otomie percutan\xe9e et le deuxi\xe8me pour g\xe9rer le fibroscope, la sonde d\u2019intubation et la ventilation.\n\u2022\tMettre une charlotte, un masque chirurgical et une surblouse. \n\u2022\tSur prescription m\xe9dicale, le patient doit \xeatre s\xe9dat\xe9 et curaris\xe9 afin d\u2019\xe9viter tous mouvements.\n\u2022\tLe patient est mis en d\xe9cubitus dorsal avec la nuque en hyperextension en pla\xe7ant un billot sous les \xe9paules.\n\u2022\tR\xe9gler le respirateur en mode ventilation contr\xf4l\xe9e et \xe0 100% de Fio2 pour assurer une oxyg\xe9nation parfaite (augmentation des seuils des alarmes de pression et de volume).\n\u2022\tL\u2019IDE r\xe9alise une friction d\u2019une SHA et effectuer une d\xe9sinfection du site de ponction : nettoyage au savon doux en unidose st\xe9rile, puis rin\xe7age au NaCl 0,9%, essuyage aux compresses st\xe9riles puis antisepsie \xe0 la Chlorhexidine\xae alcoolique 2% type Bactiseptic\xae/Gilbert\xae color\xe9.\n\u2022\tL\u2019IDE installe la table de l\u2019op\xe9rateur, d\xe9contamin\xe9 au pr\xe9alable et donne le mat\xe9riel au m\xe9decin.\n\u2022\tLe m\xe9decin qui fait le geste r\xe9alise une friction d\u2019une SHA, met une casaque et des gants st\xe9riles et pr\xe9pare son mat\xe9riel sur le champ st\xe9rile : ouvre le kit percutan\xe9 et v\xe9rifie le ballonnet de la canule de trach\xe9otomie. Il appose un champ st\xe9rile fen\xeatr\xe9 sur l\u2019orifice de ponction et un deuxi\xe8me champ sur le patient. Il r\xe9alise une deuxi\xe8me d\xe9sinfection du site de ponction \xe0 la Chlorhexidine\xae alcoolique 2% type Bactiseptic\xae/Gilbert\xae color\xe9.\n\u2022\tLe deuxi\xe8me m\xe9decin se positionne \xe0 la t\xeate du patient avec le chariot de fibroscopie. Il tire la SIOT sous contr\xf4le fibroscopique en pla\xe7ant le ballonnet sous les cordes vocales permettant ainsi de ventiler le patient sans g\xeaner la ponction trach\xe9ale.\n\u2022\tLe rep\xe9rage du site de ponction est r\xe9alis\xe9 par palpation (entre le 2\xe8me et 3\xe8me anneau trach\xe9al ou \xe0 1 cm sous le cartilage crico\xefde) mais \xe9galement par transillumination avec le fibroscope.\n\u2022\tUne fois que le rep\xe9rage est fait, la ponction trach\xe9ale est faite \xe0 l\u2019aide de l\u2019aiguille mont\xe9e sur une seringue remplie de NaCl \xe0 0,9%. Un reflux d\u2019air dans la seringue montre le bon positionnement de l\u2019aiguille qui est \xe9galement confirm\xe9 par le fibroscope.\n\u2022\tAu travers de l\u2019aiguille, introduire le guide m\xe9tallique dans la trach\xe9e en direction de la car\xe8ne, puis retirer l\u2019aiguille. Puis, l\u2019orifice sera \xe9largi \xe0 l\u2019aide de plusieurs dilatateurs (en forme de corne de rhinoc\xe9ros).\n\u2022\tUne fois l\u2019orifice dilat\xe9, la canule de trach\xe9otomie est mise en place et fix\xe9 par un fils \xe0 la peau. \n\u2022\tMettre le fibroscope dans la canule de trach\xe9otomie pour v\xe9rifier le bon positionnement et l\u2019absence d\u2019h\xe9morragie importante.\n\u2022\tLa SIOT est retir\xe9e compl\xe8tement. Il faut mettre en place le syst\xe8me clos pour trach\xe9otomie et rebrancher le patient sur le respirateur.\n\u2022\tAu cours du soin : surveiller les param\xe8tres respiratoires et l\u2019\xe9tat clinique du patient. \n",null,null,null,null,null,null,null,null,null)
B.b6L=new A.a("c.\tApr\xe8s",null,B.as,null,null,null,null,null,null,null)
B.b4a=new A.a("\u2022\tMettre en place le cordon et s\u2019assurer que la canule est bien fix\xe9e.\n\u2022\tV\xe9rifier la pression du ballonnet \xe0 l\u2019aide du manom\xe8tre.\n\u2022\tAspirer avec le fibroscope les s\xe9cr\xe9tions.\n\u2022\tR\xe9installer le patient.\n\u2022\tFaire une radiographie thoracique.\n\u2022\tTracer dans ICCA le geste et retranscrire les param\xe8tres du patient.\n\u2022\tD\xe8s que possible, remettre les param\xe8tres ventilatoires du patient avant le geste (mode ventilatoire, Fio2 et alarmes).\n\u2022\tSurveillance de l\u2019orifice de la trach\xe9otomie : signaler tout changement au m\xe9decin.\n\u2022\tSurveillance de l\u2019\xe9tat respiratoire du patient trach\xe9otomis\xe9 : saturation, fr\xe9quence respiratoire, type de respiration.\n",null,null,null,null,null,null,null,null,null)
B.b5m=new A.a("d.\tMat\xe9riel de s\xe9curit\xe9 pour patient trach\xe9otomis\xe9",null,B.as,null,null,null,null,null,null,null)
B.b8m=new A.a("Dans la chambre du patient, il est n\xe9cessaire de mettre en place le mat\xe9riel de s\xe9curit\xe9 du patient et il doit \xeatre v\xe9rifier \xe0 chaque prise de poste.\n\u2022\tUn manom\xe8tre\n\u2022\tUn \xe9carteur de Laborde (pince 3 branches)\n\u2022\tUne 2\xe8me canule de rechange de m\xeame taille\n\u2022\tDes sondes d\u2019aspiration taille 12 ou 14\n\u2022\tUn cordon de fixation\n\u2022\tUn pansement de type M\xe9talline\xae\n\u2022\tUn goupillon pour nettoyer la chemise interne\n",null,null,null,null,null,null,null,null,null)
B.a8l=new A.C("\xe9carteur de Laborde","assets/images/pathologies/respiratoire/prototrach/laborde.png",null)
B.Qs=new A.N(B.m,null,null,B.a8l,null)
B.bo8=new A.a("8.\tLes soins du patient trach\xe9otomis\xe9",null,B.M,null,null,null,null,null,null,null)
B.bpy=new A.a("\t\t1)\tPr\xe9requis",null,B.aG,null,null,null,null,null,null,null)
B.b3H=new A.a("\u2022\tR\xe9fection du pansement 2 fois par jour pendant 4 jours :\n    -au NaCl 0,9% pour la trach\xe9otomie percutan\xe9e\n    -avec un 4 temps \xe0 la B\xe9tadine\xae (ou scrub si allergie) pour la trach\xe9otomie chirurgicale.\n\u2022\tChangement du cordon de fixation une fois par jour (ou plus si mat\xe9riel souill\xe9).\n\u2022\tNettoyage de la chemise interne une fois par \xe9quipe (ou plus en fonction des s\xe9cr\xe9tions du patient). \n\u2022\tAblation des fils au bout de 3 jours.\n",null,null,null,null,null,null,null,null,null)
B.blZ=new A.a("\t\t2)\tR\xe9fection du pansement de trach\xe9otomie",null,B.aG,null,null,null,null,null,null,null)
B.b8h=new A.a("\u2022\tPr\xe9venir le patient du soin effectu\xe9.\n\u2022\tInstaller le patient en position demi assise\n\u2022\tPr\xe9voir son mat\xe9riel pour le soin : \n    -Un set de pansement st\xe9rile\n    -Selon le type de trach\xe9otomie r\xe9alis\xe9e une d\xe9sinfection \xe0 la gamme b\xe9tadine\xae (scrub et dermique) ou au NaCl 0,9% seulement\n    -Un pansement type M\xe9talline\xae\n    -Un cordon de fixation\n    -Une paire de gant\n    -Un masque chirurgical\n    -Une charlotte\n    -Une surblouse\n",null,null,null,null,null,null,null,null,null)
B.a94=new A.C("Cordon","assets/images/pathologies/respiratoire/prototrach/cordon.jpg",null)
B.QZ=new A.N(B.m,null,null,B.a94,null)
