B.bja=new A.a("\u2022\tNettoyer son adaptable pour poser le mat\xe9riel. \n\u2022\tR\xe9aliser une friction d\u2019une SHA ou un lavage de mains.  \n\u2022\tOuvrir le set \xe0 pansement st\xe9rile : prendre le champ vert st\xe9rile, le d\xe9poser sur l\u2019adaptable et mettre dessus tout le mat\xe9riel (pinces, compresses). \n\u2022\tOuvrir le pansement et le cordon de fixation \xe0 c\xf4t\xe9 du champ st\xe9rile. \n\u2022\tPr\xe9parer l\u2019antiseptique ou le NaCl \xe0 0,9% dans les cases du set \xe0 pansement. \n\u2022\tFaire une friction d\u2019une SHA et mettre ses gants. \n\u2022\tV\xe9rifier le ballonnet de la trach\xe9otomie avec le manom\xe8tre et r\xe9aliser une aspiration trach\xe9ale.\n\u2022\tRetirer le pansement souill\xe9. \n\u2022\tJeter ses gants, r\xe9aliser une friction d\u2019une SHA et mettre une nouvelle paire de gants. \n\u2022\tChoisir la pince patient et la pince propre se trouvant dans le set \xe0 pansement st\xe9rile. \n\u2022\tAvec la pince propre, pr\xe9parer ses compresses et avec la pince patient r\xe9aliser la r\xe9fection. \n\u2022\tFaire la r\xe9fection en fonction de la trach\xe9otomie : \n    =>si trach\xe9otomie percutan\xe9e nettoyer l\u2019orifice au NaCl 0,9% uniquement puis s\xe9cher.\n    =>si trach\xe9otomie chirurgicale nettoyer l\u2019orifice \xe0 la b\xe9tadine\xae scrub, puis rin\xe7age au NaCl 0,9%, essuyage aux compresses st\xe9riles puis antisepsie \xe0 la b\xe9tadine\xae dermique. \n\u2022\tChanger le cordon de fixation.\n\u2022\tMettre le pansement de type M\xe9talline\xae propre.\n\u2022\tR\xe9ajuster le cordon de fixation et s\u2019assurer que le patient est confortable. \n\u2022\tNettoyage de la chemise interne.\n\u2022\tSi besoin, r\xe9aliser une aspiration trach\xe9ale et buccale. \n\u2022\tPendant et apr\xe8s le soin : surveiller les param\xe8tres respiratoires du patient et son \xe9tat clinique. \n\u2022\tJeter le mat\xe9riel souill\xe9 dans le sac d\u2019\xe9limination des d\xe9chets. \n\u2022\tFaire une friction au SHA ou un lavage de mains.\n\u2022\tTracer son soin dans ICCA. \n\n",null,null,null,null,null,null,null,null,null)
B.bkE=new A.a("\t\t3)\tNettoyage de la chemise interne",null,B.aG,null,null,null,null,null,null,null)
B.bih=new A.a("\u2022\tPr\xe9venir le patient du soin effectu\xe9. \n\u2022\tPr\xe9voir son mat\xe9riel : \n    -Une cupule\n    -Un goupillon\n    -Des compresses st\xe9riles\n    -Un flacon versable d\u2019eau st\xe9rile\n    -Une valve de phonation ou un nez artificiel si patient non ventil\xe9\n    -Une paire de gants\n    -Un masque chirurgical\n    -Une surblouse\n    -Une charlotte\n\u2022\tR\xe9aliser une friction d\u2019une SHA.\n\u2022\tVerser l\u2019eau st\xe9rile dans la cupule, ouvrir les compresses st\xe9riles et le goupillon. \n\u2022\tInstaller le patient en position demi assise.\n\u2022\tV\xe9rifier le ballonnet avec le manom\xe8tre pour une canule \xe0 ballonnet basse pression et r\xe9aliser une aspiration trach\xe9ale.\n\u2022\tD\xe9brancher le patient du respirateur (si patient ventil\xe9) ou retirer la valve de phonation ou le nez artificiel. \n\u2022\tRetirer la chemise interne et la plonger dans la cupule d\u2019eau st\xe9rile. \n\u2022\tNettoyer l\u2019ext\xe9rieur de la chemise avec des compresses et l\u2019int\xe9rieur avec un goupillon. \n\u2022\tS\xe9cher avec des compresses et r\xe9introduire la chemise interne dans la canule. \n\u2022\tRebrancher le patient au respirateur (si patient ventil\xe9) ou \xe0 l\u2019oxyg\xe8ne en changeant la valve de phonation ou le nez artificiel.\n\u2022\tPendant et apr\xe8s le soin : surveiller les param\xe8tres respiratoires et l\u2019\xe9tat clinique du patient. \n\u2022\tJeter le mat\xe9riel souill\xe9 dans le sac d\u2019\xe9limination des d\xe9chets. \n\u2022\tFaire une friction au SHA ou un lavage de mains.\n\u2022\tTracer le soin sur ICCA. \n \nSi le patient ventill\xe9 ne supporte pas le d\xe9branchement du respirateur :\n\u2022\tPr\xe9voir une deuxi\xe8me chemise interne.\n\u2022\tD\xe9brancher le patient du respirateur.\n\u2022\tRetirer la chemise interne sale et la plonger dans la cupule d\u2019eau st\xe9rile.\n\u2022\tIntroduire la 2\xe8me qui est propre et rebrancher le patient au respirateur.\n\u2022\tNettoyer la chemise fen\xeatr\xe9e et la garder en chambre pour le prochain changement.\n",null,null,null,null,null,null,null,null,null)
B.b6t=new A.a("9.\tCanules de trach\xe9otomie",null,B.M,null,null,null,null,null,null,null)
B.bjK=new A.a("\t\t1)\tTypes de canules",null,B.aG,null,null,null,null,null,null,null)
B.bl4=new A.a("\u2022\tCanule fen\xeatr\xe9e \xe0 basse pression (ballonnet \xe0 air) avec des chemise internes qui permettent d\u2019\xe9viter l\u2019encrassement de la canule:\n    -Chemise interne non fen\xeatr\xe9e pour patient ventil\xe9\n    -Chemise interne fen\xeatr\xe9e pour patient d\xe9ventil\xe9 \nAttention lors de l\u2019aspiration trach\xe9ale avec la canule fen\xeatr\xe9e de ne pas cr\xe9er de l\xe9sions endotrach\xe9ales\n",null,null,null,null,null,null,null,null,null)
B.aaH=new A.C("Canule fen\xeatr\xe9e \xe0 basse pression ","assets/images/pathologies/respiratoire/prototrach/canulefenetre.png",null)
B.QU=new A.N(B.m,null,null,B.aaH,null)
B.b4S=new A.a("\u2022\tCanule haute pression (ballonnet \xe0 eau) de type Bivona\xae. Lors de s\xe9ance de VS Trach, la canule permet de faciliter le sevrage ventilatoire en ayant plus d\u2019espace autour de celle-ci avec un ballonnet plaqu\xe9.\n",null,null,null,null,null,null,null,null,null)
B.a9W=new A.C("Canule haute pression (ballonnet \xe0 eau) de type Bivona\xae","assets/images/pathologies/respiratoire/prototrach/bivona.png",null)
B.Pm=new A.N(B.m,null,null,B.a9W,null)
B.b8o=new A.a("\t\t2)\tChangement de canule de trach\xe9otomie",null,B.aG,null,null,null,null,null,null,null)
B.bkc=new A.a("Selon le type de trach\xe9otomie, la canule est chang\xe9e \xe0 :\n\u2022\tA partir de 4 jours pour la trach\xe9otomie chirurgicale\n\u2022\tA partir de 10 jours pour la trach\xe9otomie percutan\xe9e \nLe premier changement est r\xe9alis\xe9 par le r\xe9animateur et l\u2019IDE du secteur.\nLes changements ult\xe9rieurs de la canule sont \xe0 r\xe9aliser au plus tard \xe0 30 jours.\nUne canule \xe0 haute pression type Bivona\xae sera mis en place d\xe8s que le patient est d\xe9ventil\xe9 au moins 6 heures par jour.\n",null,null,null,null,null,null,null,null,null)
B.b6K=new A.a("10.\t Le sevrage ventilatoire",null,B.M,null,null,null,null,null,null,null)
B.bb7=new A.a("\t\t1)\tPremi\xe8re s\xe9ance de d\xe9ventilation (VS trach)",null,B.aG,null,null,null,null,null,null,null)
B.bcl=new A.a("\u2022\tSur prescription m\xe9dicale et en pr\xe9sence du r\xe9animateur.\n\u2022\tLe patient doit \xeatre en ventilation spontan\xe9e (mode VSAI) avec une Fio2 inf\xe9rieure ou \xe9gale \xe0 50%.\n\u2022\tPr\xe9venir le patient du soin effectu\xe9.\n\u2022\tIl doit \xeatre install\xe9 en position demi assise.\n\u2022\tSur le scope, r\xe9gler la fr\xe9quence respiratoire afin de pouvoir surveiller le patient durant la s\xe9ance.\n\u2022\tPr\xe9parer le nez artificiel connect\xe9 \xe0 l\u2019oxyg\xe8ne.\n\u2022\tFaire une friction au SHA ou un lavage de mains et mettre des gants.\n\u2022\tR\xe9aliser une aspiration trach\xe9ale si encombrement bronchique.\n\u2022\tD\xe9brancher le syst\xe8me clos du patient, connecter le nez artificiel en ayant au pr\xe9alable r\xe9gl\xe9 le d\xe9bit d\u2019oxyg\xe8ne en fonction de la prescription m\xe9dicale et mettre en veille le respirateur.\n",null,null,null,null,null,null,null,null,null)
B.a9A=new A.C("Nez artificiel avec port d\u2019oxyg\xe8ne","assets/images/pathologies/respiratoire/prototrach/nezartificiel.jpg",null)
B.Qy=new A.N(B.m,null,null,B.a9A,null)
B.a8G=new A.C("Valve phonatoire","assets/images/pathologies/respiratoire/prototrach/valvephonatoire.jpg",null)
B.Pp=new A.N(B.m,null,null,B.a8G,null)
B.bkX=new A.a("\u2022\tRetirer ses gants et faire une friction au SHA ou un lavage de mains.\n\u2022\tLe ballonnet de la canule de trach\xe9otomie reste gonfl\xe9.\n\u2022\tIl faut d\xe9buter le sevrage sur une courte dur\xe9e, entre 1 \xe0 2 heures.\n\u2022\tEffectuer une surveillance clinique du patient et contr\xf4ler les param\xe8tres ventilatoires (saturation et fr\xe9quence respiratoire).\n\u2022\tTracer dans ICCA la dur\xe9e de la s\xe9ance de sevrage ventilatoire.\n\u2022\tAlerter le m\xe9decin s\u2019il y a une mauvaise tol\xe9rance du patient et le reventiler si d\xe9saturation.\n",null,null,null,null,null,null,null,null,null)
B.aXl=new A.a("\t\t2)\tS\xe9ances suivantes",null,B.aG,null,null,null,null,null,null,null)
B.bfN=new A.a("\u2022\tD\xe9ventilation sur prescription m\xe9dicale.\n\u2022\tAugmenter progressivement la dur\xe9e de d\xe9ventilation du patient en fonction de sa tol\xe9rance.\n\u2022\tD\xe9gonfler le ballonnet de la canule de trach\xe9otomie, si canule basse pression mettre la chemise fen\xeatr\xe9e.\n\u2022\tMise en place de la valve phonatoire ballonnet d\xe9gonfl\xe9 afin de r\xe9\xe9duquer le larynx et le patient pourra communiquer avec ses proches et les soignants, si \xe9chec remettre le nez artificiel.\n",null,null,null,null,null,null,null,null,null)
B.aal=new A.C("Cheminement des flux par la valve de phonation ballonnet d\xe9gonfl\xe9","assets/images/pathologies/respiratoire/prototrach/fluxvalvephonatoire.png",null)
B.Qc=new A.N(B.m,null,null,B.aal,null)
B.aYR=new A.a("\u2022\tFaire des s\xe9ances courtes au d\xe9part et plusieurs fois par jour.\n\u2022\tProgressivement aller vers une d\xe9ventilation diurne puis si bonne tol\xe9rance passer \xe0 la d\xe9ventilation nocturne en rempla\xe7ant la valve de phonation par le nez artificiel.\nSi le patient n\xe9cessite une VNI nocturne apr\xe8s la d\xe9canulation ne pas chercher \xe0 le d\xe9ventiler la nuit.\n\u2022\tSi d\xe9ventilation 24h/24, essayer de mettre en place le bouchon sur la canule de trach\xe9otomie et brancher les lunettes d\u2019oxyg\xe8ne si n\xe9cessaire.\n",null,null,null,null,null,null,null,null,null)
B.b53=new A.a("11.\tLa d\xe9canulation",null,B.M,null,null,null,null,null,null,null)
B.bbO=new A.a("\t\t1)\tConditions",null,B.aG,null,null,null,null,null,null,null)
B.boh=new A.a("La d\xe9canulation du patient se fait sur prescription m\xe9dicale et en pr\xe9sence du m\xe9decin.\nLe patient doit avoir les crit\xe8res requis :\n\u2022\tD\xe9ventilation 24h/24 avec bouchon depuis au plus de 48h (ou diurne si indication \xe0 une VNI nocturne).\n\u2022\tUne toux efficace afin de d\xe9gager les s\xe9cr\xe9tions bronchiques.\n\u2022\tPas de troubles de la d\xe9glutition majeure.\n",null,null,null,null,null,null,null,null,null)
B.aXr=new A.a("\t\t2)\tD\xe9roulement",null,B.aG,null,null,null,null,null,null,null)
B.bbg=new A.a("\u2022\tSur prescription m\xe9dicale.\n\u2022\tPr\xe9venir le patient du soin effectu\xe9.\n\u2022\tIl doit \xeatre install\xe9 en position demi assise.\n\u2022\tPr\xe9parer le mat\xe9riel : surblouse, masque, gants, compresses, NaCl 0,9% et petit pansement sec type Mepore\xae.\n\u2022\tFaire une friction au SHA ou un lavage de mains \n\u2022\tMettre la surblouse, le masque et les gants\n\u2022\tD\xe9tacher le cordon de fixation de la trach\xe9otomie\n\u2022\tRetirer la canule\n\u2022\tNettoyer si n\xe9cessaire l\u2019orifice de la trach\xe9otomie au NaCl 0,9%\n\u2022\tMettre en place sur l\u2019orifice de trach\xe9otomie le pansement sec type Mepore\xae. Celui-ci sera refait une fois par jour jusqu\u2019\xe0 fermeture compl\xe8te de l\u2019orifice.\n\u2022\tL\u2019orifice de trach\xe9otomie se referme seul sur plusieurs jours.\n\u2022\tSurveiller les param\xe8tres respiratoires du patient et son \xe9tat clinique. \n\u2022\tJeter le mat\xe9riel souill\xe9 dans le sac d\u2019\xe9limination des d\xe9chets. \n\u2022\tFaire une friction au SHA ou un lavage de mains.\n\u2022\tTracer le soin dans ICCA.\n",null,null,null,null,null,null,null,null,null)
B.bbp=new A.a("12.\tLes troubles de la d\xe9glutition",null,B.M,null,null,null,null,null,null,null)
B.bgK=new A.a("La mise en place des dispositifs invasifs lors de la ventilation (sonde d'intubation, canule de trach\xe9otomie, sonde nasogastrique) ont un impact sur la d\xe9glutition du patient.\n",null,null,null,null,null,null,null,null,null)
B.bii=new A.a("\t\t1)\tCauses",null,B.aG,null,null,null,null,null,null,null)
B.bkM=new A.a("\u2022\tAtrophie des muscles de la langue\n\u2022\tRetard du d\xe9clenchement du r\xe9flexe de d\xe9glutition\n\u2022\tAbsence de fermeture des cordes vocales\n\u2022\tD\xe9faut de fermeture glottique  \n\u2022\tInflammation locale \n\u2022\t\u0152d\xe8me laryng\xe9\n\u2022\tL\xe9sion de nerf r\xe9current \n\u2022\tAbsence de r\xe9flexe de toux \n\u2022\tFausses routes silencieuses\n\u2022\tPerte de sensibilit\xe9 du larynx et pharynx et la d\xe9saff\xe9rentation (suppression des aff\xe9rences, c\u2019est-\xe0-dire absence des connexions entre deux structures nerveuses)\n\u2022\tSonde nasogastrique type Salem\xae utilis\xe9e pour l\u2019alimentation ent\xe9rale\n",null,null,null,null,null,null,null,null,null)
B.b0W=new A.a("\t\t2)\tCons\xe9quences",null,B.aG,null,null,null,null,null,null,null)
B.bpx=new A.a("Ces perturbations peuvent entra\xeener un retard \xe0 la reprise alimentaire per os, voire favoriser une pneumopathie d'inhalation. \nCependant les difficult\xe9s de reprise alimentaire apr\xe8s ventilation ne sont pas toutes imputables aux dispositifs. Le r\xf4le de l'\xe2ge, de la pathologie sous-jacente (insuffisance respiratoire, maladie neurologique), de la pr\xe9sence d'une neuropathie ou d'une myopathie de r\xe9animation sont \xe0 prendre en compte. \n",null,null,null,null,null,null,null,null,null)
B.a8Q=new A.C("","assets/images/pathologies/respiratoire/prototrach/illustration.png",null)
B.R4=new A.N(B.m,null,null,B.a8Q,null)
B.b7x=new A.a("\t\t3)\tR\xe9-alimentation",null,B.aG,null,null,null,null,null,null,null)
B.b1g=new A.a("\u2022\tD\xe9ventilation suffisante le jour.\n\u2022\tInstallation du patient en position demi assise ou au fauteuil.\n\u2022\tBallonnet d\xe9gonfl\xe9 avec la valve de phonation (si canule basse pression mettre la chemise fen\xeatr\xe9e).\n\u2022\tCommencer par le liquide (eau p\xe9tillante puis plate), ne pas utiliser d\u2019eau g\xe9lifi\xe9e mais si fausses routes aux liquides mettre des \xe9paississants.\n\u2022\tProgressivement modifier les textures par la mise en place d\u2019aliments mix\xe9s puis solides.\n\u2022\tSurveiller l\u2019apparition de fausses routes en aspirant dans la canule. Utiliser des liquides et aliments color\xe9s pour mieux d\xe9tecter les fausses routes (menthe, cr\xe8me au chocolat\u2026).\n\nSi les troubles persistent un bilan ORL ou une nasofibroscopie permettra de faire un diagnostic pr\xe9cis des troubles de la d\xe9glutition.\n",null,null,null,null,null,null,null,null,null)
