B.brt=new A.a("\u2022\tM\xe9decine Intensive R\xe9animation, revue Vol.28 N\xb01, Janvier-F\xe9vrier 2019.\n\u2022\tProtocole de soin de trach\xe9otomie HAD de l\u2019Aven \xe0 Etel.\n\u2022\tLa revue de l\u2019infirmi\xe8re n\xb0119, mars 2014 \xab la r\xe9alisation de la trach\xe9otomie percutan\xe9e \xbb de Aymeric Lapp.\n\u2022\t\xab Trach\xe9otomie percutan\xe9e en r\xe9animation : techniques et r\xe9sultats \xbb, novembre 2005 de Alain Combes, r\xe9animateur \xe0 l\u2019h\xf4pital La Piti\xe9-Salp\xeatri\xe8re.\n\u2022\tTrach\xe9otomie en r\xe9animation : recommandations formalis\xe9es d\u2019experts sous l\u2019\xe9gide de la Soci\xe9t\xe9 de R\xe9animation de Langue Fran\xe7aise (SRLF) et de la Soci\xe9t\xe9 Fran\xe7aise d\u2019Anesth\xe9sie et de R\xe9animation (SFAR), janvier-f\xe9vrier 2019.\n                  ",null,null,null,null,null,null,null,null,null)
