B.b0T=new A.a("Invasion et multiplication de micro-organismes dans les tissus de l\u2019h\xf4te, induisant une r\xe9ponse inflammatoire suivie d\u2019une destruction tissulaire. \nSurvenue apr\xe8s une br\xe8che cutan\xe9e \nContexte de neuropathie p\xe9riph\xe9rique et d\u2019art\xe9riopathie p\xe9riph\xe9rique. \nOn peut constater\u202f: une inflammation locale, une dermohypodermite, une dermohypodermite bact\xe9rienne n\xe9crosante, une fasciite n\xe9crosante, une gangr\xe8ne humide, des abc\xe8s. \nLa classification la plus usuelle est celle de l\u2019IWGDF\u202f: \n",null,null,null,null,null,null,null,null,null)
