B.b8d=new A.a("1. Raccordez l\u2019interface patient appropri\xe9e \xe0 l\u2019appareil.\n2. Appuyez sur le bouton d\u2019alimentation pour allumer l\u2019appareil et entrer en Veille. \n3. V\xe9rifiez vos r\xe9glages avant de d\xe9marrer le traitement.\n4. Raccordez l\u2019interface patient appropri\xe9e au patient. \n5. Appuyez sur le bouton Traitement pour d\xe9marrer le traitement. \n6. Mettez l\u2019interrupteur Manuel dans la position Inspiration, + (\xe0 droite) pour insuffler. \n7. Faites passer rapidement l\u2019interrupteur Manuel dans la position Expiration, - (\xe0 gauche) pour exsuffler. \n8. Laissez l\u2019interrupteur en position Pause (neutre) pendant quelques secondes, ou passez imm\xe9diatement \xe0 la phase de pression positive pour un autre cycle de toux, selon la pr\xe9f\xe9rence du patient. \n9. Une fois que les cycles sont termin\xe9s, d\xe9connectez le patient de l\u2019appareil et \xe9liminez les s\xe9cr\xe9tions \xe9ventuellement visibles dans la bouche, la gorge\n\n",null,null,null,null,null,null,null,null,null)
