B.bnS=new A.a("Services concern\xe9es: Toutes les unit\xe9s \xe9quip\xe9s de DIO \nPersonnes concern\xe9es: M\xe9decin IADE IDE (d\xe9cret de comp\xe9tence) \nResponsables d\u2019application : Chefs de service, M\xe9decin, cadres de sant\xe9 des unit\xe9s de soins, IDE, IADE\n",null,null,null,null,null,null,null,null,null)
B.b4F=new A.a("Afin de promouvoir la gestion des risques associ\xe9s aux soins, il a \xe9t\xe9 d\xe9cid\xe9 de r\xe9diger un mode op\xe9ratoire concernant les bonnes pratiques en lien avec la r\xe9animation d\u2019urgence et plus particuli\xe8rement la pose d\u2019 un dispositif intra osseux. L\u2019objectif g\xe9n\xe9ral est de s\xe9curiser le geste et am\xe9liorer l\u2019efficacit\xe9 de sa r\xe9alisation.\n                          ",null,null,null,null,null,null,null,null,null)
B.bpt=new A.a("\u2022\tDIO  : Dispositif intra osseux \n\u2022\tIADE : Infirmier (\xe8re) Anesth\xe9siste Dipl\xf4m\xe9 (e) d\u2019Etat\n\u2022\tIDE : Infirmier (\xe8re) Dipl\xf4m\xe9 (e) d\u2019Etat\n\u2022\tACR : Arret Cardio R\xe9spiratoire \n\u2022\tNRBC Nucl\xe9aires, Radiologiques, Biologiques, Chimiques\n\u2022\tPISU : protocoles infirmiers de soins d'urgence\n\u2022\tDASRI : D\xe9chets d'Activit\xe9s de Soins \xe0 Risques Infectieux\n                       ",null,null,null,null,null,null,null,null,null)
B.b6I=new A.a("4.\tIndications",null,B.M,null,null,null,null,null,null,null)
B.b1b=new A.a("\u2022\tToutes les situations d\u2019urgence ou\u0300 l\u2019acce\u0300s au re\u0301seau veineux pe\u0301riphe\u0301rique est difficile voire impossible ou lorsque son de\u0301lai de mise en place diminue les chances de survie du patient \n\u2022\tAlternative a\u0300 l\u2019e\u0301chec de la voie d\u2019abord IV chez l\u2019enfant (> 3 kg) dans les cas de choc ou d\u2019A.C.R. \n\u2022\tVoie d\u2019abord d\u2019urgence en situation NRBC, Damage Control\u2026\n                       ",null,null,null,null,null,null,null,null,null)
B.bfX=new A.a("5.\tContre-Indications",null,B.M,null,null,null,null,null,null,null)
