B.bfw=new A.a("Dispositif permettant la mise en place d\u2019une aiguille intra osseuse dans la cavite\u0301 me\u0301dullaire d\u2019un os long, en cas d\u2019acce\u0300s intraveineux infructueux Le kit DIO \xab EZ-IO \xbb,contenu dans une sacoche de transport contient : \n- 1 driver motorise\u0301 (autonomie 300 a\u0300 400 utilisations)\n- 1 jeu d\u2019aiguille (jaune 45mm/bleue 25mm/rose 15mm)\n- 1 prolongateur Luer-lock\n- 1 seringue 10 ml Luer-lock et 1 ampoule injectable NaCl 0,9% et 1 trocart ou 1 seringue pre\u0301-remplie - 1 pansement Stabilizer\xae\n- 1 poche a\u0300 pression\n- 1 bracelet fluo d\u2019horodatage, a\u0300 fixer au poignet de la victime\n- 1 asepsie : compresses ste\u0301riles, Povidone iode\u0301e alcoolique unidose, champ ste\u0301rile petit mode\u0300le \n",null,null,null,null,null,null,null,null,null)
