B.b21=new A.a("d)\tMise en place du dispositif : une fois le site d\u2019insertion choisi et repe\u0301re\u0301 \n\u2022\t Pre\u0301paration du mate\u0301riel (cf. chapitre de\u0301finition-description) \n\u2022\t Lavage des mains + SHA \n\u2022\t Asepsie cutane\u0301e rigoureuse du site de ponction \n\u2022\t Montage du prolongateur sur la seringue 10 ml Na Cl 0,9% et purge \n\u2022\t Repe\u0301rage anatomique pre\u0301cis \n\u2022\t Adapter l\u2019aiguille sur le driver et de\u0301capuchonner \n\u2022\t Positionner l\u2019aiguille sur la peau et traverser les tissus mous jusqu\u2019a\u0300 l\u2019os sans actionner le moteur \n\u2022\t Percer sans a\u0300-coups jusqu\u2019a\u0300 \xab sentir \xbb une perte de re\u0301sistance (traverse\u0301e de la corticale) \n\u2022\t Maintenir l\u2019embase d\u2019une main, retirer le driver, et extraire le mandrin en de\u0301vissant \n\u2022\t Placer le pansement Stabilizer\xae \n\u2022\tConnecter le raccord avec la seringue \n\u2022\tVe\u0301rifier le reflux \n\u2022\tProce\u0301der au \xab flush \xbb (2 a\u0300 5 ml chez l\u2019enfant \u2013 5 a\u0300 10 ml chez l\u2019adulte) \n\u2022\tEn l\u2019absence d\u2019extravasation connecter la perfusion et fixer le pansement \n\u2022\tChez l\u2019enfant le membre sera immobilise\u0301 dans une attelle \n\u2022\tPlacer le bracelet \xab fluo \xbb renseigne\u0301 (date/heure) au poignet de la victime \n",null,null,null,null,null,null,null,null,null)
B.b89=new A.a("e)\tRisques\n\u2022\tLi\xe9s \xe0 une mauvaise technique :\n\u2022\tAtteinte du cartilage de croissance\n\u2022\tExtravasation autour du point d\u2019insertion\n\u2022\tInfiltration sous p\xe9riost\xe9e ou sous cutan\xe9e\n\u2022\tL\xe9sion \xe9piphysaire\n\u2022\tEmbolie graisseuse (pas avant 6 ans)\n\u2022\tObstruction de l\u2019aiguille par la moelle ou fragment d\u2019os ou de tissu\n",null,null,null,null,null,null,null,null,null)
B.b88=new A.a("f)\t Pr\xe9cautions \n\u2022\tL\u2019abord intra-osseux doit \xeatre remplac\xe9 par un abord vasculaire d\xe8s que possible, au plus tard dans les 24h apr\xe8s la pose.\n\u2022\tLimiter les tentatives de pose \xe0 une seule tentative par site et par op\xe9rateur.\n\u2022\tInstaller le patient de mani\xe8re ad\xe9quate et stabiliser le membre.\n\u2022\tEviter de placer une main sous le membre en face du site de ponction car risque de blessure du soignant.\n\u2022\tPour les pr\xe9l\xe8vements sanguins : pr\xe9ciser sur le bon de laboratoire \xab pr\xe9l\xe8vement intra-osseux \xbb.\n",null,null,null,null,null,null,null,null,null)
