B.baO=new A.a("\u2022\tLe dispositif doit e\u0302tre stable de\u0300s la pose . Et empe\u0302cher tout mouvement de balancier durant l\u2019utilisation\n\u2022\tVeiller a\u0300 l\u2019immobilisation du membre\n\u2022\tUtiliser la manchette a\u0300 pression\n\u2022\tDiluer les solute\u0301s ou produits \xab agressifs \xbb\n\u2022\tRincer apre\u0300s chaque injection\n\u2022\tSuspendre la perfusion a\u0300 l\u2019apparition de signe d\u2019extravasation \n\u2022\tSurveillance de l\u2019\xe9tat cutan\xe9 : coloration du membre, oedeme sous-cutan\xe9, point de ponction\n\u2022\tPouls distal du membre\n",null,null,null,null,null,null,null,null,null)
