B.aZY=new A.a("\u2022\tTout sympt\xf4me ou signe de dysfonctionnement du SNC associ\xe9 \xe0 la fi\xe8vre\n\u2022\tLa fi\xe8vre doit \xeatre recherch\xe9e dans les jours pr\xe9c\xe9dents par l'interrogatoire du patient ou des proches.\n",null,null,null,null,null,null,null,null,null)
B.bh4=new A.a("La biologie sanguine",null,B.M,null,null,null,null,null,null,null)
B.b_X=new A.a("\u2022\tDeux paires d\u2019h\xe9mocultures avant toute antibioth\xe9rapie\n\u2022\tNum\xe9ration avec formule sanguine avec plaquettes, ionogramme sanguin, glyc\xe9mie (concomitante de la PL), CRP, ASAT, ALAT, bilirubine, phosphatases alcalines, bilan d\u2019h\xe9mostase et CPK\n\u2022\tS\xe9rologie VIH indispensable\n\u2022\tEn cas de suspicion de primo-infection VIH, PCR ARN VIH (charge virale)\n",null,null,null,null,null,null,null,null,null)
B.bhp=new A.a("La biologie du LCS (1)",null,B.M,null,null,null,null,null,null,null)
B.baP=new A.a("\u2022\tLCS au moins 120 gouttes (environ 50 microL/goutte)\n    o\t20 gouttes pour biochimie\n    o\t80 \xe0 100 gouttes pour cytologie, microbiologie et virologie\n    o\tConserver une partie du LCS (si possible - 80\xb0C) pour compl\xe9ments d\u2019investigations (dont le diagnostic de tuberculose)\n\u2022\t En urgence : cytologie, prot\xe9inorachie, glycorachie, lactates et microbiologie.\n Glycorachie imp\xe9rativement associ\xe9e \xe0 une glyc\xe9mie concomitante, veineuse ou \xe0 d\xe9faut capillaire par dextro\n    o\tExamen bact\xe9riologique standard \n    o\tPCR HSV, VZV et ent\xe9rovirus imp\xe9ratives\t\t\t\n    o\tRecherche de BK si n\xe9gativit\xe9 des PCR pr\xe9c\xe9dentes ou tr\xe8s forte suspicion clinique ou \xe9pid\xe9miologique\n\u2022\tPonction lombaire contre-indiqu\xe9e avant l\u2019imagerie (\xe0 faire en urgence) si :\n    o\tTroubles de la vigilance\n    o\tSignes de localisation d\xe9ficitaires\n    o\tCrises \xe9pileptiques focales ou g\xe9n\xe9ralis\xe9es\n\u2022\tSi ponction lombaire impossible, appliquer les recommandations de th\xe9rapeutique initiale des m\xe9ningites bact\xe9riennes ET des enc\xe9phalites infectieuses\n",null,null,null,null,null,null,null,null,null)
B.bh9=new A.a("L\u2019imagerie",null,B.M,null,null,null,null,null,null,null)
B.b5Z=new A.a("\u2022\tIRM c\xe9r\xe9brale en urgence en premi\xe8re intention\n    o\tavec s\xe9quences FLAIR\n    o\tdiffusion, T2*, T1 sans et avec gadolinium \n    o\ts\xe9quences vasculaires veineuses et art\xe9rielles\n\u2022\t Seulement si IRM impossible, tomodensitom\xe9trie c\xe9r\xe9brale (TDM) sans et avec injection\n",null,null,null,null,null,null,null,null,null)
B.aXJ=new A.a("Conduite initiale (premi\xe8re 48h)",null,B.M,null,null,null,null,null,null,null)
B.bdL=new A.a("\u2022\tHospitalisation\n\u2022\tDans une unit\xe9 ayant l\u2019exp\xe9rience de ces pathologies, et si possible avec une unit\xe9 de surveillance continue (USC).\n\u2022\tEn r\xe9animation/soins intensifs si :\n    o\tScore de Glasgow (GCS) \u2264 13 ou\n    o\tPlus d\u2019une crise convulsive, ou \xe9tat de mal ou \n    o\tD\xe9tresse respiratoire ou une autre d\xe9faillance d\u2019organe ou\n    o\tTroubles du comportement incompatibles avec le secteur conventionnel.\n\n\u2022\tTraitements anti-infectieux : A d\xe9buter en urgence\n\u2022\tAbsence d\u2019orientation \xe9tiologique (clinique ou biologique), \n    o\tAciclovir : 10 mg/kg IV toutes les 8 heures sur perfusions de 3 heures_ Surveillance de la fonction r\xe9nale\n    o\tAmoxicilline : 200 mg/kg/jour en au moins 4 perfusions, ou en administration continue \n    o\tR\xe9\xe9valuation syst\xe9matique \xe0 48h.\n\n\u2022\tSi v\xe9sicules cutan\xe9es ou signes de vasculopathie \xe0 l\u2019imagerie\n    o\tAciclovir : 15 mg/kg IV toutes les 8 heures.\n\n\u2022\tSi LCS trouble : appliquer les recommandations sur la prise en charge des m\xe9ningites bact\xe9riennes communautaires\n\u2022\tSi examen microscopique du LCS positif : d\xe9buter un traitement \xe9tiologique.\n\n\u2022\tDans les premi\xe8res 48 heures :\n    o\tContact avec le microbiologiste \n    o\tR\xe9sultats PCR HSV, VZV et ent\xe9rovirus doivent \xeatre connus\n    o\tTraitement anti tuberculeux (en plus du traitement par aciclovir + amoxicilline) seulement si : \n        -\tPr\xe9sence d\u2019\xe9l\xe9ments fortement \xe9vocateurs : terrain, anamn\xe8se, caract\xe9ristiques du LCS, localisations extra neurologiques, imagerie ou\n        -\tPr\xe9sence de BAAR ou PCR temps r\xe9el positive\n\n\u2022\tTraitements anti-infectieux syst\xe9matiquement r\xe9\xe9valu\xe9s dans les 48 heures avec les r\xe9sultats disponibles \n    o\tSi PCR HSV positive : arr\xeat amoxicilline et poursuite aciclovir (10 mg/kg/8 heures)\n    o\tSi PCR VZV positive : arr\xeat amoxicilline et augmentation aciclovir (15 mg/kg/8 heures)\n    o\tSi PCR ent\xe9rovirus positive, arr\xeat aciclovir et amoxicilline.\n    o\tSi culture positive \xe0 Listeria : arr\xeat aciclovir, poursuite amoxicilline et ajout de gentamicine (5 mg/kg en une dose unique quotidienne)\n    o\tSi tout est n\xe9gatif \xe0 48 heures : \n        o\tPoursuite aciclovir jusqu\u2019\xe0 r\xe9\xe9valuation du diagnostic d\u2019HSV/VZV (seconde PCR sur LCS au moins 4 jours apr\xe8s le d\xe9but des signes neurologiques) et \n        o\tArr\xeat amoxicilline, sauf si prise d\u2019antibiotique avant la PL ou contexte \xe9vocateur de list\xe9riose\n    o\tPas de corticoth\xe9rapie sauf si tuberculose prouv\xe9e ou fortement suspect\xe9e\n    o\tPas de traitement anticonvulsivant en prophylaxie primaire (\xe0 discuter si l\xe9sions corticales)\n",null,null,null,null,null,null,null,null,null)
B.bm7=new A.a("CAT si diagnostic d\xe9j\xe0 fait \xe0 48h",null,B.M,null,null,null,null,null,null,null)
B.bid=new A.a("\u2022\tEnc\xe9phalites HSV 1\nAciclovir IV = traitement de r\xe9f\xe9rence\n    o\tPas de place pour l\u2019aciclovir per os, ni pour le valaciclovir\nDose aciclovir : 10 mg/kg (ajust\xe9e \xe0 la fonction r\xe9nale) en 1 heure toutes les 8 heures\n    o\tConcentration finale du solut\xe9 de perfusion < 5 mg/ml\n    o\tLimiter les traitements n\xe9phrotoxiques associ\xe9s\n    o\tR\xe9hydratation correcte\nDur\xe9e de traitement :\n    o\t14 jours chez l'adulte immunocomp\xe9tent\n    o\t21 jours si immunod\xe9pression\nSi \xe9volution favorable : pas de contr\xf4le de LCS.\nEn cas d\u2019\xe9volution clinique non favorable \xe0 la fin du traitement de 14 jours\n    o\tUne ponction lombaire avec PCR HSV et recherche d\u2019auto-anticorps sur le LCS doit \xeatre r\xe9alis\xe9e\n    o\tLa positivit\xe9 de la PCR HSV peut conduire \xe0 prolonger le traitement par aciclovir \xe0 21 jours. \n    o\tLa recherche d\u2019une r\xe9sistance \xe0 l\u2019aciclovir et l\u2019exploration des param\xe8tres pharmacocin\xe9tiques (dosages d\u2019aciclovir dans le sang et le LCS) sont \xe0 discuter coll\xe9gialement.\n\n\n\u2022\tEnc\xe9phalites \xe0 VZV\nAciclovir IV = traitement de r\xe9f\xe9rence\n    o\tPas de place pour l\u2019aciclovir per os, ni pour le valaciclovir\nDose aciclovir : 15 mg/kg (ajust\xe9e \xe0 la fonction r\xe9nale) en 1 heure toutes les 8 heures\n    o\tConcentration finale du solut\xe9 de perfusion < 5 mg/ml\n    o\tLimiter les traitements n\xe9phrotoxiques associ\xe9s\n    o\tR\xe9hydratation correcte\nDur\xe9e de traitement : 14 jours\nFoscarnet = seconde intention si \xe9chec, intol\xe9rance, ou r\xe9sistance \xe0 l'aciclovir\nPas de corticoth\xe9rapie syst\xe9matique\n\n\u2022\tEnc\xe9phalite \xe0 Listeria\nTraitement recommand\xe9 \n    o\tAmoxicilline \xe0 200 mg/kg/jour en au moins 4 perfusions par 24 h ou en continu, pendant 21 jours\n    o\tGentamicine 5mg/kg/j en dose unique quotidienne, pendant au maximum 5 jours\nSi contre-indication \xe0 l\u2019amoxicilline, trim\xe9thoprime/sulfam\xe9thoxazole \xe0 forte dose : 6 \xe0 9 ampoules de 80mg/400mg par jour, en 3 injections, pendant 21 jours en IV.\n\n\n\n\u2022\tEnc\xe9phalite tuberculeuse\nJusqu\u2019aux r\xe9sultats de l\u2019antibiogramme\n    o\tIsoniazide (I) (5mg/kg/j)\n    o\tRifampicine (R) (10 mg/kg/j)\n    o\tPyrazinamide (P) (30 mg/kg/j sans d\xe9passer 2 g) \n    o\tEthambutol (E) (20 mg/kg/j)\nArr\xeat de l\u2019\xe9thambutol si souche sensible \xe0 l\u2019isoniazide\nDur\xe9e initiale de 2 mois\nPuis bith\xe9rapie par IR pour une dur\xe9e totale de 12 mois\nAdjonction syst\xe9matique de dexam\xe9thasone :\n    o\t0,3 \xe0 0,4 mg/kg/jour par voie intraveineuse, en fonction de la gravit\xe9 initiale\n    o\tD\xe9croissance sur 8 semaines d\xe8s la fin de la premi\xe8re semaine\nLa neurochirurgie doit \xeatre discut\xe9e sans attendre en cas d'hydroc\xe9phalie, de tuberculome/abc\xe8s ou de compression m\xe9dullaire.\nLa surveillance biologique du traitement est identique \xe0 celle recommand\xe9e dans le traitement des autres localisations de tuberculose\nEn cas d'\xe9volution clinique favorable\n    o\tPas de ponction lombaire de contr\xf4le\n    o\tPas d\u2019imagerie de contr\xf4le\n",null,null,null,null,null,null,null,null,null)
B.b97=new A.a("CAT si diagnostic non fait \xe0 48h",null,B.M,null,null,null,null,null,null,null)
B.b7o=new A.a("\u2022\tFaut-il poursuivre l\u2019amoxicilline ?\nOUI : en cas d\u2019\xe9l\xe9ments cliniques en faveur d\u2019une list\xe9riose, m\xeame en l\u2019absence de documentation microbiologique \nNON : en l\u2019absence d\u2019\xe9l\xe9ments cliniques en faveur de list\xe9riose, l\u2019amoxicilline peut \xeatre arr\xeat\xe9e si pr\xe9l\xe8vements microbiologiques n\xe9gatifs.\n\n\u2022\tFaut-il instaurer ou poursuivre une quadrith\xe9rapie antituberculeuse d\u2019\xe9preuve apr\xe8s 48h ? (1)\nOUI : si le tableau clinique, biologique et l\u2019imagerie sont en faveur d\u2019un diagnostic de tuberculose, m\xeame en cas d\u2019examen microscopique et de PCR n\xe9gatifs\n    o\tLa PCR-Temps r\xe9el doit \xeatre r\xe9alis\xe9e sur des \xe9chantillons dont le volume re\xe7u est au minimum de 2 ml (40 gouttes)\n    o\tLa PCR-Temps r\xe9el n\xe9gative ne permet pas d\u2019\xe9liminer le diagnostic de tuberculose\n    o\tLes tests interf\xe9ron (IGRA) dans le sang et le LCS ne sont pas recommand\xe9s\n\n\u2022\tFaut-il instaurer un traitement par cortico\xefdes en cas de diagnostic non fait \xe0 48h ?\nNon sauf si :\n    o\tM\xe9ningo-enc\xe9phalite tuberculeuse suspect\xe9e ou prouv\xe9e : d\xe9cision apr\xe8s concertation multidisciplinaire\n\n\u2022\tFaut-il instaurer un traitement d\u2019\xe9preuve par doxycycline ?\nA discuter si suspicion d\u2019enc\xe9phalite \xe0 bact\xe9ries intracellulaires et en l\u2019absence d\u2019argument pour une des 4 \xe9tiologies les plus fr\xe9quentes.\n\n\n\u2022\tPoursuite de l\u2019investigation diagnostique \nLes investigations infectieuses compl\xe9mentaires doivent \xeatre orient\xe9es par l\u2019\xe2ge, le terrain, les expositions professionnelles ou de loisir, la saison, les voyages, les signes extra-neurologiques et les donn\xe9es biologiques.\t\nUne IRM est indispensable pour faire le diagnostic d\u2019ADEM.\nSi enc\xe9phalite limbique ou de cause ind\xe9termin\xe9e\n    \u2022\tRecherche d\u2019enc\xe9phalite auto-immune par d\xe9tection d\u2019anticorps onco-neuronaux s\xe9riques et du LCS \n    \u2022\tRecherche de maladie syst\xe9mique.\n    \u2022\tBiopsie c\xe9r\xe9brale \n        o\tSi enc\xe9phalite non r\xe9solutive d\u2019\xe9tiologie ind\xe9termin\xe9e, \n        o\tApr\xe8s r\xe9union multidisciplinaire. \n        o\tComprenant syst\xe9matiquement des pr\xe9l\xe8vements non fix\xe9s (microbiologie) et fix\xe9s (anatomopathologie).\n\n",null,null,null,null,null,null,null,null,null)
