B.bcI=new A.a("\xc9CHOGRAPHIE DES SINUS\nLe diagnostic des sinusites acquises en r\xe9animation peut \xeatre fait par \xe9chographie bidimensionnelle en appliquant la sonde sur l'os malaire, chez un patient demi-assis car la position couch\xe9e expose \xe0 des faux n\xe9gatifs. Le mode d'imagerie utilis\xe9 est le mode B : brillance qui code les \xe9chos en \xe9chelle de gris. La performance de l'\xe9chographie est comparable \xe0 celle du scanner : sensibilit\xe9, sp\xe9cificit\xe9, valeurs pr\xe9dictives positive et n\xe9gative respectivement \xe0 100, 96,7, 98,6 et 100 % [122]. Un sinus normal n'est pas visible du fait du barrage acoustique naturel repr\xe9sent\xe9 par l'air sinusien. Lorsque le sinus est visible dans son ensemble sous forme d'un triangle hypo\xe9chog\xe8ne, dont les parois interne, externe et post\xe9rieure sont hyper\xe9chog\xe8nes, on parle de sinusogramme complet [32], qui t\xe9moigne du comblement du sinus et autorise le drainage [33]. On parle de sinusogramme incomplet lorsque seule la paroi post\xe9rieure du sinus est visible. Un sinusogramme incomplet peut correspondre \xe0 un \xe9paississement muqueux simple ou \xe0 une sinusite vraie. Pour diff\xe9rencier les 2 cas, l'\xe9chographie et refaite en position allong\xe9e. Si l'image se modifie, il y a sinusite, si l'image reste stable, il s'agit d'un \xe9paississement muqueux [34].\n",null,null,B.Z,null,null,null,null,null,null)
