B.b7M=new A.a("DC=VESxFc\n\nDC=SurfaceAo x ITV x FC\nDC= (VTD-VTS) x FC\nSurface sous Ao= Pi*D\xb2/4=0.785xD\xb2\nSurface Corporelle\nICC=DC/SC\n\n\nVES=ITV*0.785*Dssao/10*Dssao/10\n\nD sous Ao (19-21mm)\nITV \xe0 mesurer en ETT\nFC: \xe0 regarder sur scope ou ETT\nPoids kg\nTaille cm\nVES = ITV x 0.785 x (Dssao/10)^2 en ml\nDC = FC x VES /1000 en l/min\nSC\n\ndouble surfaceCorporelle(double poids, double taille) {\n  var sc = 0.0001 *\n      3.207 *\n      pow(poids * 1000, 0.7285 - (0.0188 * (log(poids * 1000) / ln10))) *\n      pow(taille, 0.3);\n  return sc;\n}\n\nICC\n\n\n",null,null,B.i,null,null,null,null,null,null)
