B.b84=new A.a("                \n                \n                Le traitement de r\xe9f\xe9rence d\u2019une infection li\xe9e au CIVLD est l\u2019ablation du cath\xe9ter associ\xe9e \xe0 une antibioth\xe9rapie syst\xe9mique \n                Ablation du KT si:\n                  -Complications:\n                    -Locales: Tunellites/Infection de loge\n                    -Loco-r\xe9gionales: Thrombophl\xe9bite septique\n                    -Syst\xe9miques: Sepsis/Choc septique/Endocardite/ Embols Septiques\n                  -En fonction du germe:\n                    -Candida Spp.\n                    -S. aureus           \n                      ",null,null,null,null,null,null,null,null,null)
