B.b9g=new A.a("Le caract\xe8re compressif d'un \xe9panchement (tamponnade) est affirm\xe9 par la compression d'une ou plusieurs cavit\xe9s cardiaques (coupes apicales), le plus souvent l'oreillette et/ou le ventricule droit, plus rarement l'oreillette gauche (25 % des cas) et le VG. Il s'associe \xe0 ces signes de compression cardiaque une dilatation majeure de la veine cave inf\xe9rieure avec disparition des variations respiratoires du diam\xe8tre de cette derni\xe8re (coupe sous costale).\n\nExiste-t-il une dysfonction systolique ventriculaire gauche ?\n\nLa fonction contractile ventriculaire gauche peut \xeatre appr\xe9ci\xe9e par des m\xe9thodes quantitatives imposant des mesures, soit par m\xe9thode semi-quantitative, visuelle.\n\nEn mode TM, la fonction systolique peut \xeatre appr\xe9ci\xe9e en mesurant la fraction de raccourcissement. \xc0 partir de la coupe PSGA ou PSPA, la coupe TM est r\xe9alis\xe9 \xe0 l'extr\xe9mit\xe9 distale des feuillets mitraux, soit en position m\xe9dioventriculaire (figure 3b). On mesure alors les diam\xe8tres t\xe9l\xe9systoliques (DTS) et t\xe9l\xe9diastoliques (DTD). La fraction de raccourcissement (FR) est calcul\xe9e selon la formule :\n\nFR = (DTD - DTS) / DTD\n\nLa normale de la FR est de 28 \xe0 42 %. La formule de Teicholz disponible automatiquement sur toutes les machines donne une valeur extrapol\xe9e de fraction d'\xe9jection ventriculaire gauche (FEVG normale > 55 %). Il est important de garder \xe0 l'esprit que cette m\xe9thode d'\xe9valuation de la fonction systolique ainsi que la relation FR/FEVG par m\xe9thode de Teicholz ne sont plus valables lorsqu'il existe une anomalie de cin\xe9tique segmentaire.\n\nEn mode 2D, la fonction systolique peut \xeatre appr\xe9ci\xe9e en mesurant la fraction de raccourcissement de surface (FRS). \xc0 partir d'une coupe PSPA r\xe9alis\xe9e au niveau des piliers soit en position m\xe9dio-ventriculaire, les surfaces ventriculaires gauche systoliques (SSVG) et diastoliques (SDVG) sont mesur\xe9es en tra\xe7ant les contours de la cavit\xe9 ventriculaire :\n\nFR = (SDVG - SSVG) / SDVG\n\nLa valeur normale de la FRS est comparable \xe0 celle de la FEVG, soit > 55 %. C'est une m\xe9thode simple et fiable. Toutefois, comme pr\xe9c\xe9demment, un trouble de cin\xe9tique segmentaire limite l'exactitude de la m\xe9thode.\n\nLa m\xe9thode de Simpson est la m\xe9thode conventionnelle la plus exacte pour \xe9valuer la FEVG car elle prend en compte d'\xe9ventuels troubles de cin\xe9tique segmentaire. Le principe de cette m\xe9thode est bas\xe9 sur le calcul de la somme des volumes du VG d\xe9coup\xe9 en tranches d'\xe9paisseur \xe9gale appel\xe9es disques. On obtient ainsi un volume ventriculaire. Toute les machines d'\xe9chocardiographies sont \xe9quip\xe9es de logiciels permettant le calcul de la FEVG Simpson. \xc0 partir de la coupe 4 cavit\xe9s, on effectue le trac\xe9 manuel du contour endocardique systolique et diastolique en incluant par convention les muscles papillaires dans la cavit\xe9 VG. Cette m\xe9thode est fiable mais impose une exp\xe9rience importante et une \xe9chog\xe9nicit\xe9 parfaite. Il est enfin utile pour \xeatre le plus pr\xe9cis de r\xe9aliser une seconde mesure en coupe apicale 2 cavit\xe9s et de moyenner les 2 valeurs obtenues, ceci dans un souci de s'affranchir au maximum des troubles de cin\xe9tique segmentaire.\n\nL'\xe9valuation visuelle de la fonction VG a le m\xe9rite de la simplicit\xe9 qui est tr\xe8s appr\xe9ciable en r\xe9animation compte tenu de la n\xe9cessit\xe9 d'obtenir des informations cliniques rapides. Il est d\xe9montr\xe9 depuis plus de 15 ans en cardiologie qu'un op\xe9rateur entra\xeen\xe9 pouvait \xe9valuer visuellement de fa\xe7on assez pr\xe9cise en ETT la FEVG en prenant comme m\xe9thode de r\xe9f\xe9rence l'angiographie [51] [52]. En r\xe9animation, Vieillard-Baron et al. [4] ont d\xe9montr\xe9 qu'une \xe9valuation visuelle semi-quantitative selon une classification en 3 niveaux (FEVG normale, alt\xe9ration mod\xe9r\xe9e, alt\xe9ration s\xe9v\xe8re) est bien corr\xe9l\xe9e aux mesures chiffr\xe9es.\n\nMesure du d\xe9bit cardiaque\n\nLe d\xe9bit cardiaque est obtenu en calculant la surface de la chambre de chasse du VG obtenu en mesurant le diam\xe8tre (D) de cette derni\xe8re en PSGA. La surface (S) est obtenue en appliquant la formule \u03c0D2/4. On multiplie alors cette surface par l'ITV sous-aortique (ITVssAo) qui permet d'obtenir le volume d'\xe9jection systolique. Il ne reste plus alors qu'\xe0 multiplier ce dernier par la fr\xe9quence cardiaque pour obtenir le d\xe9bit cardiaque.\n\nDC = Fc \xd7 ITVssAo \xd7 S\n\nExiste-t-il une dysfonction ventriculaire droite ?\n\nL'\xe9jection ventriculaire droite se faisant dans une circulation \xe0 basses r\xe9sistances, le VD est tr\xe8s sensible aux augmentations brutales de postcharge. Sa fonction systolique est sensible. Contrairement au ventricule gauche, le VD peut se dilater sous l'effet d'une augmentation brutale de postcharge. La fonction diastolique du VD est tol\xe9rante. Ainsi, lors d'une HTAP aigu\xeb (embolie pulmonaire ou vasoconstriction pulmonaire hypoxique du SDRA), le VD se dilate brutalement. Comme le p\xe9ricarde est inextensible, le volume biventriculaire est constant. Ainsi, toute dilatation du VD s'accompagne d'une compression ventriculaire gauche appel\xe9e septum paradoxal (SP) \xe0 l'origine d'un obstacle au remplissage de ce dernier, responsable d'une chute du d\xe9bit cardiaque et d'une instabilit\xe9 h\xe9modynamique. On parle alors de c\u0153ur pulmonaire aigu (CPA). En \xe9chographie, le diagnostic de CPA est fait par la constatation d'une dilatation ventriculaire droite associ\xe9e \xe0 un CPA [53]. La dilatation ventriculaire droite est d\xe9finie par un rapport des surfaces ventriculaires diastoliques du VD/VG > 0,6 [54]. Les surfaces ventriculaires sont mesur\xe9es par contour en coupe apicale 4 cavit\xe9s (figure 11a1). Le septum paradoxal est diagnostiqu\xe9 en coupe PSPA et/ou en mode TM \xe0 partir de la coupe PSGA. Des niveaux d'HTAP de l'ordre de 40-45 mmHg associ\xe9s \xe0 un tableau de CPA \xe9voquent un c\u0153ur droit ant\xe9rieurement sain, des niveaux d'HTA plus \xe9lev\xe9s doivent faire \xe9voquer un c\u0153ur pulmonaire chronique (CPC) associ\xe9. Dans ce cas, on note une hypertrophie de la paroi libre du VD de plus de 6 mm.\n",null,null,B.Z,null,null,null,null,null,null)
