B.bdV=new A.a("Cat\xe9cholamines : Les cat\xe9cholamines sont des m\xe9dicaments cardio-vasoactifs puissants et de courte dur\xe9e d\u2019action. Ils permettent notamment de restaurer et de maintenir l\u2019\xe9tat h\xe9modynamique du patient en \xe9tat de choc. La noradr\xe9naline\xae,l\u2019adr\xe9naline\xae et la dobutamine\xae sont les plus utilis\xe9es. Leur indication d\xe9pend de leurs propri\xe9t\xe9s.\nAdr\xe9naline\xae(Adr\xe9) : L\u2019adr\xe9naline\xae agit sur la contractilit\xe9 du c\u0153ur (inotrope +), sur les vaisseaux (vasoconstriction) et sur les bronches (bronchodilatation). C\u2019est la drogue de r\xe9f\xe9rence lors de l\u2019arr\xeat cardio-respiratoire et  du choc anaphylactique.\n\nNoradr\xe9naline\xae(NAD) : La noradr\xe9naline\xae est un puissant vasoconstricteur. Elle n\xe9cessite d\u2019\xeatre dilu\xe9e dans une solution de glucos\xe9 \xe0 5% afin de ne pas s\u2019oxyder. Elle est utilis\xe9e dans les chocs septique et vasopl\xe9gique. \n\nDobutamine\xae(Dobu) : La dobutamine augmente la contractilit\xe9 du c\u0153ur d\u2019o\xf9 son utilisation lors de chocs cardiog\xe9niques. Elle poss\xe8de un effet vasodilatateur qui peut entra\xeener une hypotension; cela n\xe9cessite alors son association avec un vasoconstricteur comme la noradr\xe9naline\xae. \n\nPression art\xe9rielle moyenne (PAM) : La PAM est la pression dont d\xe9pend la perfusion des organes, \xe0 l\u2019exception du myocarde, dont la perfusion d\xe9pend de la Pression Art\xe9rielle Diastolique. Le maintien d\u2019une PAM sup\xe9rieure \xe0 65 mmHg est un objectif h\xe9modynamique.\n\nEtat de choc : est un \xe9tat pathologique au cours duquel le syst\xe8me circulatoire est incapable d\u2019assurer une perfusion tissulaire suffisante pour r\xe9pondre \xe0 la demande en oxyg\xe8ne (O2) de l\u2019organisme. Cette inad\xe9quation entre apport et demande d\u2019O2 \xe9volue vers la d\xe9faillance d\u2019organes, puis \xe9ventuellement le d\xe9c\xe8s. \n\nMarbrures : Les marbrures sont d\xfbes \xe0 une hypoperfusion tissulaire qui entra\xeene une vasoconstriction jusqu\u2019aux niveau des vaisseaux superficiels de la peau (signe d\u2019\xe9tat de choc). Ces vaisseaux, pauvres en oxyg\xe8ne du fait de l\u2019\xe9tat de choc (hypoxie du patient), expliquent la couleur viola\xe7\xe9e des marbrures.\n\nEpreuve du lever de jambe passif : Man\u0153uvre posturale susceptible de reproduire transitoirement les effets h\xe9modynamiques d\u2019une expansion vol\xe9mique par redistribution depuis le secteur veineux p\xe9riph\xe9rique vers le secteur sanguin central. \n\nRemplissage vasculaire : L\u2019objectif de l\u2019expansion vol\xe9mique est de perfuser rapidement un solut\xe9 afin d\u2019augmenter le volume intravasculaire, la pr\xe9charge et donc le d\xe9bit cardiaque des patients ayant une hypovol\xe9mie vraie ou relative.\n\nRelais de cat\xe9cholamines : Programmation d\u2019une seringue autopuls\xe9e (SAP) de cat\xe9cholamines sur un PSE qui d\xe9butera automatiquement \xe0 la fin de celle en cours et r\xe9duisant le risque de variation h\xe9modynamique (relais automatis\xe9).\n\nCath\xe9ter art\xe9riel (KTA) : Le cath\xe9t\xe9risme art\xe9riel est la mise en place par un m\xe9decin d\u2019un cath\xe9ter dans une art\xe8re p\xe9riph\xe9rique afin de mesurer la pression art\xe9rielle, de mani\xe8re invasive et continue, et de r\xe9aliser des pr\xe9l\xe8vements de sang art\xe9riel. Les voies d\u2019abord sont : \n    -\tVoie radiale \n    -\tVoie f\xe9morale\n\nCath\xe9ter Veineux Central (CVC) : consiste en l\u2019introduction dans le syst\xe8me veineux d\u2019un cath\xe9ter long donnant acc\xe8s \xe0 la jonction syst\xe8me cave/oreillette droite. Le CVC  est implant\xe9 par voie percutan\xe9e. C\u2019est un fin tuyau en mat\xe9riel biocompatible (le plus souvent en polyur\xe9thane). Il est fix\xe9 \xe0 la peau par un fil non r\xe9sorbable. Le choix de l\u2019abord est laiss\xe9 \xe0 l\u2019appr\xe9ciation de l\u2019op\xe9rateur. Plusieurs abords sont possibles : \n    -\tvoie jugulaire interne droite et gauche.\n    -\tvoie f\xe9morale droite et gauche.\n    -\tvoie sous clavi\xe8re droite et gauche en derni\xe8re intention car risque de thrombose veineuse major\xe9e.\n\nVoie proximale : Voie strictement r\xe9serv\xe9e pour l\u2019utilisation des cat\xe9cholamines (SAUF en cas d\u2019ACR o\xf9 l\u2019adr\xe9naline se passe par le robinet d\u2019urgence de la voie distale).\n\nRin\xe7age puls\xe9 : Le rin\xe7age puls\xe9 ou en saccades en 5 \xe0 10 pouss\xe9es successives avec une seringue de 10 ml de NaCl \xe0 0,9% est l\u2019acte de r\xe9f\xe9rence pour \xe9viter toute obstruction ou toute pr\xe9cipitation de produits incompatibles entre eux.\n\nPICCO : Le PICCO\xae permet une surveillance h\xe9modynamique avanc\xe9e en continue. Il permet une mesure fiable du d\xe9bit cardiaque en utilisant deux m\xe9thodes : La thermo-dilution et le volume d'\xe9jection. Dans le cas du PICCO la calibration se fait par thermo-dilution transpulmonaire.  \n\nVoie Veineuse P\xe9riph\xe9rique (VVP) : Les cath\xe9ters veineux p\xe9riph\xe9riques sont des dispositifs m\xe9dicaux st\xe9riles introduits dans une veine superficielle par voie percutan\xe9. Ils permettent l\u2019administration parent\xe9rale de solut\xe9s, de produits sanguins, de solutions nutritives et de m\xe9dicaments. \n\nDispositif Intra Osseux (DIO) : Dispositif permettant la mise en place d\u2019une aiguille intra osseuse dans la cavite\u0301 me\u0301dullaire d\u2019un os long, en cas d\u2019acce\u0300s intraveineux infructueux. Voie hum\xe9rale de pr\xe9f\xe9rence car plus proche du c\u0153ur (aiguille taille 45 mm).\n\nACR : Arr\xeat Cardio Respiratoire\nG5% : Glucos\xe9 \xe0 5%\nIDE : Infirmier(e) Dipl\xf4m\xe9e d\u2019Etat\nNaCl \xe0 0,9% : S\xe9rum physiologique \xe0 0,9% \nSAP : Seringue Auto Puls\xe9e\nSHA : Solution Hydro Alcoolique \nPSE : Pousse Seringue Electrique\n                       ",null,null,null,null,null,null,null,null,null)
