B.bdY=new A.a("-\tFaire un changement de dilution si vitesse < \xe0 1,2 ml/h ou > \xe0 6ml/h. La base intensive n\u2019accepte pas les relais automatis\xe9s si vitesse de la seringue < \xe0 1 ml/h.\n\n\u25ab\tc) Changement de dilution :\n\n-\tR\xe9aliser une d\xe9sinfection des mains par friction avec une SHA.\n-\tPr\xe9parer la SAP avec la nouvelle dilution.\n-\tLa connecter au V2 et purger l\u2019ensemble de la ligne.\n-\tL\u2019installer sur un PSE et allumer celui-ci.\n-\tValider le code de la SAP.\n-\tFaire le purge de la SAP.\n-\tFaire \xe0 cette \xe9tape la modification de la concentration de la cat\xe9cholamine.\n",null,null,null,null,null,null,null,null,null)
