B.bee=new A.a("-\tS\u2019assurer de la fiabilit\xe9 de la tension art\xe9rielle\n-\tSi prise au brassard (au bras) : reprendre une mesure \n-\tSi patient porteur d\u2019un KTA :\n      -\tv\xe9rifier la position du capteur (doit \xeatre au niveau de l\u2019oreillette)\n      -\tfaire un \xab z\xe9ro \xbb (calibrage du KTA)\n      -\tv\xe9rifier la courbe (aplatie ou bien oscillante)\n      -\tla perm\xe9abilit\xe9 du cath\xe9ter art\xe9riel\n      -\tque la poche \xe0 pression soit suffisament gonfl\xe9e (> \xe0 300 mmHg)\n\n-\tprendre une pression art\xe9rielle au brassard pour v\xe9rifier si elle est similaire \xe0 celle du KTA\n\n-\t Rechercher la cause de l\u2019hypotension : \n      -\teffets secondaires d\u2019un m\xe9dicament : analg\xe9sique, hypnotique, curare, benzodiaz\xe9pine, diur\xe9tique, antalgique, antihypertenseur.\n      -\trelais de cat\xe9cholamines\n      -\tintubation (collapsus de reventilation)\n      -\tmobilisation\n      -\tbranchement d\u2019une dialyse\n      -\tperte de poids sur la dialyse\n      -\tsi cat\xe9cholamine en cours, v\xe9rifier les voies (fixation, ligne coud\xe9e, clamps, bulles d\u2019air)\n\nNB : si clamp ferm\xe9 sur la ligne de cat\xe9cholamine en cours, ne pas d\xe9clamper car risque de bolus, penser \xe0 d\xe9connecter la SAP en cours, la reconnecter et enfin retirer le clamp.\n\n-\tRelever les param\xe8tres \xe9ventuels associ\xe9s :\n      -\ttachycardie\n      -\tfi\xe8vre et /ou frissons\n      -\tdiur\xe8se importante \n-\test-ce que le ou la patiente r\xe9pond \xe0 l\u2019\xe9preuve du lever de jambe passif.\n\n+++\tPREVENIR LE REANIMATEUR ET L\u2019INFORMER DES DONNEES UTILES RELEVEES +++\n\nConfirmation du diagnostic m\xe9dical par : \n\n      -\tSi le patient est porteur d\u2019un PICCO, le m\xe9decin fera \xe9ventuellement une mesure qui permettra de savoir si le patient n\xe9cessite un remplissage vasculaire ou non. Dans le cas \xe9ch\xe9ant, ce sera l\u2019instauration de cat\xe9cholamines.\n      -\tLe m\xe9decin peut aussi r\xe9aliser une \xe9chographie trans thoracique.\n\n",null,null,null,null,null,null,null,null,null)
