B.bit=new A.a("-\tSHA\n-\tHabillage de l\u2019IDE : se r\xe9f\xe9rer \xe0 l\u2019isolement en cours du patient\n-\tAntiseptique alcoolique \xe0 2% type chlorexhidine\n-\tCompresses st\xe9riles\n-\tG5% ou NaCl \xe0 0,9% (en fonction du m\xe9dicament)\n-\tCat\xe9cholamine prescrit\n-\tSAP de 50 ml avec embout luer lock\n-\tTrocard\n-\tR\xe9ceptacle \xe0 aiguilles usag\xe9es\n-\tV1 : prolongateur avec valve anti retour et valve bidirectionnelle => \xe0 utiliser pour le rin\xe7age de la voie.\n-\tV2 : prolongateur avec valve anti retour + octopus 2 voies avec valves bidirectionnelles et clamps => \xe0 utiliser pour le changement de dilution.\n-\tV3 : 1 octopus avec valves bidirectionnelles et clamps + 1 prolongateur avec valve anti retour + 2 \xe8me octopus avec valves bidirectionnelles et clamps (pour les relais) => \xe0 utiliser \xe0 l\u2019instauration des cat\xe9cholamines exception faite de la Dobu (mat\xe9riel sp\xe9cifique).\n-\tProlongateur avec clamp, valve anti retour et valve bidirectionnelle => \xe0 utiliser pour la Dobu\n\n",null,null,null,null,null,null,null,null,null)
B.biu=new A.a("4.5.1\tPr\xe9paration de la ligne des cat\xe9cholamines\n\n-\tUtiliser les 4 premiers PSE au plus pr\xe8s de la base intelligente (les relais ne seront pas accept\xe9s par la base intensive si PSE trop en hauteur)\n-\tUtiliser le V3 pour l\u2019instauration des cat\xe9cholamines (sauf dobu : ligne avec clamp).\n-\tR\xe9aliser une d\xe9sinfection des mains par friction avec une SHA.\n-\tPr\xe9parer la seringue de cat\xe9cholamines.\n-\tMonter les 2 octopus du V3 avec le prolongateur entre les 2, l\u2019octopus le plus court sera celui o\xf9 sera branch\xe9 les seringues .\n-\tPr\xe9parer une seringue de 10 ml avec du NaCl \xe0 0,9% pour purger la 1\xe8re ligne de l\u2019octopus qui servira ult\xe9rieurement (soit \xe0 un changement de dilution ou au rin\xe7age de la voie).\n-\tPurger cette voie avec le NaCl \xe0 0,9% et clamper.\n",null,null,null,null,null,null,null,null,null)
