B.bjh=new A.a("-La fibroscopie bronchique ou bronchoscopie est un examen peu invasif, qui sert \xe0 explorer la trach\xe9e et les bronches d\u2019une personne en introduisant dans l\u2019arbre bronchique un fibroscope afin de visualiser des anomalies et de r\xe9aliser des pr\xe9l\xe8vements.\n\nLBA : lavage broncho-alv\xe9olaire\nBPCO : bronchopneumopathie chronique obstructive\nNaCl : Chlorure de sodium\nFR : fr\xe9quence respiratoire\nPEP : pression expiratoire positive\nMHC : Masque \xe0 haute concentration\nFio2 : Fraction inspir\xe9e en oxyg\xe8ne\n",null,null,null,null,null,null,null,null,null)
