B.bjF=new A.a("Estimation de la vol\xe9mie\n\nEn cas d'hypovol\xe9mie s\xe9v\xe8re, l'\xe9chographie bidimensionnelle retrouve de petites cavit\xe9s ventriculaires hyperkin\xe9tiques avec collapsus systolique des parois du ventricule gauche (VG). Le plus souvent, le diagnostic est moins \xe9vident et d'autres param\xe8tres doivent \xeatre utilis\xe9s. En pratique, la vol\xe9mie peut \xeatre analys\xe9e soit par des indices statiques, soit par des indices dynamiques. Le principe des indices dynamiques repose sur l'id\xe9e qu'en ventilation m\xe9canique contr\xf4l\xe9e, l'amplitude des variations respiratoires de pression art\xe9rielle est corr\xe9l\xe9e la vol\xe9mie efficace [55]. En d'autres termes, une expansion vol\xe9mique a d'autant plus de chances d'augmenter le d\xe9bit cardiaque que les variations ventilatoires de pression art\xe9rielle, exprim\xe9es en pourcentage, sont importantes. On parle alors de \xab pr\xe9charge-d\xe9pendance \xbb du d\xe9bit cardiaque. D'un point de vue physiologique, les indices dynamiques permettent de localiser un patient donn\xe9 sur la courbe de fonction ventriculaire de Franck-Starling sans conna\xeetre cette derni\xe8re. Des variations de pression art\xe9rielle diff\xe9rentielle (ou puls\xe9e = PP) de plus de 13 % affirment que le patient se trouve sur la portion verticale de la courbe de fonction ventriculaire, laissant augurer une r\xe9ponse positive \xe0 l'expansion vol\xe9mique. A contrario, une oscillation ventilatoire de la PP de moins de 13 % montre que le patient se trouve sur la portion horizontale de la courbe de fonction ventriculaire, signifiant que l'expansion vol\xe9mique est inutile voire d\xe9l\xe9t\xe8re. En \xe9chographie, l'\xe9tude des indices dynamiques est facilit\xe9e par l'enregistrement simultan\xe9 des pressions des voies a\xe9riennes affich\xe9 sur l'\xe9cran de la machine d'\xe9chographie.\n\nEstimation de param\xe8tres statiques de pr\xe9charge\n\nMesure des dimensions du ventricule gauche\n\nLe diam\xe8tre, la surface et le volume du VG sont mesurables, mais la surface t\xe9l\xe9diastolique du VG (STDVG) est la mesure la plus utilis\xe9e. Elle est r\xe9alis\xe9e selon l'incidence petit axe passant par les piliers mitraux parasternale en ETT et transgastrique en ETO. La STDVG, refl\xe9tant le volume du VG, serait corr\xe9l\xe9e \xe0 la pr\xe9charge ventriculaire. Classiquement, la valeur de STDVG est significativement plus basse chez les r\xe9pondeurs que chez les non-r\xe9pondeurs au remplissage vasculaire. Il existe \xe9galement une relation significative entre la STDVG basale et le pourcentage d'augmentation du VES apr\xe8s remplissage vasculaire [56]. Cependant, il est impossible de d\xe9finir une valeur seuil discriminant les patients r\xe9pondant au remplissage vasculaire. Trois \xe9l\xe9ments permettent d'expliquer ces r\xe9sultats : des dyskin\xe9sies segmentaires peuvent fausser les mesures, la valeur de la STDVG n'est pas forc\xe9ment interpr\xe9table (en termes de pr\xe9charge) s'il existe une cardiopathie dilat\xe9e ou hypertrophique, enfin, la STDVG, comme tout index statique, ne mesure pas la pr\xe9charge-d\xe9pendance, toutefois, comme pour tout indice statique, une valeur tr\xe8s basse (< 5 cm2/m2) reste tr\xe8s sp\xe9cifique d'une pr\xe9dictibilit\xe9 de r\xe9ponse au remplissage vasculaire [57].\n\nLe Doppler permet une \xe9valuation non-invasive de ces pressions de remplissage. La vitesse d'une colonne de sang mesur\xe9e par Doppler est proportionnelle au gradient de pression r\xe9gnant en amont et en aval du point de mesure. Ce gradient de pression d\xe9pend de nombreux facteurs, dont les conditions de charge. C'est le flux mitral par Doppler puls\xe9 qui a \xe9t\xe9 le plus \xe9valu\xe9. Le profil mitral diastolique d'un patient en rythme sinusal pr\xe9sente deux ondes ; une premi\xe8re onde E (remplissage ventriculaire passif) et une deuxi\xe8me onde A (remplissage ventriculaire par contraction auriculaire). Une baisse des pressions de remplissage entra\xeene une diminution de l'onde E et une augmentation du temps de d\xe9c\xe9l\xe9ration de l'onde E (TDE) (figure 9). \xc0 l'inverse, une \xe9l\xe9vation des pressions de remplissage augmente l'amplitude de l'onde E. Un rapport E/A > 2 semble en r\xe9animation constituer un excellent \xe9l\xe9ment de pr\xe9diction d'une PAPO > 18 mmHg, avec une valeur pr\xe9dictive positive de 100 % [48]. Les valeurs interm\xe9diaires de l'onde E et du rapport E/A sont toutefois inexploitables car elles d\xe9pendent des conditions de charge, de la relaxation du VG et de l'\xe2ge. La vitesse de d\xe9placement de l'anneau mitral en protodiastole \xe9valu\xe9e par Doppler tissulaire puls\xe9 (Ea) est un param\xe8tre relativement ind\xe9pendant des conditions de charge du VG, mais en revanche un bon indicateur de la relaxation du VG. Ainsi, le rapport entre la vitesse maximale de l'onde E (d\xe9pendant de la pr\xe9charge et de la relaxation = Vmax E) et la vitesse maximale de l'onde Ea (d\xe9pendant de la relaxation = Vmax Ea) permet d'annuler au num\xe9rateur et au d\xe9nominateur la relaxation. Dans ces conditions, le rapport Vmax E/Vmax Ea serait donc d\xe9pendant uniquement de la pr\xe9charge. Chez des patients de cardiologie, un rapport Vmax E/Vmax Ea sup\xe9rieur \xe0 10 permettait de pr\xe9dire une PAPO sup\xe9rieure \xe0 15 (sensibilit\xe9 = 97 % et sp\xe9cificit\xe9 = 78 %) [58]. Une vision simpliste est donc de consid\xe9rer que les valeurs < 10 correspondent \xe0 des pressions gauches basses et inversement, des valeurs > 10 correspondent \xe0 des pressions gauches \xe9lev\xe9es. En r\xe9animation, les valeurs < 7 semblent correspondre \xe0 des pressions basses et les valeurs > 11 \xe0 des pressions \xe9lev\xe9es [59]. Des valeurs > 15 sont tr\xe8s \xe9vocatrices de pressions gauches tr\xe8s \xe9lev\xe9es [60]. La technique d'enregistrement combin\xe9e du Doppler mitral et du Doppler tissulaire \xe0 l'anneau mitral est r\xe9sum\xe9e sur la figure 12.\n",null,null,B.Z,null,null,null,null,null,null)
