B.bk2=new A.a("DOPPLER TRANSCR\xc2NIEN (DTC)\nPrincipes g\xe9n\xe9raux\nEn 1982, Aaslid et al. [107] ont ouvert une nouvelle voie dans le domaine du monitorage neurologique en d\xe9montrant que l'analyse h\xe9modynamique c\xe9r\xe9brale par effet Doppler \xe9tait possible, fiable et bien adapt\xe9e \xe0 la pratique clinique [107] [108]. Le succ\xe8s de la technique repose sur deux grands principes : a) utilisation de sondes \xe0 basse fr\xe9quence (2 MHz) et de forte puissance acoustique permettant une bonne p\xe9n\xe9tration osseuse ; b) exploration des vaisseaux c\xe9r\xe9braux par voie temporale, qui constitue la r\xe9gion de la bo\xeete cr\xe2nienne la plus fine en termes d'\xe9paisseur.\n\nEn clinique, le DTC peut \xeatre analys\xe9 par examen Doppler pur ou \xe9chographie-Doppler.\n\n\xb7 Le DTC exclusif est r\xe9alis\xe9 gr\xe2ce \xe0 des appareils sp\xe9cifiques, portables, bien adapt\xe9s aux situations d'urgence. Ils ne permettent qu'un examen Doppler sans image 2D (DTC exclusif). Le rep\xe9rage du signal Doppler se fait de fa\xe7on auditive et visuelle, le flux \xe9tant rep\xe9r\xe9 au son, puis affin\xe9 sur l'\xe9cran qui visualise les vitesses en ordonn\xe9e (flux positifs si le flux vient vers la sonde, n\xe9gatif si le flux s'\xe9loigne de la sonde) et le temps en abscisse.\n\n\xb7 L'\xe9chographie-Doppler permet l'analyse du DTC \xe0 l'aide de la machine d'\xe9chographie du service (figure 24), il ne requiert donc pas l'acquisition d'un dispositif suppl\xe9mentaire. La sonde de cardiologie (1 \xe0 3 Mhz) permet parfaitement ce type d'examen. Il faut donc veiller, lors de l'acquisition de la machine, \xe0 ce que cette derni\xe8re soit \xe9quip\xe9e d'un logiciel informatique permettant l'analyse automatis\xe9e du DTC : calcul des vitesses moyennes, des indices de pulsatilit\xe9 et de r\xe9sistance (cf. infra). L'\xe9chographie permet une visualisation en image bidimensionnelle des vaisseaux intracr\xe2niens par le Doppler couleur qui facilite le rep\xe9rage des art\xe8res c\xe9r\xe9brales, en particulier de l'art\xe8re c\xe9r\xe9brale moyenne (ACM) (figure 24 et figure 25).\n",null,null,B.Z,null,null,null,null,null,null)
