B.bl3=new A.a("                \n                \n                Crit\xe8res de r\xe9utilisation du CIVLD:\n                  -Apyrexie\n                  -Pas de signes locaux d\u2019infection\n                  -H\xe9moculture fin de traitement (J11), n\xe9gative \xe0 48 h (J13)\n                  -En cas de n\xe9cessit\xe9 de verrou intermittent \xe0 partir de J4 (cf Diapo 5)\n                \n                      ",null,null,null,null,null,null,null,null,null)
B.bl6=new A.a("\xc9tude du flux d'\xe9jection ventriculaire gauche (flux sous- et transaortiques)\n\nCe flux est enregistr\xe9 en coupe 5 cavit\xe9s. Ce flux fuit la sonde et est donc cod\xe9 en bleu en couleur. Son orientation est parall\xe8le au septum interventriculaire. La constatation d'un flux couleur bleu homog\xe8ne (absence d'aliasing) signe qu'il n'existe aucune acc\xe9l\xe9ration pathologique du flux. On peut alors positionner la fen\xeatre de Doppler puls\xe9 dans le ventricule gauche, juste sous la valve aortique. On obtient alors un spectre n\xe9gatif, dont l'int\xe9grale (surface) peut \xeatre trac\xe9e gr\xe2ce au logiciel qui \xe9quipe toutes les machines d'\xe9chographie. Cette int\xe9grale temps-vitesse (ITV) sous-aortique repr\xe9sente alors indirectement le volume d'\xe9jection systolique et permet de calculer le d\xe9bit cardiaque (cf. infra). Physiologiquement, la vitesse maximale du flux d'\xe9jection ventriculaire gauche est inf\xe9rieure \xe0 1,5 m \xb7 s-1. En cas d'acc\xe9l\xe9ration, un obstacle \xe0 l'\xe9jection ventriculaire doit \xeatre suspect\xe9, les 2 causes principales \xe9tant l'obstruction intraventriculaire (cardiomyopathie hypertrophique obstructive) et la st\xe9nose aortique. L'enregistrement du flux en Doppler continu devient alors imp\xe9ratif compte tenu des vitesses \xe9lev\xe9es (figure 8). Au cours de la cardiomyopathie obstructive, il existe un aspect typique en Doppler continu, dit en \xab lame de sabre \xbb. Au cours de la st\xe9nose aortique, le flux est acc\xe9l\xe9r\xe9 sans aspect en lame de sabre (figure 4).\n\nDoppler tricuspidien\n\nIl existe une fuite tricuspide physiologique chez une majorit\xe9 de sujets sains. En cas d'hypertension art\xe9rielle pulmonaire (HTAP), cette fuite s'aggrave et la v\xe9locit\xe9 maximale (Vmax) de cette derni\xe8re devient proportionnelle au degr\xe9 d'HTAP. Le gradient de pression (\u0394 P) entre le ventricule droit et l'art\xe8re pulmonaire est alors obtenu gr\xe2ce \xe0 la formule :\n\n\u0394 P = 4 \xd7 (Vmax)2\n\nEn ajoutant la valeur de la pression de l'oreillette droite (POD) \xe0 ce gradient de pression, on obtient la valeur de pression de l'art\xe8re pulmonaire systolique (PAPs) :\n\nPAPs = \u0394 P + POD\n\nLa valeur de la POD peut \xeatre obtenue en mesurant la pression veineuse centrale. Si le patient n'est pas \xe9quip\xe9 d'un cath\xe9ter veineux central, la POD peut \xeatre \xe9valu\xe9e chez le patient en ventilation spontan\xe9e en \xe9chographie transthoracique en mesurant le diam\xe8tre de la VCI et ses variations ventilatoires (tableau II).\n",null,null,B.Z,null,null,null,null,null,null)
