B.bmI=new A.a("Les diminutions de cat\xe9cholamines se font de 0,1 en 0,1 mg/h (et non pas de 0,1 ml/h) toutes les 30 \xe0 60 minutes : dur\xe9e entre chaque pallier permettant de juger de la stabilit\xe9 h\xe9modynamique. \nA noter que quand le patient est \xe0 des doses importantes au d\xe9but, il est possible de diminuer de 0,2 mg/h. Dans tout les cas, se sera la PAM qui d\xe9terminera le rythme du sevrage.\nSi changement de dilution programm\xe9e en relai automatis\xe9, le changement doit se r\xe9aliser par la personne qui l\u2019a programm\xe9 et en dehors des mobilisations car risque d\u2019instabilit\xe9 h\xe9modynamique.\nA la fin d\u2019une p\xe9riode de sevrage des cat\xe9cholamines, il est avis\xe9 de commencer le rin\xe7age de la voie \xe0 un faible d\xe9bit afin de ne pas provoquer de bolus.\n\n-\tA l\u2019arr\xeat des cat\xe9cholamines :\n      -\tPr\xe9parer une SAP de NaCl \xe0 0,9% pour le rin\xe7age de la voie.\n      -\tUtiliser la ligne V1.\n      -\tPurger la ligne enti\xe8re.\n      -\tLa connecter sur la voie relais et d\xe9marrer \xe0 la vitesse des cat\xe9cholamines ant\xe9rieure \xe0 l\u2019arr\xeat.\n      -\tMonter progressivement le d\xe9bit toutes les  30 minutes sur au moins 4 heures afin de s\u2019assurer du rin\xe7age de la voie. \n      -\tA la d\xe9connection, retirer la valve bidirectionnelle, faire un reflux de 3 \xe0 4 ml, un rin\xe7age puls\xe9 au NaCl \xe0 0,9% avec une seringue de 10 ml et connecter la nouvelle valve pr\xe9alablement purg\xe9e (manipulation avec gants st\xe9riles). Clamper la voie proximale.\n",null,null,null,null,null,null,null,null,null)
