B.bng=new A.a("Coupe parasternale grand axe (PSGA)\n\nLa sonde est appliqu\xe9e au bord gauche du sternum, son axe suivant une ligne imaginaire reliant le mamelon gauche \xe0 la zone m\xe9dio-claviculaire droite (figure 6 et figure 7). Cette coupe montre l'ensemble des cavit\xe9s cardiaques, mais son int\xe9r\xeat est limit\xe9 en r\xe9animation \xe0 l'\xe9tude de 4 \xe9l\xe9ments : le p\xe9ricarde post\xe9rieur qui appara\xeet hyper\xe9chog\xe8ne \xe0 l'\xe9tat physiologique et qui peut \xeatre le si\xe8ge d'un \xe9panchement, le diam\xe8tre de la chambre de chasse du VG qui est utile au calcul du d\xe9bit cardiaque, la fraction de raccourcissement du VG en mode TM qui appr\xe9cie grossi\xe8rement la fonction systolique, les valves aortiques et mitrales en mode 2D et Doppler couleur pour la d\xe9tection rapide d'une valvulopathie majeure.\n\nCoupe parasternale petit axe (PSPA)\n\n\xc0 partir de la position pr\xe9c\xe9dente, on applique \xe0 la sonde une rotation de 90o dans le sens horaire (figure 4). Cette coupe visualise alors le VG et le VD en coupe transversale, s\xe9par\xe9s par le septum interventriculaire. L'int\xe9r\xeat de cette coupe est d'analyser la cin\xe9tique r\xe9gionale du VG puisqu'elle montre la paroi lat\xe9rale, ant\xe9rieure, post\xe9rieure et le septum interventriculaire (SIV). Cette coupe permet \xe9galement d'appr\xe9cier la cin\xe9tique globale du VG en \xe9valuant la fraction d'\xe9jection du VG, soit en mode TM avec calcul de la fraction de raccourcissement, soit en mode 2D avec calcul de la fraction de raccourcissement de surface. Cette coupe a enfin un int\xe9r\xeat majeur dans le diagnostic du c\u0153ur pulmonaire aigu ou elle permet la mise \xe9vidence du septum paradoxal.\n\nCoupe apicale 4 et 5 cavit\xe9s\n\nCes deux coupes sont obtenues en positionnant la sonde au-dessous et en dehors du mamelon gauche, en \xab visant \xbb l'\xe9paule droite, l'axe de la sonde \xe9tant horizontal. On obtient ainsi une coupe ou la pointe du c\u0153ur se trouve dans le sommet du c\xf4ne d'image, les 4 cavit\xe9s cardiaques (VG, VD, OG, OD) sont visualis\xe9es en positionnant par convention les cavit\xe9s gauches \xe0 droite de l'image. En imprimant une bascule minime (10o) de la sonde vers le bras droit du patient, on d\xe9gage la chambre de chasse du VG qui constitue la cinqui\xe8me cavit\xe9 et qui permet de recueillir le flux d'\xe9jection ventriculaire gauche n\xe9cessaire au calcul du d\xe9bit cardiaque. Ces 2 coupes sont les plus informatives en r\xe9animation, elles permettent une appr\xe9ciation globale de la fonction contractile ventriculaire droite et gauche, le diagnostic d'une valvulopathie mitrale, tricuspide ou aortique majeure (la valve pulmonaire n'est pas visualis\xe9e), le diagnostic d'une dilatation ventriculaire gauche et surtout droite. Un \xe9panchement p\xe9ricardique important sera bien visualis\xe9 sur ces coupes. Ces 2 coupes ont enfin un int\xe9r\xeat majeur car elles facilitent le recueil et l'\xe9tude de l'ensemble des flux Doppler intracardiaques (\xe0 l'exception du flux de l'art\xe8re pulmonaire) qui permettent l'\xe9valuation des pressions de remplissage gauche, de la pression art\xe9rielle pulmonaire et la quantification grossi\xe8re d'une valvulopathie par Doppler couleur.\n\nCoupe apicale 2 et 3 cavit\xe9s\n\nCes 2 coupes sont obtenues \xe0 partir de la pr\xe9c\xe9dente en effectuant une rotation de 90o de la sonde dans le sens antihoraire. Comme pr\xe9c\xe9demment, on passe de la coupe 2 \xe0 3 cavit\xe9s en effectuant une bascule minime de la sonde. La coupe 2 cavit\xe9s montre le VG et l'OG dans leur grand axe longitudinal, la coupe 3 cavit\xe9s montre les m\xeames \xe9l\xe9ments plus la chambre de chasse du VG et la valve aortique. L'int\xe9r\xeat de ces coupes est de pouvoir \xe9tudier la cin\xe9tique des parois ant\xe9rieures et inf\xe9rieures du VG, non vues sur les coupes 4 et 5 cavit\xe9s. Elles permettent aussi l'enregistrement du flux d'\xe9jection VG lorsque celui-ci n'a pu \xeatre recueilli en 4 ou 5 cavit\xe9s.\n\nCoupes sous-costales\n\nLa sonde est appliqu\xe9e au creux \xe9pigastrique, horizontalement, en \xab visant \xbb le m\xe9diastin. On obtient alors une coupe 4 cavit\xe9s, oblique sur l'\xe9cran. En effectuant une rotation de 90o dans le sens antihoraire et en \xab visant \xbb le foie, on peut d\xe9rouler la veine cave inf\xe9rieure en coupe longitudinale. L'\xe9tude des variations respiratoires de la veine cave est fondamentale pour \xe9tudier la pr\xe9charge-d\xe9pendance cardiaque. Bien que moins pr\xe9cise en termes anatomique et ne permettant pas un bon alignement des flux Doppler, cette coupe reste parfois la seule exploitable lorsque le patient est peu \xe9chog\xe8ne et fournit des \xe9l\xe9ments 2D pr\xe9cieux : fonction systolique VG et VD visuelles, \xe9panchement p\xe9ricardique. En appliquant une rotation de la sonde de 90o dans le sens anti horaire et en \xab visant \xbb le m\xe9diastin, on peut r\xe9aliser une coupe transversale fournissant une image et des informations comparables \xe0 la coupe PSPA.\n",null,null,B.Z,null,null,null,null,null,null)
B.bnh=new A.a("Dur\xe9e d'une Antibioth\xe9rapie en R\xe9animation",null,B.am,null,null,null,null,null,null,null)
B.bnk=new A.a("Les cat\xe9cholamines doivent \xeatre manipul\xe9es avec pr\xe9caution et \xeatre administr\xe9es sur une voie veineuse de tr\xe8s bonne qualit\xe9 voir une voie centrale r\xe9serv\xe9e (proximale) \xe0 cette th\xe9rapeutique.\nTout patient b\xe9n\xe9ficiant d\u2019un traitement par cat\xe9cholamine doit \xeatre plac\xe9 sous \xe9troite surveillance avec monitorage en continu, la surveillance de la pression art\xe9rielle se fait id\xe9alement avec un KTA. Le r\xe8glage des alarmes est \xe0 adapter en fonction des constantes du patient et des objectifs de PAM prescrits.\nLes variations de posologie se font progressivement tout en surveillant la PAM et la fr\xe9quence cardiaque.\n(intol\xe9rance de la Dobu = tachycardie)\n\nPREVENIR MEDECIN SI AUGMENTATION DE PLUS DE 2mg/h : notion de gravit\xe9 de l\u2019\xe9tat du patient.\n\nNB : En cas d\u2019occlusion de la tubulure ou pression \xe9lev\xe9e sur PSE , il faut rel\xe2cher la pression avant de lever l\u2019obstacle sinon risque de bolus (fermer le clamp, d\xe9sadapter le prolongateur, laisser \xe9couler le produit sur une compresse, rebrancher le prolongateur, d\xe9clamper la voie et redemarrer le PSE).\n",null,null,null,null,null,null,null,null,null)
