B.bog=new A.a("-\tD\xe9sinfecter \xe0 l\u2019aide de compresses imbib\xe9es de solution hydroalcoolique la valve bidirectionnelle de la voie proximale.\n-\tConnecter la ligne de cat\xe9cholamine pr\xe9alablement purg\xe9e sur la voie proximale et d\xe9clamper.\n\n\n4.5.3\tProgrammation d\u2019un relais\n\n-\tPenser \xe0 programmer un relais suivant la vitesse en cours MAIS attention \xe0 ne pas d\xe9passer une dur\xe9e > \xe0 24h de pr\xe9paration de produit pour la stabilit\xe9 et l\u2019efficacit\xe9 de celui-ci.\n\nA)\tRelais automatis\xe9 (recommand\xe9 pour \xe9viter au maximum les fluctuations h\xe9modynamiques)\n\n\u25ab\ta) Mise en place : \n\n-\tInstaller la SAP de cat\xe9cholamine (m\xeame dilution) dans un PSE proche de celui en cours.\n\n",null,null,null,null,null,null,null,null,null)
