B.bpp=new A.a("Afin de promouvoir la gestion des risques associ\xe9s aux soins, il a \xe9t\xe9 d\xe9cid\xe9 de r\xe9diger une proc\xe9dure explicative sur le d\xe9roulement d\u2019une fibroscopie bronchique en r\xe9animation. L\u2019objectif g\xe9n\xe9ral est de s\xe9curiser le geste et am\xe9liorer l\u2019efficacit\xe9 de sa r\xe9alisation, notamment pour les m\xe9decins, internes ou infirmiers arriv\xe9s r\xe9cemment dans le service.",null,null,null,null,null,null,null,null,null)
