B.brb=new A.a("-\tD\xe9sinfecter \xe0 l\u2019aide de compresses imbib\xe9es de solution hydroalcoolique la valve bidirectionnelle de l\u2019octopus d\xe9di\xe9 au relais.\n-\tConnecter l\u2019octopus \xe0 la SAP puis valider. \n\n\u25ab\tb) Changement de SAP une fois le relais pass\xe9 : \n\n-\tClamper la voie de l\u2019octopus o\xf9 la SAP relais est connect\xe9e.\n-\tRetirer l\u2019ancienne SAP et installer celle qui vient d\u2019\xeatre pr\xe9par\xe9e dans le PSE.\n-\tValider le code de la SAP. Faire une petite purge.\n-\tD\xe9sinfecter \xe0 l\u2019aide de compresses imbib\xe9es de solution hydroalcoolique la valve bidirectionnelle de l\u2019octopus d\xe9di\xe9 au relais.\n-\tConnecter l\u2019octopus \xe0 la SAP, d\xe9clamper puis valider.\n\n",null,null,null,null,null,null,null,null,null)
