B.bre=new A.a("Le flux mitral enregistre les flux de remplissage diastolique du VG. Il est fondamental pour l'\xe9tude des pressions de remplissage ventriculaire gauche. Il est obtenu \xe0 partir de la coupe 4 cavit\xe9s, en Doppler puls\xe9, en positionnant la fen\xeatre Doppler au ras de l'extr\xe9mit\xe9 des 2 feuillets mitraux (figure 8). Le flux mitral normal est positif, cod\xe9 en rouge en couleur et montre deux ondes : une pr\xe9coce appel\xe9e onde E (early = E) correspondant au remplissage passif, une t\xe9l\xe9diastolique, correspondant \xe0 la systole auriculaire appel\xe9e onde A (A = atrial). Il faut souligner que le profil mitral ne peut \xeatre analys\xe9 sans enregistrement simultan\xe9 de l'\xe9lectrocardiogramme, qui seul permet de diff\xe9rencier ces 2 ondes. L'onde E est situ\xe9e juste apr\xe8s l'onde T, l'onde A entre l'onde P et le complexe QRS. En cas de fibrillation auriculaire, l'onde A est absente. Le temps de d\xe9croissance de l'onde E (TDE = temps s\xe9parant le pic et le point de retour de l'onde E sur la ligne de base) est un param\xe8tre syst\xe9matiquement enregistr\xe9 lors de l'analyse du flux mitral. Toute la difficult\xe9 de l'analyse du flux mitral r\xe9side dans le fait que les ondes E et A varient avec l'\xe2ge et les pressions de remplissage. Il faut garder \xe0 l'esprit que l'amplitude de l'onde E diminue avec l'\xe2ge (tableau I) et les pressions de remplissage. Ainsi, une onde E de basse v\xe9locit\xe9 peut correspondre \xe0 une hypovol\xe9mie ou \xe0 une valeur physiologique chez un sujet \xe2g\xe9. Physiologiquement, le rapport E/A normal est compris entre 1 et 2. N\xe9anmoins, la vitesse de l'onde E diminuant avec l'\xe2ge, il n'est pas forc\xe9ment anormal d'observer une inversion du rapport E/A chez le sujet \xe2g\xe9. De la m\xeame fa\xe7on, un rapport E/A > 2 est fr\xe9quemment observ\xe9 chez le sujet jeune sans signification pathologique. On peut donc retenir qu'un rapport E/A invers\xe9 chez un sujet jeune signe dans la plupart des cas une hypovol\xe9mie, alors qu'un rapport E/A sup\xe9rieur \xe0 2 chez un sujet \xe2g\xe9 signe dans la plupart des cas des pressions de remplissage \xe9lev\xe9es [48]. Le temps de d\xe9c\xe9l\xe9ration de l'onde E (TDE) varie \xe9galement avec les pressions de remplissage. Le TDE s'allonge en cas d'hypovol\xe9mie et se raccourcit en cas d'hypervol\xe9mie ou de trouble de la distensibilit\xe9 du ventricule gauche. Les variations des ondes E, A et du TDE avec la vol\xe9mie sont r\xe9sum\xe9es dans la figure 9.\n",null,null,B.Z,null,null,null,null,null,null)
